	(139, '2020-11-24', 'Vila Mendes', 0, '1998-09-09', 'CAPS Adulto', 0, 'Sara Cristina da Silva\nEmerenciano', 'Encaminhada ao CAPS, quadro de ansiedade, depressão, crises de pânico, algumas tentativas de autoextermínio. Foi avaliada no CAPS, contra-referenciada para medicação ambularorial e posterior matriciamento. Agendada com Luciene psicóloga.', 'Agendado ASM 26/11/2020 as 08:00 h', 1, 'FINALIZADO'),
	(140, '2021-02-02', 'CAPS Adulto', 0, '1986-06-23', 'Vila Mendes', 100, 'Lilian Aparecida da Silva', 'Paciente compareceu com encaminhamento da Dra Tatiana, que no dia anterior já havia prescrito tratamento medicamentoso. Aconselho a quando medicar o paciente, aguardar que a medicação faça efeito para encaminhar ao CAPS. Paciente não foi absorvida pois no momento não apresenta perfil para atendimento neste serviço. Caso tenha dúvidas em medicar o paciente, sugiro matriciar e conversar com ASM.', 'Agendado ASM 04/02 Dra Rejane', 1, 'FINALIZADO'),
	(141, '2021-02-02', 'CAPS Adulto', 0, '1978-07-29', 'Vila mendes', 100, 'Vagner Lucio Gomes', 'Avaliado na entrevista da plantonista do CAPS. Necessita de assistência em Saúde Mental a nível ambulatorial (psiquiatria e psicologia)', 'Busca ativa ESF, psicoterapia e psiquiatria se necessário.', 1, 'FINALIZADO'),
	(142, '2021-02-02', 'CAPS Adulto', 2426, '1955-08-23', 'Vila Mendes', 166, 'Mario Lucio Paraizo', 'Paciente relata tremores, faz uso por conta prórpia de Biperideno 2cp ao dia, relata que a Dra Rejane orientou o aumento (sem referência em mãos). SIC, apresentou melhora dos tremores com o aumento da dose. CID F31.8+ F10 ( Não ativo)', 'Manutenção medicação ESF', 1, 'FINALIZADO'),
	(143, '2021-02-02', 'CAPS i', 1422, '2008-11-17', 'Vila Mendes', 144, 'Maria Vitória Vilela Silva', 'Tentativa de auto-extermínio dia 05/01/21, notificada na UPA.', 'Busca ativa e reencaminhamento para o CAPS i', 1, 'FINALIZADO'),
	(144, '2021-03-09', 'CAPS Adulto', 2081, '1975-06-01', 'Vila Mendes', 63, '        Magno de Assis', 'Vem encaminhado pela Dra. Tatiane para reavaliação das medicações. Em uso de: Risperidona 3mg(1-0-1) + Alprazolam 2mg(0-0-1) + Rivotril gts (0-0-40) + Biperideno 2mg(2-0-0) +Prometazina 25mg(0-0-2), clomipamina 25mg. Em contato com Dra. Tatiane, discutimos o caso pelo telefone com Dra. Rejane,orienta reiniciar Clomipramina 25mg ( 0-0-2), reavaliá-lo no dia 08/03.No matriciamento discutir. F29', 'Manutenção ESF', 1, 'FINALIZADO'),
