	(147, '2021-03-09', 'Vila Mendes', 25, '1964-07-20', 'CAPS Adulto', 0, 'Edvania Petruci Aprelino', 'Quadro grave diagnostico não fechado passou em avaliaçao psicologica atendida com lesões no braço. Ansiedade,sintomas depressivos, inquietação, agitação motora,lesões de auto-mutilação, conflitos familiares, dificuldade de socialização e estabelecer relações,vitiligo. Em uso de Escitalopram ', 'Agendado ASM 10/03 e acompanhamento psicologico', 1, 'FINALIZADO'),
	(148, '2021-03-09', 'CAPS ad ', 2948, '1962-06-28', 'Vila Mendes', 268, 'Roberto da Silva Constantino', 'F10 internação em Três Pontas, acompanhamento intensivo. Sintomas de demência. Em uso donezepila 10 mg', 'Visita ESF, contato  posterior com CAPS Ad', 1, 'FINALIZADO'),
