	(150, '2021-03-09', 'Vila Mendes', 26, '1977-12-04', 'CAPS Adulto', 9826, 'Ricardo dos Santos ', 'F61+ F60.4 transtorno de personalidade Histriônica. Faz uso de : Oxacarbamazepina 300 mg 101 Clonazepam 2 mg 001 Vigilante armado, 2 acidentes automobilistico e uso de alcool e droga no passado.  ', '\nAvaliação no ESF', 1, 'FINALIZADO'),
	(151, '2021-04-06', 'CAPS Adulto', 10700, '1973-03-17', 'Vila Mendes ', 86, 'Ana Paula Martins Reis', 'Encaminhada para o ESF para continuação de seu tratamento medicamentoso e psicologico. F33.2+ F48.8+ F61.0 Em uso de: Nortripitilina 50 mg 1-0-2, Clonazepam 2 mg 1-0-2, Carbonato de Litio 300 mg 1-0-1. Celina (prima) compareceu ao CAPS relatando que não conseguiu leva-la na Dra Rejane. Tendo crises de choro, medo, pensamentos ruins, falando em morte. ', 'Agendado ASM  08/04  aguardando psicoterapia ASM', 1, 'FINALIZADO'),
	(152, '2021-05-04', 'Vila Mendes', 255, '1974-09-14', 'CAPS Ad', 2492, 'Luiz Carlos Ferreira', 'Paciente usuário de álcool e crack, referenciado ao CAPS Ad, intencionando cessar o vício. F10.2 + F19.2', 'Aguardar o comparecimento do paciente ao CAPS Ad', 1, 'FINALIZADO'),
	(153, '2021-05-04', 'Vila Mendes', 268, '1962-06-28', 'CAPS Ad', 2948, 'Roberto da Silva Constantino', 'Quer voltar ao CAPS. Feitas varias visitas domiciliares, filho deficiente visual e esposa sequela AVC. Voltou a beber. Redução de danos. Solicitando laudo para BPC. Consultou com neurologista  F10.2', 'Aguardar o comparecimento do paciente ao CAPS Ad', 1, 'FINALIZADO'),
	(154, '2021-05-04', 'Vila Mendes', 155, '2002-06-19', 'CAPS i', 0, 'Gabriela Maria de Carvalho Ferreira', 'Já realizou tratamento no CAPS i , desconhece diagnóstico.  Ansiedade e compulsão alimentar de difícil controle. Aparente déficit cognitivo. Matriciamento para estabelecimento de diagnóstico. Em uso de: Rispiridona e topiramato ( Dr Italo). Síndrome de Irlen ( teste neuro psicológico Maria Antônia). Fazendo faculdade de estética. Atualmente em atendimento com Luciene, mãe "super protetora"', 'Acompanhamento psicológico ASM', 1, 'FINALIZADO'),
	(155, '2021-05-04', 'Vila Mendes', 14, '1968-01-30', 'CAPS Adulto', 0, 'Hassam Ali Salam', 'Paciente depressivo com relatos de pensamentos de auto-extermínio (em menos intensidade ultimamente), passou em atendimento psicológico dia 20/04, solicitado matriciamento para avaliar indicação de atendimento psiquiátrico. Em uso de : Escitalopram 10 mg Pregabalina 75 mg Relata problema de colula , aposentado e desaposentado, saqueiro por mais 20 anos.', 'Agendado ASM 05/05 ', 1, 'FINALIZADO'),
	(156, '2021-05-04', 'Vila Mendes', 93, '1994-08-12', 'CAPS Adulto', 0, 'Camila Silva de Oliveira', 'Paciente realizava acompanhamento rede particular (  Dr Daniel Lessa), não sabe ao certo seu diagnóstico, relata possível transtorno bipolar, fazia Uso de Carbolitium 300mg (0-0-2), Bupropiona 150 mg (1-0-0), Alprazolam 0,25mg (0-0-1), passou a renovar apenas a prescrição de Carbolitium 300mg 0-0-2. Matriciamento para discutir avaliação psiquiátrica, manutenção do tratamento.', 'Pedir litemia, segerido Carbolitium 300 mg 1-0-1 Manutenção medicação ESF', 1, 'FINALIZADO'),
	(157, '2021-06-01', 'Vila Mendes', 288, '1976-05-08', 'CAPS Adulto', 3148, 'Renata Aparecida Venga', ' Ansiedade de difícil controle, Em uso de: Rivotril 2 mg 0-0-2 e Duloxetina 60mg 1-0-0, eventualmente toma 01 cp a mais de Rivotril por conta própria.  F33+ F48.8+ F 63.2 +F61.0+F60.3 neurose grave, traços histericos, infantilizada. Duloxetina 90/120mg', 'Manutenção ESF, reajuste medicação e psicoterapia ASM.', 1, 'FINALIZADO'),
	(158, '2021-06-01', 'Vila Mendes', 166, '1955-06-14', 'CAPS Adulto', 1128, 'Suzelei de Fátima Barreto Paravizo', 'Depressão, sintomas persistentes, atendida na unidade em crise, paciente relata história de ideação suicida, paciente oncológica já em acompanhamento psicológico pela oncologia, em uso de: Clô 25mg (1-0-1), Venlafaxina 150mg (1-0-1), Quetiapina 75mg (0-0-1), Rivotril 2mg (0-0-1). Matriciamento para discutir avaliação psiquiátrica- desejo da paciente.', 'Agendado ASM 02/06/2021 OBS: Feito contato , preferiu manter acompanhamento com o Dr Marco Tulio', 1, 'FINALIZADO'),
	(159, '2021-06-29', 'Vila Mendes ', 66, '1989-02-26', 'CAPS Adulto', 2688, 'Aline Suele Euzebio', ' Depressão, esquizofrenia, D.Q, transtorno de pânico, alega estar sem tratamento há mais de 02 anos, vem apresentando angústia, tristeza, refere diversas tentativas de auto-extermínio. Não adere ao tratamento, marido D.Q', 'Busca ativa CAPS Adulto', 1, 'FINALIZADO'),
