	(161, '2021-07-27', 'Vila Mendes', 153, '1964-07-04', 'CAPS Adulto', 0, 'Ralph Ponciano Dominguetti', 'Em acompanhamento devido a sintomas depressivos, dúvida diagnóstica, avaliar agendamento com psiquiatra. Relata que colegas de trabalho falando mal, pediu demissão do serviço, com difículdades de convívio familiar. Histórico de abuso de etílicos, antecedentes familiares de etilismo e esquizofrenia  ', 'Agendado 09/08 9:30', 1, 'FINALIZADO'),
