	(165, '2021-08-24', 'CAPS Adulto', 9814, '1972-02-03', 'Vila Mendes', 66, 'Maria Elizabete Trindade Braz', 'Solcicito acompanhamento psicológico. Paciente passou por reavaliação psiquiátrica hoje, em caráter de urgência. F41.2 + F48.9  Em uso de: Imipramina 25mg 1-0-1 Haloperidol 1mg 1-0-0 Bromazepam 3 mg 1-0-0', 'Manutenção ESF e Psicoterapia.', 1, 'FINALIZADO'),
	(166, '2021-08-24', 'Vila Mendes / ASM', 250, '1999-10-22', 'CAPS Adulto', 0, 'Bruno Arcanjo Rosa', 'Tentativa de auto exterminio, quadro de esquizofrenia na familia. Solicitada por Luciene.', 'Agendado ASM 25/08/2021 ', 1, 'FINALIZADO'),
	(167, '2021-08-24', 'Vila Mendes / ASM', 160, '1983-04-22', 'CAPS Adulto', 0, 'Simone Maria Martins', 'Em tratamento com antidepressivo e psicoterapia. Luto prolongado pelo falecimento da mãe, tendo que assumir responsabilidade da casa e dos filhos, com persistência de sintomas. Demandando avaliação psiquiátrica. Em uso de: Escitalopram 10 mg (1-0-0) e Nortriptilina 25 mg (0-0-2). CID 10 F 70 F 43.2', 'Agendado ASM 25/08/2021 e Psicoterapia.', 1, 'FINALIZADO'),
	(168, '2021-08-24', 'CAPS Adulto ', 7257, '1967-05-19', 'Vila Mendes', 83, 'Marcelo Costa', 'Vem à consulta com orientação do CRAS com encaminhamento para o especialista (psiquiatra). Laudo para benefício. Matriciamento para avaliar agendamento no ASM. F33.2+ F48.8 Em uso de: Nortripitilina 25 mg 1-0-1, Haloperidol 1 mg 1-0-0, Diazepam 10 mg 0-0-1 tem laudo e encaminhamento do CAPS de 13/08/21', 'Manutenção ESF', 1, 'FINALIZADO'),
