	(171, '2021-09-28', 'Vila Mendes', 140, '1978-10-24', 'CAPS Adulto', 6007, 'Brígida Cristina Elias Campos', 'Paciente com transtorno não especificado, relata já ter sido acompanhada pelo CAPS. Apresenta aumento de sintomas de ansiedade, insônia e pânico. Matriciamento para avaliar atendimento pelo ambulatório de saúde mental. Em uso: Bromazepam 6mg (1-0-2), Topiramato 50mg (1-0-1), Bupropiona 150mg (1-0-1)', 'Transferido para o próximo matriciamento.', 1, 'FINALIZADO'),
	(172, '2021-09-28', 'Vila Mendes', 86, '1976-03-17', 'CAPS Adulto', 10700, 'Ana Paula Martins Reis', 'Paciente procura a unidade, relata não ter conseguido retornar com a Dra Rejane, veio solicitando renovação da prescrição das medicações. 99185-3882', 'Transferido para o próximo matriciamento. ', 1, 'FINALIZADO'),
	(173, '2021-09-28', 'Vila Mendes', 102, '2000-11-14', 'CAPS Adulto', 0, 'João Pedro Oliveira Silva', 'Paciente realizava tratamento psiquiátrico devido a sintomas de pânico, ansiedade, depressão, relata já ter feito uso de Lítio, atualmente em uso de Equilid e Fluoxetina. Mantém alguns sintomas e ansiedade', 'Transferido para o próximo matriciamento.', 1, 'FINALIZADO'),
