	(335, '2021-04-06', 'Bom Pastor', 0, '2000-04-26', 'CAPS Adulto', 11988, 'Luiz Eduardo Silva Araújo', 'Luciene (Psicóloga ) Bom Pastor, telefona informando que estava atendendo o paciente, preocupada por ser grave, da última vez que foi, suspendeu o acompanhamento com ela. Não aceita as medicações, recusa tratamento, foi da última vez essa semana, pediu receita só de Zolpidem. Discutimos o caso, oriento encaminhar novamente  ao CAPS pela urgência. - Rosana Coordenadora   F20.0 paciente em uso de : Doxazosina 2 mg (1/2.0.0) Propranolol 40 mg (1.0.1) Biperideno 2 mg(2.0.0) Sulpirida 200 mg (2.0.2) Amantadina 100 mg (1.0.1) Zolpidem 10 mg (0.0.1) Clonazepam 2 mg (0.0.1) Internado em Três Pontas /Upa Julho 2020', 'Manutenção CAPS Adulto, tentativa de estabelecimento de vínculo para início de tratamento na UBS.', 2, 'FINALIZADO'),
	(336, '2021-04-06', 'CAPS Adulto ', 12122, '1990-10-30', 'Bom Pastor ', 4749, 'Erika Dias Silva', 'Paciente relata não ter tido melhora, foi conversado com Dra Rejane, dia 16/03, a mesma fez receita de Alprazolan 2 mg. Solicitado acompanhamento na UBS, caso clínico julgue necessário, agendar atendimento no ASM. Em uso de: Venlafaxina 75 mg 3-0-3, Bupropiona 150 mg 1-0-1, Carbolitium 300 mg 1-0-1, Dorene Tabs 75 mg 1-0-1,  Quetiapina 100 mg 0-0-2. Suspendeu o uso de Quetiapina e Carbolitium por conta própria.', 'Agendado ASM 07/04 ', 2, 'FINALIZADO'),
	(337, '2021-05-04', 'Bom Pastor', 3109, '1957-11-01', 'CAPS Ad', 2660, 'Sebastião Israel Coelho', 'Etilista. Ficou internado em Lavras de fevereiro a novembro de 2020. Não se reconhece como dependente, alega que bebe cervejinhas sem problemas com elas. Acessa o serviço por crise de labirintite. Médica quer discutir qual medicamento pode ser usado para  quadro apresentado. Glaucoma, catarata F10.2 Demanda familiar, abstinente há 1 mês', 'Manutenção UBS e encaminhamento CAPS Ad s/n', 2, 'FINALIZADO'),
	(338, '2021-06-01', 'CAPS Adulto', 0, '1993-09-18', 'Bom Pastor ', 2319, 'Olivia de Fátima Brasil', 'Lenice (mãe) comparece relatando que a filha fazia tratamento com psiquiatra particular há bastante tempo e que deu continuidade no ESF Bom Pastor. Relata ser diabética, síndrome do intestino irritavel, Transtorno depressivo de moderado a grave, ansiedade.', 'Agendado 02/06/2021 ASM Articulação da rede ', 2, 'FINALIZADO'),
	(339, '2021-07-27', 'CAPS Adulto', 0, '1989-02-11', 'Bom Pastor', 0, 'Camila Ap. Carvalho Rodrigues', 'Compareceu em acolhimento 08/07 desejando uma segunda opinião para seu caso e a transferência de seu tratamento para a rede pública. Encontra-se estável e medicada, pois está em tratamento com Dr. Daniel pela rede privada, com diagnóstico TBH. Em uso de: Carbolitium 300 mg 1-0-2 Quetiapina 100 mg 0-0-2 Zolpidem10 mg 0-0-1/2 Lamotrigina ? 0-0-2 Teve um surto há dois anos, refere que a mãe é portadora de Esquizofrenia, abuso na infancia, comportamentos de risco, automutilação, estável mas sobrecarregada pela maternidade, bebe de 2 meses. Verificar a possibilidade de avaliação psiquiátrica pela Dra. Rejane e de atendimento psicológico com Luciene ', 'Manter medicacao UBS e aguardar psicoterapia ASM', 2, 'FINALIZADO'),
	(340, '2021-07-27', 'CAPS i', 249, '2011-02-02', 'Bom Pastor', 0, 'Miguel Penha Custódio', 'Encaminhamento da mãe Claudia para UBS', 'Manutenção CAPS i', 2, 'FINALIZADO'),
