	(343, '2021-09-28', 'CAPS i ', 0, '2004-01-09', 'Bom Pastor / ASM', 70, 'Raul Ribeiro Pechir', 'Paciente com diagnóstico de autismo, bastante funcional, com conflitos com a adolescência e uso de medicações desde os 9 anos. Com mudança de cidade precisa rever medicações e iniciar inserção de tratamento no território. Está em acompanhamento estendido no CAPSi, com acompanhamento terapêutico aos serviços da rede, visto que completará 18 anos em janeiro.', 'Consulta psiquiátrica / ASM acompanhamento psicológico familiar', 2, 'FINALIZADO'),
