	(349, '2022-02-01', 'Bom Pastor', 3871, '1959-08-13', 'CAPS Adulto', 0, 'Jacy Fagundes Gouveia ', 'Retorno A.S.Realizado atendimento com a companheira Sra. Simone que afirma serem falsas as acusações do mesmo de agressões. Disse que ele não aceita a separação e faz ameaças.Não deseja atendimento social. Agitação psicomotora, uso indevido do UPA e ESF comparece as unidades várias vezes ao dia.', 'Agendado ASM Dra. Rejane 03/02/22', 2, 'FINALIZADO'),
