	(355, '2022-03-08', 'CAPS Adulto', 0, '1960-04-16', 'Bom Pastor', 171, 'Marilza Custódio de Azevedo', 'Paciente com sintomas de ansiedade. Em uso de Quetiapina 25 mg, Alprazolam 0,5 mg, Venlafaxina e mais uma medicação que não soube informar, prescritos pela Dra. Vivian (rede particular) e mantidos pela Dra. Natália (UBS Bom Pastor). A paciente relata que a medicação não fez o efeito desejado.  Encaminhada para psicoterapia. Solicito avaliação Dra. Rejane. ', 'Manutenção do acolhimento estendido no CAPS Adulto.', 2, 'FINALIZADO'),
	(356, '2022-03-08', 'CAPSi', 249, '2011-02-02', 'Bom Pastor/ASM', 5853, 'Miguel Penha Custódio', 'Paciente estável, em alta do CAPSi. Necessita consulta com Dra. Rejane para posteriormente seguir em tratamento na própria UBS - contratualidade no território. CAPS i 22/08/20. Em uso de Oxcarbazepina e Respiridon. Mãe solicitou atestado de afastamento de 1 ano da escola regular.', 'Atendimento psicológico da mãe ( Claúdia)', 2, 'FINALIZADO'),
