	(648, '2021-07-27', 'CAPS Adulto', 11040, '1996-08-05', 'Bom Pastor', 2554, 'Gustavo Nogueira Flauzino', 'Ansiedade, tricotilomania, onicofagia. Conflitos em relacionamentos, rompimentos, mudanças, atualmente residindo na casa da mãe, sem renda fixa, faz alguns bicos.Psicoterapia online em São Paulo, passou na clinica geral Liliane mas não está tomando a medicação Clomipramina 25 mg. Passou no ESF em 2016 e retornou em Março/Abril de 2021 queixas só clinícas solicitou encaminhamento (dermatologista, psiquiatra e Nutricionista). Uso de maconha, interrompeu a medicação, porque não sentiu melhoras e não compareceu ao retorno marcado com Dra Liliane. Caso ja foi discutido entre Dra Liliane e Dra Rejane.', 'Agendar com Clinico ESF ', 2, 'FINALIZADO'),
	(649, '2021-08-24', ' Bom Pastor', 662, '1983-11-03', 'CAPS Adulto', 11034, 'Wanderson Ribeiro de Paulo', 'F06.2 + F70.1 Porteiro trabalhando. F20.0 ? Relato de alucimações e delirios em 2015/2016. Uso irregular de Haldol 20 gotas 2 a 3 vezes por semana para dormir, sem queixas psiquiátricas atualmente. Insonia , Dra Liliane prescreveu Zolpidem 10 mg 0-0-1. Questionando  medicação no ESF', 'Manutenção ESF ', 2, 'FINALIZADO'),
	(650, '2021-08-24', 'CAPS Ad', 2828, '1977-10-20', ' Bom Pastor', 7068, ' Adriana Margarida Vicente ', 'Compareceu no serviço no dia 17/08/2021 solicitando laudo psiquiátrico para apresentar no seu trabalho HBP. Relatou também alteração em sua medicação e que essa alteração causou "crise". Porém no momento de seu acolhimento a mesma não apresentava sinais e sintomas de crise e/ou abstinência ou uso abusivo de substâncias psicoativas, feito contato com a psicóloga Luciene e combinado a discussão do caso em equipe no matriciamento. Em uso de Topiramato 100 mg prescrito pelo endocrinologista, dra abaixou para 50 mg. Automutilações , trocou Bromazepam pelo Clonazepam. Mãe encontra-se no CTI ', 'Agendado ASM 26/08/2021', 2, 'FINALIZADO'),
	(651, '2021-08-24', ' Bom Pastor', 1544, '1978-04-24', 'CAPS Ad ', 1911, 'Mateus Martins Arruda', 'Voltou de CT  machucado,usando drogas. Mãe solicitando internação.', 'Acolhimento CAPS ad', 2, 'FINALIZADO'),
	(652, '2021-08-24', 'CAPS adulto', 11654, '1962-11-01', 'Bom Pastor', 3223, 'Vilma Eleutério', 'Queixa efeitos colaterais do Depakene, afirmou que Dra. Liliane não fez alteração / ajuste da medicação. ', 'Manutenção ESF, agendar consulta com clínico.', 2, 'FINALIZADO'),
	(653, '2021-08-24', 'CAPS i', 0, '2006-11-07', 'Bom Pastor / ASM', 3104, 'Maria Eduarda de Paula', 'Conversar sobre o caso e condutas terapêuticas (manter atendimento médico na UBS?, atendimento psiquiátrico?, atendimento psicológico).', 'Avaliação Psicoterapia ASM', 2, 'FINALIZADO'),
	(654, '2021-09-28', 'CAPS i', 0, '1990-11-08', 'Bom Pastor/ASM', 0, 'Caroline Rezende Junqueira', 'Mãe da paciente Marina, acolhida recentemente no CAPS i. Encaminhada para cadastro e atendimento psicológico, a princípio.', 'Psicoterapia ASM', 2, 'FINALIZADO'),
