	(656, '2021-09-28', 'CAPS Adulto', 2806, '1978-04-04', 'Bom Pastor/ASM', 6902, 'Leilane Ferreira da Silva', 'Ver possibilidade da Dra. Rejane atende-la no ambulatório, tentar vínculo para tomar remédio.', '-', 2, 'FINALIZADO'),
	(657, '2021-11-09', 'Bom Pastor', 2554, '1996-08-05', 'CAPS Adullto / ASM', 11040, 'Gustavo Nogueira Flauzino', 'Pensamento  e ideação suicída. Em uso de Fluoxetina 20 mg 2-0-2, haloperidol 1 mg 1-0-1, Carb. Litio 300 mg 1-0-1. F33.2+F48.9+F12.24', 'Manutenção CAPS Adulto com reavaliação 15 dias', 2, 'FINALIZADO'),
	(658, '2021-11-09', 'Bom Pastor', 825, '1964-05-15', 'CAPS Adullto / ASM', 0, 'Beatriz Aparecida Bertoldo', 'Não adaptação ao medicamento.Em uso de Fluoxetina 20 mg e Mirtazapina 30 mg', 'Manutenção ESF', 2, 'FINALIZADO'),
	(659, '2021-11-09', ' Bom Pastor', 624, '1966-11-11', 'CAPS Adullto / ASM', 0, 'Rosalva da Silva Marques', 'CA mama 1 ano. Após tratamento evolui com crises de pânico frequentes e diversas fobias. Em uso de: Escitalopram 10 mg e Clonazepam sem melhora.', 'Reajuste da medicação / Manutenção ESF', 2, 'FINALIZADO'),
