	(663, '2021-12-07', 'Bom Pastor', 6902, '1978-04-07', 'CAPS Adulto', 2806, 'Leilane Ferreira da Silva', 'Mãe compareceu pois mês passado não foi avisada sobre a consulta dia 11/11. Queixou da medicação, possível alergia. Solicito que seja analisada a possibilidade de remarcar a consultar e avisar a mãe. Tel. 98721-9995', 'Agendamento CAPS Adulto em janeiro 2022', 2, 'FINALIZADO'),
