	(665, '2022-02-01', 'Bom Pastor', 5932, '1982-01-18', 'CAPS Adulto', 0, 'Karen Olívia Monteiro', 'Com mudança da medicação, não teve melhora. TAE, automutilação. Feita busca ativa pelo CAPS em 22/12/21, Karen não estava em casa. DQ.', 'Agendado ASM Dra. Rejane 02/02/22', 2, 'FINALIZADO'),
	(666, '2022-02-01', 'Bom Pastor', 5882, '1975-02-18', 'CAPS Adulto', 0, 'Cristiane Pereira da Silva', 'Paciente necessita de acompanhamento psiquiatrico. Em uso de: Sertralina 50mg + Sulpirida 200mg (1-0-0), Carbonato de litio 300mg (2-0-0), Rivotril 0,25mg (0-0-1). Fazia tratamento em Paraguaçu.', 'Agendado ASM Dra. Rejane 02/02/22', 2, 'FINALIZADO'),
	(667, '2022-02-01', 'Bom Pastor', 2438, '1956-02-18', 'CAPS Adulto', 267, 'Rosenira Onofre V. Bernardes', 'Paciente em convivência conflituosa na familia, necessita de avaliação. Em uso de Diazepam 10 mg. Ja usou Topiramato e Sertralina. Neurose de longa data sem resposta a psicoterapia, resistente a mudança de medicação.', 'Manutenção ESF', 2, 'FINALIZADO'),
	(668, '2022-02-01', 'CAPS Adulto', 0, '1997-08-24', 'Bom Pastor', 6844, 'Matheus Pontes Pinto Bottrel', 'Confirmar se o paciente compareceu à consulta, agendada para 16/12/2021, e se encontra-se estável. Em uso de fluoxetina  20 mg e Clonazepam 1/2 mg.', 'Manutenção ESF', 2, 'FINALIZADO'),
	(669, '2022-02-01', 'CAPS Adulto', 0, '1956-11-27', 'Bom Pastor', 4797, 'Glaucia Maria da Silva', 'Deixar o clíinico ciente que a paciente parou com a Mirtazapina por medo de remédios, mantendo-se com crises de pânico e ficando muito deitada. Dra. rejane orienta retornar o uso de Mirtazapina começando com meio comprimido ou substituir por Sertralina 50 mg.', 'Agendado ASM Dra. Rejane 03/02/22', 2, 'FINALIZADO'),
	(670, '2022-03-08', 'Bom Pastor', 4560, '1955-03-11', 'CAPS Adulto', 5096, 'Geny Mendes Camargo', 'Médica neurologista encaminha para orientação de medicação. Em uso de Zolpiden 0-0-1, Flouxetina 2-0-0, Nortripitilina 25 mg 0-0-2, Clorpromazina 25 mg 0-0-2.', 'Agendado ASM Dra. Rejane 09/02/2022.', 2, 'FINALIZADO'),
	(671, '2022-03-08', 'Bom Pastor', 542, '2002-01-22', 'Q1/ ASM', 542, 'Rian Miranda da Silva', 'Alta da FUVAE,em uso de Haldol depo 1 ampola mensal e Ritalina. Precisa trabalhar. Encaminhada para acompanhamento ASM.', 'Agendado ASM Dra. Rejane 09/02/2022. Encaminhamento assistente social ASM se necessário.', 2, 'FINALIZADO'),
	(672, '2022-03-08', 'CAPS Adulto', 2363, '1984-09-24', 'Bom Pastor', 0, 'André Luiz Gomes Marinho', 'Usuário sem acompanhamento na rede, perdeu consulta agendada dia 24/01. Manifesta desejo de ser acompanhado por psicóloga. F25.1 telefone: 99262-6343', 'Aguardar comparecimento do paciente.', 2, 'FINALIZADO'),
	(673, '2022-03-08', 'Bom Pastor', 3053, '1973-08-03', 'CAPS Adulto', 11108, 'Silvio de Almeida Cazelato', 'F31.8 + F48.9 + F61.0 + F68.0 + Z02.7  não adere a tratamento, desorientado, alucinações, delírios, mania, atos agressivos, pede atestado para INSS. Foi atendido pelo Dr Anderson no dia 04/03/2022 no CAPS Adulto.', 'Agendado ASM Dra. Rejane 07/04/22', 2, 'FINALIZADO'),
	(674, '2022-04-05', 'CAPS Adulto', 0, '1993-04-17', 'Bom Pastor', 5852, 'Karen Sabino Pereira', 'Paciente com sintomas de pânico que iniciaram-se após separação conjugal. Em uso de nortriptilina há um ano, sem efeito para os sintomas. Agendada consulta com Dra. Raquel, dia 14/03/22. O objetivo do matriciamento é saber se a paciente compareceu à consulta e manter o acompanhamento do caso.', 'Transferido para o próximo matriciamento', 2, 'FINALIZADO'),
	(675, '2022-04-05', 'Bom Pastor', 0, '1948-03-06', 'CAPS Adulto/ASM', 0, 'Rubens Campos dos Santos', 'Paciente em uso de Haldol 1mg e fluoxetina 20mg, relata mal-estar, epigastralgia, deseja cessar uso das medicações. Paciente mantém sintomas de perseguição.', 'Transferido para o próximo matriciamento', 2, 'FINALIZADO'),
