	(678, '2022-05-03', 'CAPS Ad', 2379, '1972-05-20', 'Bom Pastor', 5501, 'Jeferson Mendes Cazelato', 'Paciente  abstinente de BA há um ano e 4 meses. Queixa ansiedade, cefaleia, e  dor no peito há meses. Encaminhado para avaliação clinica inicialmente e psicologica. Em uso de: Sertralina e Clonazepam. Feito pedido de eletrocardio, resultado normal.', 'Manutenção ESF e avaliação psicológica ASM', 2, 'FINALIZADO'),
	(679, '2022-05-03', 'Bom Pastor', 60, '2005-05-04', 'CAPS Adulto', 0, 'Rafael Christian de Paula Pinto ', 'TOC. Em uso de: Paroxetina 20 mg 1-1-1. Reavaliar medicação.', 'Agendado ASM Dra. Rejane 04/05/2022', 2, 'FINALIZADO'),
	(680, '0000-00-00', 'CAPS Adulto', 0, '1994-03-23', 'Bom Pastor', 4202, 'Daniel Barros Fonseca', 'Mãe do paciente comparece ao CAPS Adulto solicitando avaliação psiquiátrica para o filho que tem diagnóstico de esquizofrenia, está em uso de: Risperidona 2mg e Bupropiona 150mg, porém, segundo relata a mãe, ainda apresenta alguns sintomas positivos da doença. Paciente, atualmente, trata na rede privada, mas a mãe deseja iniciar tratamento na rede pública. Como o paciente não está em crise, solicito a avaliação da Dra. Rejane.', 'Agendado ASM Dra. Rejane 04/05/2022', 2, 'FINALIZADO'),
	(681, '0000-00-00', 'CAPS Adulto', 0, '1990-07-05', ' Bom Pastor', 1480, 'Orlando Casimiro Pires', 'Matricio para discutir caso do usuário, se o mesmo necessitaria de uma avaliação de neuro e/ou psiquiatria. TAE com veneno de rato. Uso de alcool, cocaína e maconha há alguns meses. Crise convulsiva ou conversiva?', 'Solicitada avaliação neurológica e encaminhado para CAPS ad', 2, 'FINALIZADO'),
