	(688, '0000-00-00', 'CAPS Ad', 2883, '1995-03-31', 'Bom Pastor', 0, 'Matheus Fernandes da Silva', 'Ao ser acolhido no CAPS Ad em 01/07, relatou estar sem uso de cocaína há mais de um ano e uso esporádico de maconha; relatou acidente de moto e dificuldade de deambular, devido à fratura na perna. Após o acidente, passou a apresentar sintomas depressivos, insônia e ansiedade. Após avaliação psiquiátrica em 01/07/2022, foi encaminhado ao ESF para manutenção medicamentosa ( diazepam 10mg, fluoxetina 20mg ou paroxetina 25mg)', 'Manutencão ESF. Orientá-lo para fazer o cadrastro e  abrir o prontuário. ', 2, 'FINALIZADO'),
