	(791, '2020-08-04', 'Pinheiros', 10044, '1995-07-13', 'CAPS Adulto', 0, 'Ester Silva', 'Insônia, cefaléia, preocupação exagerada ,chorosa, depressiva, pensou em A/E após situacão com filha que remeteu a trauma pessoal na infância. Em uso de: Escitalopram 10mg 1-0-0 e Diazepam 10mg 0-0-1 apresentou melhora.', 'Agendado ASM 06/08/2020.', 6, 'FINALIZADO'),
	(792, '0000-00-00', 'CAPS Adulto', 4412, '1974-01-30', 'Pinheiros', 1411, 'Mayra Soares Colares Pereira Teixeira', 'Encaminhada em 05/08/2020, disse que seu prontuario pertence ao Pinheiros, mas mora no Boungavile mas vai  a morar no Pinheiros , orientei ela resolver porque quando precisar de receita tem que ser no seu ESF/UBS. CID 10 F 33.1 + F 41.1 + F 48.9 +F 13.24 Em uso de: Clomipramina 25 mg 4 0 4 -  Haloperidol 1 mg 1 0 1 - Pregabalina 75 mg 1 0 1, Clonazepam 2 mg - 1 0 2 - Mirtazapina 15 mg 0 0 1. Faz tto infectologia', 'Manutenção medicação ESF/ASM', 6, 'FINALIZADO'),
	(793, '2020-09-01', 'Pinheiros', 0, '2004-12-25', 'CAPS i / Damasco', 0, 'Lara Ribeiro Caselato Nascimento', 'Paciente do Anderson. Precisa retormar tratamento psicológico, o qual foi interrompido devido pandemia / eleicões.Encaminhada para a psicóloga do quadrante I Denilza 3223 6248.Automutilacào.Discussão do caso. Avaliada Caps i 17/08', 'Acompanhamento psicológico Denilza', 6, 'FINALIZADO'),
