	(806, '2021-09-28', 'CAPS Adulto', 253, '1963-10-11', 'Pinheiros', 694, 'Lúcia de Oliveira', 'Avisar a equipe do ESF que a paciente encontra-se estável e será encaminhada no próximo mês. Tem retorno agendado, no CAPS, dia 29/10. Em uso de: Carbolitium 300 mg 0-0-2, Clonazepam 2 mg 0-0-2 Quetiapina100mg 0-0-1 F31+ F25?', 'Manutenção CAPS Adulto após 29/10 será encaminhada para ESF', 6, 'FINALIZADO'),
	(807, '2021-11-09', 'Pinheiros', 1325, '1945-12-25', 'CAPS Adulto', 9405, 'Terezinha de Jesus Lucinda', 'Passou em atendimento no CAPS 2 teve as medicações alteradas,necessário confirmaras medicações prescristas para orientação da família.', 'Manutenção ESF', 6, 'FINALIZADO'),
	(808, '2021-11-09', 'Pinheiros', 792, '1951-04-12', 'CAPS Adulto', 3232, 'Elza Beltrão', 'Passou em atendimento no CAPS ad recentemente, quais as medicações prescritas?Houve seguimento no tratamento?', 'Avaliação CAPS AD 26/11/21', 6, 'FINALIZADO'),
	(809, '2021-12-07', 'Pinheiros', 1755, '1962-04-26', 'CAPS Adulto', 0, 'Rosane Pinto da Silva', 'Dificuldade para dormir, angústia, problemas familiares, histórico de transtorno depressivo recorrente. Faz tratamento com reumato.', 'Agendado ASM Dra. Rejane 09/12/21', 6, 'FINALIZADO'),
	(810, '2021-12-07', 'Pinheiros', 8, '1967-04-29', 'CAPS Adulto', 11435, 'Yone de Jesus Firmino', 'Chorosa, piora quadro depressivo, hipertensa,conflitos familiares. Artrite? F41.2+F48.9', 'Avaliação CAPS Adulto Dr. Anderson', 6, 'FINALIZADO'),
	(811, '2022-02-01', 'CAPS Adulto', 0, '1971-02-19', 'Pinheiros', 0, 'Douglas Ricardo dos Santos Pereira', 'Ver a possibilidade de atendimento psicológico para o usuário. Relata relacionamento abusivo com a esposa. Agitado. Uso de maconha e alcool. F31.2 foi prescrito Arpejo mas paciente recusou o uso dessa medicação. ', 'Atendimento psicológico Luciene.', 6, 'FINALIZADO'),
	(812, '2022-02-01', 'Pinheiros', 2450, '1959-01-04', 'CAPS Adulto', 4955, 'Vanilda de Castro Nogueira', 'Agendei atendimento no Caps 2 para o dia 02/02/22. Viúva, mora na casa da mãe porque entra em pânico quando fica sozinha no seu apartamento. faz uso de medicamento controlado; vários psiquiatras ; tem adastro Caps SM e AD; fazia uso de álcool; relata ter parado, mas familiares afirmam uso. Relata insônia. Crise de ansiedade e nervosismo. Fazia tratamento com Dra. Vivian.', 'Avaliação psiquiátrica CAPS Adulto Dr. Anderson 02/02/22.', 6, 'FINALIZADO'),
	(813, '2022-02-01', 'Pinheiros', 12, '1946-01-27', 'CAPS Adulto', 0, 'Maria Aparecida Helena Amorin', 'Desorientada no tempo. idosa, solteira, resistente à medicação; bom vínculo com a cunhada; psicótica? Alimentação ruim. Dra. Rafaela prescreveu medicação.... conversei com a cunhada que informou uma melhora significativa no comportamento de Maria: está dormindo à noite, se alimenta adequadamente; calma; segue as regras da casa. Em uso de Risperidona 1 mg com melhora.', 'Manutenção ESF', 6, 'FINALIZADO'),
	(814, '2022-03-08', 'Pinheiros', 118, '2010-08-13', 'CAPS i', 0, 'Luiz Felipe Honorato de Lima', 'Em uso de Depakote e Risperidona. Déficit intelectual, comportamento agressivo, baixa aderência ao tratamento. Mãe faz psicoterapia com Denilza.', 'Agendado ASM Dra. Rejane 10/03/2022', 6, 'FINALIZADO'),
	(815, '2022-03-08', 'CAPS Adulto', 11967, '1950-08-18', 'Pinheiros', 3672, 'Francineide Ferreira Pinto Perigato', 'Encaminhada para avaliação no CAPS. Queixa hoje de distúrbio visual c/ presença de escotomas e cefaléia occipital. Relata encaminhamento para o neuro. F29. Em uso de: Clonazepam 2 mg, Prometazina 25 mg e Olanzapina 5 mg.', 'Manutenção ESF', 6, 'FINALIZADO'),
	(816, '2022-03-08', 'CAPS Ad', 3232, '1951-04-12', 'Pinheiros', 792, 'Elza Maria Araujo Beltrão', 'Encaminhada para ESF para dar continuidade ao tratamento. Apresenta quadro de epilepsia. Abstinente de bebida alcoolica há 4 meses. Em uso de: Depakene 500 mg , Lamotrijina 200 mg.', 'Manutenção ESF', 6, 'FINALIZADO'),
	(817, '2022-03-08', 'Pinheiros', 1645, '2007-08-17', 'CAPS i', 1493, 'Ana Clara Schrade Reis Melo', 'Depressiva, TAE (há 4 meses). Em uso de Fluxetina 10 mg.', 'Manutenção CAPS i', 6, 'FINALIZADO'),
	(818, '2022-03-08', 'Pinheiros', 12, '1945-01-27', 'CAPS Adulto', 0, 'Maria Aparecida Helena Amorim', 'Sindrome demencial.', 'Agendada no Envelhecer.', 6, 'FINALIZADO'),
	(819, '2022-03-08', 'Pinheiros', 4406, '1978-06-26', 'CAPS Adulto', 7704, ' Claudio Roberto de Souza', 'Denúncia MP de agressão aos pais, perfil paranóide, agitado, agressivo. F41.2 (2003). Já usou Sulpirida e Haldol 5 mg (impregnou).', 'Agendado ASM Dra. Rejane 10/03/2022.', 6, 'FINALIZADO'),
	(820, '2022-04-05', 'Pinheiros', 4406, '1978-06-26', 'CAPS Adulto', 7704, 'Claudio Roberto de Souza', '23/03/22 Falei com Maria que informou que deu o risperidona por dois dias escondido na comida. Ele teria ficado agressivo, fazendo ameaças e gritando muito. Vizinhos acionaram a polícia militar. Ele teria ficado sem dormir também. Maria então parou com a medicação. (assistente social)', 'Psicoeducação familiar. AS Islene', 6, 'FINALIZADO'),
	(821, '2022-05-03', 'CAPS Adulto', 0, '2001-05-22', 'Pinheiros', 153, 'Júlio César da Luz', 'Paciente com queixas depressivas e ansiosas. Em uso de pondera 25mg (1xdia), prescrito por psiquiatra da rede particular. Atualmente, renova receita do referido medicamento no PSF. Medicação não tem feito o efeito desejado. Solicito avaliação psiquiátrica Dra. Rejane e atendimento psicológico com a psicóloga Denilza.', 'Manutenção e reajuste medicação ESF. Acompanhamento psicológico ASM', 6, 'FINALIZADO'),
	(822, '2022-05-03', 'CAPS Adulto', 0, '1989-10-27', 'Pinheiros', 221, 'Bruno César Rosa Diniz', 'Paciente tem polineuropatia rara, sem diagnóstico definido. Última indicação medicamentosa foi o cannabidiol, paciente sem condições financeiras para comprar a medicação, pergunta sobre como conseguir pela rede pública. Demanda laudo INSS. Transtorno de personalidade?', 'Acompanhamento e investigação neurologia. Psicologia ASM.', 6, 'FINALIZADO'),
	(823, '2022-05-31', 'CAPS Adulto', 11439, '1989-08-23', 'Pinheiros', 894, 'Damaris Oliveira Bichara', 'Paciente com queixas depressivas e ansiosas. Fez uso de fluoxetina de 20mg 1x ao dia, porem faz dois meses que não toma medicação, pois esta sem condições financeiras para as consultas particulares. Demanda atendimento com psiquiatra. Em uso de: Venlafaxina 75 mg e Ácido valpróico 250 mg 2 por dia. F31?', 'Matriciar novamente no próximo mês.', 6, 'FINALIZADO'),
	(824, '2022-05-31', 'CAPS Adulto', 512, '1978-02-23', 'Pinheiros', 4831, 'Juliano Augusto Santana', 'Em uso de: Olanzapina 1 1/2, Luvox 100mg 1 1/2, Clonazepam 2 mg 0-0-1, Enalapril. Fraqueza, indisposição.', 'Agendado ASM Dra. Rejane 01/06/2022', 6, 'FINALIZADO'),
	(825, '2022-06-28', 'CAPS Adulto', 11439, '1989-08-23', 'Pinheiros', 894, 'Damaris Oliveira Bichara', 'Paciente com queixas depressivas e ansiosas. Fez uso de fluoxetina de 20mg 1x ao dia, porem faz dois meses que não toma medicação, pois esta sem condições financeiras para as consultas particulares. Demanda atendimento com psiquiatra. Em uso de: Venlafaxina 75 mg e Ácido valpróico 250 mg 2 por dia. F31?', 'Agendado ASM 30/06.', 6, 'FINALIZADO'),
	(826, '2022-06-28', 'Pinheiros', 5910, '1996-04-10', 'CAPS Adulto ', 0, 'Alisson Vitor Rodrigues Messias', 'Dificuldade de concentracào,ansiedade. Se denomina como hiperativo.TDAH (?). Em uso de escitalopram 15 mg.', 'Agendado ASM 29/06. ', 6, 'FINALIZADO'),
	(827, '2022-07-26', 'CAPS Adulto ', 0, '1980-12-05', 'Pinheiros', 3724, 'Ezequiel Lucas da Silva', 'Paciente tem fibromialgia, espondilite anquilosante, artrite reumatóide, psoriática, artrose e reumatismo. Fortes e constantes dores comprometendo seu quadro psíquico. Solicito acompanhamento psicológico ', 'Encaminhado para acompanhamento psicológico. Solicita-se enfermagem colocá-lo na planilha.', 6, 'FINALIZADO'),
	(828, '2022-08-23', 'CAPS Adulto', 7826, '1977-05-14', 'Pinheiros', 694, 'Juliano Ferreira Borges', 'Em uso de : Equilid 50 mg 1-0-0 e Rivotril 2 mg 0-0-1. Apresentando queixas de irrritabilidade, pensamento obsessivos e acelerados. TOC. Reavaliar medicação.', 'Agendado ASM Dra. Rejane 25/08/2022', 6, 'FINALIZADO'),
	(829, '2022-08-23', 'CAPS Adulto', 512, '1978-02-23', 'Pinheiros', 4831, 'Juliano Augusto Santana', 'Passou em consulta com Rejane dia 01/06/22, prescrito: Olanzapina 10mg (1) + Clonazepam 2mg (1) + Luvox 100mg (1-0-1/2) + Aripiprazol 10mg (1) + Biperideno 2mg (1). Não se adaptou com o Biperideno e há tempos não usa o Aripiprazol. Mantém sintomas. Reavaliar medicação. Está estável.', 'Manutenção ESF', 6, 'FINALIZADO'),
	(830, '2022-09-20', 'CAPS Adulto', 512, '1978-02-23', 'Pinheiros', 4831, 'Juliano Augusto Santana', 'Paciente em uso de: Olanzapina 20 mg (0.0.1+1/2); Clonazepam 2 mg (0.0.1); Aripiprazol (não sabe informar as mg) (0.0.1) e Fluvoxamina 200 mg (0.0.1). Queixa-se que não vê melhora nos sintomas (dores e formigamento no corpo, cabeça pesada, mal-estar generalizado, sensação de ressaca, boca seca, enjoos, etc). Solicita reavalição psiquiátrica e acolhimento psicológico. ', 'Manutenção ESF', 6, 'FINALIZADO'),
	(831, '2022-09-20', 'CAPS Adulto', 0, '1992-11-10', 'Pinheiros', 367, 'Marina Siqueira da Silva', 'Paciente em uso de: Sertralina 50 mg 1-0-0; Mirtazapina 30 mg 0-0-1/2; Zolpidem 10 mg 0-0-1/2. Queixa-se dos seguintes sintomas: nervosismo, vontade de quebrar as coisas, cansaço excessivo, perda da fala e movimentos temporariamente. Já faz acompanhamento psicológico no ESF. Possível manutenção da medicação.', 'Agendado ASM Dra. Rejane 22/09/2022', 6, 'FINALIZADO'),
	(832, '2022-09-20', 'Pinheiros', 26, '1985-11-13', 'CAPS Adulto', 12245, 'Caroline Lima Martins', 'TAB? Início de olanzapina de 2,5mg na ESF, necessita de acompanhamento psiquiátrico para estabilização do quadro. Irmã gemêa já acompanha no CAPS - Paola Lima Martins', 'Agendado ASM Dra. Rejane 21/09/2022', 6, 'FINALIZADO'),
	(833, '2022-10-18', 'Pinheiros', 2450, '1959-01-04', 'CAPS Adulto/ CAPS AD', 4955, 'Vanilda de Castro Nogueira', 'A Viúva, mora na casa da mãe porque entra em pânico quando fica sozinha no seu apartamento (Portinari). faz uso de medicamentos controlados; vários psiquiatras ; tem cadastro CAPS e AD; fazia uso de álcool; relata ter parado, mas familiares afirmam uso. Relata insônia. Crise de ansiedade e nervosismo. Fazia tratamento com Dra. Vivian.Dr Italo, abuso de Alprazolam.Dra Janaina prescreveu lhe olanzapina ,anteriormente foi prescrito risperidona.', 'Visita Domiciliar AS                ( Islene e Flávia.) ', 6, 'FINALIZADO'),
