	(1024, '2021-06-01', 'CAPS Adulto', 8479, '1980-06-11', 'Mont Serrat', 573, 'Michele de Jesus Henrique', 'Compareceu ao CAPS para acolhimento, já possui prontuário no serviço, mas nunca deu continuidade ao tratamento proposto. Está passando por situações pontuais, encaminhada para acompanhamento psicológico no ASM. Passará por avaliação psiquiátrica. Relacionamento abusivo com ex companheiro, histórico familiar de tragédias  mãe assasinada. Paciente com sintomas de pânico, chorosa, medo de ser assasinada, reação de aniversario, já tem medida protetiva. Em uso de Fluoxetina 20 mg 2.0.2, Haloperidol 1 mg 1.0.0 ,Clonazepam 2 mg 1.0.2  F43.22 F48.9', 'Manutenção CAPS Adulto', 3, 'FINALIZADO'),
