	(1198, '2021-06-01', 'CAPS Adulto', 2974, '1990-07-12', 'Girassol ', 2130, 'Elton do Sacramento Luiz', 'Compareceu ao CAPS 11/05 com encaminhamento para substituição de medicação. Estável, o caso deverá ser discutido em reunião de matriciamento . Mãe faleceu há um ano. F06.8 +F71.1+ G40.3 Queixas de dor no estomago com Clorpromazina 100 mg 0-0-1 substituido por Amitriptilina 25 mg , episodios convulsivos, uso inrregular da medicação? Em uso de: Clonazepam 2 mg  1-0-1, Oxcarbazepina 300 mg 1-0-1 ,Amitriptilina 25 mg 0-0-2, Anemia crônica , já faz uso de omeprazol. Avaliação neurologia e encaminhado para endoscopia.', 'Manutenção ESF', 7, 'FINALIZADO'),
	(1199, '2021-07-27', 'Girassol', 54, '1989-06-23', 'CAPS Adulto', 11411, 'Reginaldo Souza Fernandes Vieira', 'Discussão do caso para agendamento de retorno no ASM com Dra. Rejane, fez exame de litemia. ', 'Agendado 09/08 8:30 ', 7, 'FINALIZADO'),
	(1200, '2021-07-27', 'CAPS Adulto', 9809, '1964-05-25', ' Girassol', 2583, 'Rosangela Silva de Oliveira', 'Encaminhada pelo ESF solicitando reavaliação da medicação atual: Alprazolam 2,5mg (1-0-1) e Escitalopram 10mg (1-1-0) desde 2012 CID 10: F41.2 F48.8 CAPS Adulto, ajustado em 2018 pelo Dr Italo. CID10: F32.3 Passou em acolhimento dia 15/07 com Ana Paula, Recusou atendimento psicologico, passou na clinica de todos com a Dra Simone, sem melhora Verificar possibilidade de avaliação pela Dra. Rejane e psicologia ASM', 'Agendado dia 09/08 7:30', 7, 'FINALIZADO'),
	(1201, '2021-08-24', 'CAPS Adulto', 4330, '1961-07-11', 'Girassol ', 1415, 'Maria Inês Baldim', 'Compareceu ao acolhimento, com encaminhamento do ESF. Paciente estava fazendo uso dos medicamentos prescritos no CAPS e no ESF. Irá continuar a fazer o tratamento proposto pelo CAPS, portanto solicito que não seja fornecida as receitas que  estava pegando anteriormente. Foi enviada, pela paciente, contra referência para o ESF; que não tem cópia em anexo pois não possuimos impressora para cópia. Em uso de Fluoxetina 20 mg, Nortripitilina 25 mg, Levomepromazina 25 mg, Clonazepam 2 mg, Clopixol 1 ampola de 28/28 dias. F33.2+ F48.4+ F61.0+ F70.1', 'Manutenção CAPS Adulto', 7, 'FINALIZADO'),
	(1202, '2021-08-24', 'Girassol', 54, '1993-09-30', 'CAPS Adulto', 11111, 'Maria Débora Tomaz Novato', 'Discussão do caso para agendamento de retorno no ASM com Dra. Rejane . Em uso de: Fluoxetina 20 mg, Anitripitina 25mg, Alprozolam 2mg. Aumento de peso, TOC, fazendo Psicoterapia online.', 'Agendado ASM 25/08/2021 ', 7, 'FINALIZADO'),
	(1203, '2021-08-24', 'Girassol', 2037, '1978-12-22', 'CAPS Adulto / CAPS Ad', 10225, 'Edimeire da Silveira', 'Uso de álcool, queixas depressivas e ansiedade. Em uso de: Fluoxetina 20 mg e Diazepam 10 mg. F41.2 + F10.2 + F78 + F48.9', 'Manutenção ESF', 7, 'FINALIZADO'),
	(1204, '2021-08-24', 'Girassol', 682, '1959-12-11', 'CAPS Adulto ', 0, 'Maria Aparecida Vicente Simeão', 'Pais idosos, domiciliados, doentes, sem apoio dos irmãos... Histórico de depressão, desânimo, nervosismo, polimialgia. Em uso de: Alprozolam 2 mg, Escitalopram 20 mg.', 'Visita domiciliar Assistente Social ASM na residência dos pais com a presença da paciente e agendado ASM 25/08/21 Dra Rejane.', 7, 'FINALIZADO'),
	(1205, '2021-09-28', 'Girassol', 682, '1959-12-11', 'CAPS Adulto ', 0, 'Maria Aparecida Vicente Simeão', 'Revisão da medicação prescrita pela Dra. Rejane, refere mal estar com o uso da Duloxetina (suspenso). Retorno A.S: VD realizada aos pais idosos. Necessidade de melhoria nos cuidados. Atendimentos individualizados com todos os filhos. Não chegaram a um acordo. Reunião com todos os filhos agendada para quarta-feira dia 29/09. Não havendo acordo encaminharei para CREAS e MP', 'Manutenção e reajuste medicação ESF. Psicoterapia e atendimento Assistente Social ASM', 7, 'FINALIZADO'),
	(1206, '2021-11-09', 'Girassol', 682, '1959-12-11', 'Caps Adulo', 0, 'Maria Aparecida Vicente Simeão', 'Retorno A.S: Não houve acordo entre os irmãos na realização dos combinados que fizeram na reunião familiar. Observo que principalmente por parte da filha Maria que coloca dificuldade em tudo e parece ter vínculo fragilizado com a mãe. Ficou claro que ela desestabeliza os irmãos. Caso encaminhado ao Creas visando garantia de direitos dos idosos.', 'Encaminhada para o CREAS', 7, 'FINALIZADO'),
	(1207, '2021-11-09', 'Girassol', 4061, '1981-11-30', 'CAPS Adulto', 11047, 'Cíntia de Souza Ribeiro', 'Ansiosa, depressiva, com ideações suicidas, atendida no psf, medicada e encaminhada ao CAPS. Muito chorosa, cefaléia, pressão no trabalhos. Sem meios econômicos para comprar medicamentos. Ideação suicida. Em uso de Nortripitilina 30 comprimidos.', 'Agendado ASM 10/11/21 Dra. Rejane', 7, 'FINALIZADO'),
	(1208, '2021-12-07', 'CAPS AD', 0, '1962-10-31', 'Girassol/ CAPS Adulto', 0, 'Nilza Elizabeth de Souza Coelho', 'Deprimida, etilista, TAE, vários membros da família etilistas. Dr. Anderson prescreveu Fluoxetina e Diazepam e encaminhou paciente ao CAPS AD.', ' Visita domiciliar Assistente Social ASM e rediscutir caso no próximo matriciamento.', 7, 'FINALIZADO'),
	(1209, '2021-12-14', 'Girassol', 5820, '1966-11-15', 'CAPS AD', 0, 'Sandra Silva Santos', 'Paciente oriunda do PSF Girassol, verificado no prontuário que foi matriciada em 10/03/2020 não deu continuidade ao tratamento. Encaminhada novamente ao Caps Ad.', '', 7, 'FINALIZADO'),
	(1210, '2022-02-01', 'CAPS Adulto ', 9469, '1993-06-04', 'Girassol', 2376, 'Cristopher Mesquita', 'Compareceu ao CAPS com relatório Neuropsicológico e encaminhamento do neurologista solicitando acompanhamento com psiquiatra pois está em uso de Ritalina. Por não apresentar perfil para atencimento no CAPS, neste momento, solicito suporte do ESF e do ASM. Paciente relata que psicóloga Denilza entrou em contato com ele, mas estava passando pela avaliação (cópia desta avaliação está em anexo ao prontuário), solicitou que a mesma o atenda já que finalizou a avaliação. Retorno A.S: Realizada vd; mãe resistente ao atendimento. Agendado atendimento para Cristopher que demonstrou grande expectativa por um diagnóstico. Estudante, afirma não ser compreendido pelos pais. Agendei atendimento para os pais. Dra. Rejane já atendeu?', 'Psicologia ASM', 7, 'FINALIZADO'),
	(1211, '2022-02-01', 'Girassol', 2583, '1964-05-25', 'CAPS Adulto', 9809, 'Rosangela Silva de Oliveira', 'Necessita de retorno com Dra. Rejane no ambulatório, paciente está em processo de luto pelo falecimento da mãe, diversas crises de ansiedade foram desencadeadas, solicito avaliação. Em uso de Alprazolam 1-1-1, Zolpiden 10 mg 0-0-1, Escitalopram 10/20 mg 2-0-0', 'Manutenção ESF', 7, 'FINALIZADO'),
	(1212, '2022-02-01', 'CAPS Ad', 3265, '1962-10-31', 'Girassol', 12227, '     Nilza Elizabet de Souza Coelho', 'Retorno A.S: Nilza disse que seu esposo faleceu há 3 meses de leucemia. Na época ficou muito abalada pensando em desistir da própria vida. Ela é pensionista e coleta produtos recicláveis. Mora sozinha em casa alugada. Questionada sobre o uso de álcool declara que faz uso somente em datas comemorativas ou feriados. Seu filho Marcelo também faz uso de etilicos.. TAE com 4 cartelas de Diazepam + 10 litros de cerveja, em novembro/2021.', 'Manutenção ESF', 7, 'FINALIZADO'),
	(1213, '2022-03-08', 'Girassol', 504, '1958-03-29', 'CAPS Adulto', 4319, 'Virgínia Marangão Bonifácio', 'Contrarreferência após atendimento no Caps Adulto. Em uso de Sertralina 100 mg 0-0-1, Lorazepam 2 mg 0-0-1, Haldol 1 mg 0-0-1. F33.11+F48.9+F61.0 ', 'Manutenção ESF', 7, 'FINALIZADO'),
	(1214, '2022-03-08', 'Girassol', 2583, '1964-05-25', 'CAPS Adulto', 9809, 'Rosangela Silva de Oliveira', 'Discussão do caso para agendamento de consulta no ambulatório de saúde mental com Dra. Rejane. ', 'Manutenção ESF', 7, 'FINALIZADO'),
	(1215, '2022-03-08', 'Girassol', 2378, '1993-06-04', 'CAPS Adulto', 9469, 'Cristopher Mesquita', 'Discussão do caso para agendamento de consulta no ambulatório de saúde mental com Dra. Rejane. Se automedica com Ritalina.', 'Agendado ASM Dra. Rejane 09/03/2022', 7, 'FINALIZADO'),
	(1216, '2022-03-08', 'Girassol', 519, '1965-02-15', 'CAPS Adulto', 630, 'Juracy Alves da Silva', 'Paciente com histórico de acompanhamento no CAPS Adulto, comparece em consulta médica de rotina, extremamente agitada, com polilalia, uso irregular das medicações prescritas pelo Dr. Anderson, extremamente ansiosa. Em uso de Carbamazepina 200 mg 2-0-2, Diazepam 5 mg 1-0-1, Haloperidol 1 mg 2-0-2, Carbonato de litio 300 mg 1-0-1, Clonazepam 2 mg 0-0-1, Prometazina 25 mg 0-0-1, Omeprazol 20 mg 2-0-0, Depakene 250 mg 2-0-2. F06.33+F48.9+F71.1+G40.3+F10.24+ F31.6+F60', 'Manutenção CAPS Adulto e avaliar possibilidade de medicação injetável.', 7, 'FINALIZADO'),
	(1217, '2022-04-05', 'CAPS Adulto', 545, '1966-08-17', 'Pinheiros', 130, 'Fabio jose Ferreira', ' Em uso de: Haldol 1 mg 0-0-1, Fluoxetina 20 mg 1-0-0,Clonazepam 2 mg 0-0-2 (toma 4). Veio ao CAPS quer trocar Clonazepam por Bromazepam 6 mg. Não se adaptou a Fenitoína, quer voltar para o Gardenal.Matriciar para orientar a  troca  da medicaçao', '', 7, 'FINALIZADO'),
	(1218, '2022-05-03', 'Girassol', 2583, '1964-05-25', 'CAPS Adulto', 9809, 'Rosangela Silva de Oliveira', 'Reavaliação medicação: Esc 15 mg 2x + Loredon 50mg 1x Alprazolam 2mg 3x - deseja retorno com Dra. Rejane, no ambulatório, apresenta crises de ansiedade, pânico e tremores, choro frequente.', 'Agendado ASM Dra. Rejane 04/05/2022', 7, 'FINALIZADO'),
	(1219, '2022-05-03', 'Girassol ', 54, '1993-09-30', 'CAPS Adulto', 11111, 'Maria Debora Tomaz Novato Vieira', 'Voltou a apresentar sintomas de toques, manias e rituais, com prejuízo as atividades de vida diária, após novo diagnóstico do marido Reginaldo, necessita de retorno no ambulatório.', 'Agendado ASM Dra. Rejane 04/05/2022 e avaliação assistente social ASM', 7, 'FINALIZADO'),
	(1220, '2022-05-03', 'Girassol ', 54, '1989-06-23', 'CAPS Adulto', 11411, 'Reginaldo Souza Fernandes Vieira', 'Reavaliação da medicação, esposa informa uso incorreto das medicações, fez descoberta recente de dois novos tumores e necessita de retorno no ambulatório', 'Agendado ASM Dra. Rejane 04/05/2022 e avaliação assistente social ASM', 7, 'FINALIZADO'),
	(1221, '2022-05-31', 'CAPS Adulto', 0, '1994-06-07', 'Girassol', 0, 'Matheus de Faria Nogueira Luz', 'Paciente em tratamento pela rede particular deseja iniciar tratamento pelo Sus. Sintomas depressivos. (choro fácil, tristeza, luto pelo fim de um relacionamento, autoestima baixa). Em uso de: Densvenlafaxina 100mg e Venvanse 50mg (dislexia). Medicação não está fazendo o efeito desejado. Solicito avaliação psiquiátrica e acolhimento psicológico.', 'Transferido para o próximo matriciamento.', 7, 'FINALIZADO'),
