	(1225, '2022-06-28', 'CAPS Adulto', 0, '1969-12-02', 'Girassol', 2, 'Maria Lucia Felix da Silva', 'Em uso de escitalopran 20 mg 1 0 1 + Sulpirida de 50 mg 0 0 1. Medico acrescentou respiridona 1 mg , mas paciente não quer tomar , pq fez mal . Discutir o caso.', 'Manutencão ESF', 7, 'FINALIZADO'),
