	(1228, '2022-07-26', 'CAPS Adulto', 0, '1963-12-01', 'Girassol', 1936, 'Sílvia Helena de Paula Porfirio', 'Compareceu ao CAPS, relatou que não segue tratamento medicamentoso quando lhe é sugerido. Solicitou atestado médico. Não apresenta demanda para atendimento neste serviço no momento. Caso o clínico tenha dúvidas em relações ao tratamento da paciente, sugiro conversar com Dra Rejane. Encaminhei a paciente para atendimento psicológico.', 'Transferido para o próximo matriciamento', 7, 'FINALIZADO'),
