	(1233, '2022-08-23', 'Girassol', 643, '1966-12-10', 'CAPS Adulto', 1797, 'Adilson José Cocato', 'Discussão de intervenção. Paciente reside com a irmã, até então com diagnóstico de retardo mental, evoluindo com agressividade, isolamento social, consumo de pornografia, péssimos hábitos de higiene (30 dias sem tomar banho). Não está utilizando os medicamentos. Irmã está com medo, passo caso para Juliana, que verifica possibilidade de visita domiciliar. ', 'Haldol decanoato 1amp mensal.', 7, 'FINALIZADO'),
	(1234, '2022-08-23', 'CAPS Adulto', 12292, '1973-10-07', 'Girassol', 101, 'Sandra Regina da Silva', 'Solicito matriciamento para continuidade de tratamento e psicoterapia pelo posto de saúde. Passou por reavaliação com Dra Ludimila no dia 15/08/22 Em uso de: Nortriptilina 25 mg- 1 0 2 por 4 dias , a partir do 5 dia ao nono (0 0 2), a partir do 10  (decimo dia em diante) 1 0 2.     Prometazina 25 mg- 0 0 1.', 'CAPS Adulto psiquiatria e psicoterapia ESF.', 7, 'FINALIZADO'),
