	(1620, '2021-04-13', 'CAPS adulto', 11867, '1969-10-23', 'Barcelona', 7897, 'Edriene Braga Figueiredo', 'Encaminhada em 22/01/2020. Em uso de: Fluoxetina 20 mg 2-0-2, Ranitidina 150 mg 1-0-1, Clorpromazina 25 mg 0-0-1. Relata estar pegando receita na UBS, mas diminuiu a Fluoxetina para 2 por conta própria. Quer mudar a medicação. Solicito que a medicação seja ajustada, conforme julgar necessário, no UBS. Paciente diz estar com Herpes na virilha há 5 meses, relatou ter passado em consulta com o clínico, mas não passou esta informação para ele. Solicitou laudo para perícia. F33.1+ F48.8 consultou na UBS 07/04 e ele prescreveu 4 Fluoxetina 20 mg. No CAPS Adulto pegou relatório do serviço 24/03 , encaminhada para ginecologista.', 'Manutenção medicação UBS', 9, 'FINALIZADO'),
