	(1628, '2021-05-11', 'CAPS Adulto', 0, '1977-08-19', 'Barcelona', 4865, 'Dulcelina Palmeira Batista', 'Compareceu ao CAPS orientada pela psicóloga do SESMT (não trouxe encaminhamento por escrito). Relata estar ansiosa, desanimada e angustiada. Filha passou por crise de ansiedade em 2019, marido tem síndrome do pânico e está em tratamento. Foi medicada há cerca de três semanas por Dr. Matheus, que prescreveu Duloxetina 30 mg 1-0-0 e Rivotril Sl 0,25 S/N.  Encaminhada para reavaliação médica e atendimento psicológico, já que a mesma não conseguiu atendimento psicológico no SESMT.', 'Manutenção UBS, reajuste medicação e encaminhar para psicoterapia ASM.', 9, 'FINALIZADO'),
