	(1652, '2021-08-03', 'CAPS Adulto', 0, '2002-08-13', 'Barcelona / CAPS i ', 0, 'Valentina Gregório Santos', 'Acompanhamento no CAPS i em 2018/2019. Com historia de automotilação, TAE, Oscilações de humor HD :CID10: F60 F32 Fez uso de: Carbolitium 300 mg (1), Venlafaxina 37,5 mg (1) , Olanzapina 2,5 mg (1) sem remissão dos sintomas. Quer voltar a usar medicação. Mãe com historico de TAE e pai foi assasinado quando ela ainda era criança. Agendado Clínico Geral para 23/07. Não compareceu, histórico de faltas e baixa aderência. Solicitado atendimento psicoterapêutico.', 'Acolhimento CAPS Adulto', 9, 'FINALIZADO'),
	(1653, '2021-08-03', 'Barcelona', 6439, '2003-11-08', 'ASM', 6439, 'Gabriele de Jesus Manoel ', 'Histórico longo de transtorno de ansiedade e crises de pânico, atualmente com piora devido mãe hospitalizada na UTI há dois meses com covid. Em uso de : Elifore 50 mg (1)  rivotril 0.25 mg (1) em acompanhamento psicologico no ASM com Lidia 98441-0861', 'Agendado ASM 16/08/21', 9, 'FINALIZADO'),
	(1654, '2021-08-03', 'CAPS Adulto', 9377, '1948-01-02', 'Barcelona ', 0, 'Meire das Graças Silva', 'Está em acompanhamento psiquiátrico no CAPS, fazendo uso correto dos medicamentos. Queixa falta de apetite, tonturas, entre outros sintomas clínicos. Morando só com cuidadora, filho foi para outra cidade, denuncia de vizinhos por abandono, em VD Liliane constatou tudo limpo e bem cuidada . Solicito avaliação clínica (Diabética). Fiz encaminhamento. Em uso de: Haldol Decanoato 4 ampolas IM 21/21 dias, Biperideno 2 mg 2-0-0 , Nortripitilina 50 mg 0-0-2, Quetiapina 100 mg 0-0-1. CID 10: F20.4', 'Manutenção CAPS Adulto        Contato AS (Liliani), pedir exames laboratóriais s/n', 9, 'FINALIZADO'),
	(1655, '2021-08-03', 'Barcelona', 22, '1982-01-31', 'CAPS Adulto/ASM ', 0, 'Kelma Cristina de Oliveira ', 'Encaminhada pela Dra Jessica, alucinações auditivas, sensoriais... delírios que aplicativos começaram a falar com ela por sinais (grande angustia, pois considerou ter feito pacto com demônio) usuária de maconha também há 25 anos sem desejo de parar, SPA peloTHC ou F20? 988744382', 'Agendado ASM  16/08/21', 9, 'FINALIZADO'),
	(1656, '2021-08-03', 'Barcelona/ASM', 7, '1996-07-27', 'Barcelona/ASM', 7, 'Tamires Candido Paraviso', 'Dra Rejane fez atestado para pericia de 60 dias , mas a pericia não aprovou trabalhou sexta e sabado ontem e hoje teve uma crise mais tranquila, não teve como trabalhar no dia de hoje 03/08. Quer outro laudo para pericia . Entrou em contato no celular dra e psicologa Lidia ', 'Agendado ASM  16/08/21', 9, 'FINALIZADO'),
