	(1711, '2022-04-12', 'Barcelona', 1571, '1958-02-15', 'CAPS Adulto / ASM', 12264, 'Ana Maria Pereira dos Santos', 'Teve crise depressiva passou em atendimento no CAPS dia 06/04/2022 com dr Anderson que incluiu o medicamento Haloperidol 1 mg 1 cp pela manhã e 1 a noite, e alterou também a Fluoxetina 20 mg para 4 cps ao dia e clonazepam 0,5 mg 1/2  de manhâ e 1 a noite Obs: tomava Floxetina 20 mg 2 cps ao dia e clonazepam 2 mg 2 cps ao dia, cunhada da paciente veio a unidade relatando que a paciente esta prostada, e com moleza, deseja rever o tratamento. F48.9+F41.2. tel:3223-8731/98849-2271 ', 'Agendado ASM Dra. Rejane 14/04/2022', 9, 'FINALIZADO'),
	(1712, '2022-04-12', 'Barcelona', 7776, '1967-01-31', 'CAPS Adulto / ASM', 10712, 'Cassia Maria Gomes', 'Longos tratamentos psiquiatricos no passado, atualmente sem medicação, situação social precária, assistida pela psicologa da UBS e CRAS. Teve consulta de urgência no ASM marcada, mas não conseguiu ir, vive sozinha, família e filhas não a ajudam. Crise depressiva com pensamentos de auto extermínio importantes. Agendamento urgente.', 'Agendado ASM Dra. Rejane 14/04/2022', 9, 'FINALIZADO'),
	(1713, '2022-04-12', 'Barcelona / CAPSi', 3763, '2003-08-23', 'ASM /Barcelona', 3763, 'Maria Cecília Pedroso', 'Visita assistente social realizada. Direcionamento para benefícios sociais. Contato com CRAS para inserção SCFV para Maria. Familia recebe pensão por morte. A tia relata que o medicamento está causando muito sono, prostração e oscilação de humor em Maria. Deseja atendimento com psiquiatra. Telefone da tia para avisar 99743-1743 ', 'Agendado ASM Dra. Rejane 14/04/2022', 9, 'FINALIZADO'),
	(1714, '2022-05-10', 'CAPS Adulto', 1430, '1967-04-23', 'Barcelona', 82, 'Luiz Roberto Ribeiro', 'Precisa mostrar o resultado de um exame para Dra. Raquel, mas não está conseguindo agendar uma consulta. Existe a possibilidade de agendar? Obrigada. Já foi atendido, hoje está apresentando queixas oftalmológicas', 'Orientações', 9, 'FINALIZADO'),
	(1715, '2022-05-10', 'CAPS Adulto', 6322, '1984-07-21', 'Barcelona', 0, 'Marcelo Rodrigo de Souza', 'Solicitar atendimento clínico, porque está se queixando de uma alergia muito forte na virilha.', 'Orientações agendamento  Dra. Ana Carolina', 9, 'FINALIZADO'),
	(1716, '2022-05-10', 'Barcelona', 8554, '1962-07-11', 'CAPS Adulto', 252, 'Maria Aparecida Santos de Souza ', 'Já foi paciente do CAPS no passado, passou em acolhimento esse ano novamente porém foi encaminhada para o clínico, que prescreveu Fluoxetina 20 mg  e não obteve sucesso. Apresenta-se  muito desanimanda , crises depressivas, manifestações psicossomáticas, já investigou parte clínica e não encontra nada.', 'Agendado ASM Dra. Rejane 11/05/2022', 9, 'FINALIZADO'),
	(1717, '2022-05-10', 'CAPS Adulto', 9688, '1958-12-08', 'Barcelona', 644, 'Maisa de Oliveira Bíscaro', 'Em uso de: Nortriptilina 25 mg 1-0-1, Levomepromazina 25 mg 1-0-1, Clonazepam 2 mg 1-0-1. Está deprimida, tristeza profunda, desânimo... Quer usar Sertralina que teve boa resposta para o filho. Necessita de ajuste da medicação.', 'Procurar ESF para pegar receita de sertralina, conforme solicitado. Acrescentado sertralina à prescrição', 9, 'FINALIZADO'),
	(1718, '2022-05-10', 'CAPS Adulto', 9053, '1967-01-29', 'Barcelona', 1828, 'Cristina Isabel Fonseca', 'Em uso de: Citalopram 20 mg 1-0-0, Carbamazepina 200 mg 1-0-1, Amitriptilina 25 mg 0-0-1, Clonazepam 2 mg 0-0-1. Mantendo-se depressiva. Sem renda, vivendo de ajuda de terceiros. Precisa de relatório para tentar benefícios, paga INSS (alguém da família paga). Solicito atendimento Dra. Rejane para relatório e ajuste da medicação.', 'Agendado ASM Dra. Rejane dia 12/05/2022', 9, 'FINALIZADO'),
	(1719, '2022-05-10', 'Barcelona', 7905, '2004-04-03', 'ASM', 7905, 'Cecilia Azevedo Batista', 'Crises de ansiedade e depressivas novamente. suspendeu por conta propria Fluoxetina 20 mg e a Pregabalina 75 mg prescrito pela dra Ester após tentativa de A/E e retornou a Sertralina 50 mg, o que não vem  apresentando melhora (como no passado) Reavaliação.', 'Agendado ASM Dra. Rejane dia 12/05/2022', 9, 'FINALIZADO'),
	(1720, '2022-05-10', 'CAPS Adulto', 2982, '1974-08-15', 'Barcelona', 264, 'Claudineia Maria Silva Efigenia', 'Precisa de atestado de afastamento do serviço, pois as medicações estão dando sono e não está aguentando trabalhar.', 'Agendado ASM Dra. Rejane dia 12/05/2022', 9, 'FINALIZADO'),
	(1721, '2022-05-10', 'CAPS Adulto', 0, '1995-06-30', 'Barcelona', 9060, 'Gabriela da Silva dos Santos', 'Gestante, apresentando crises nervosas e lapsos de memória. Solicito acompanhamento psicológico', 'Agendado atendimento psicológico (Lídia) para 27/05/2022 às 8h', 9, 'FINALIZADO'),
