	(1727, '2022-06-07', ' Barcelona', 825, '1971-04-16', 'CAPS adulto', 2741, 'Neide de Carli Jesuino', ' Paciente  Esquizofrenica, se auto mutilando, necessita de reavaliação enc: Dra Ana Carolina Dos Santos Pinto( Clinica geral) tel:99909-0454', 'Agendado CAPS Adulto 08/06/2022', 9, 'FINALIZADO'),
	(1728, '2022-06-07', 'Barcerlona', 8759, '1983-05-04', 'Q1 ASM / Barcelona', 8759, ' Luana Aparecida de Oliveira', ' Paciente em tratamento de depressão, sem acompanhamento psiquiatrico. Piora dos sintomas no ultimo mes. Em uso de: Deller 75mg 1 cp ao dia, alprazolam 1 a noite. Enc dra. Ana Carolina dos Santos Pinto ( clinica geral) tel: 99226-3277', 'Agendado ASM Dra. Rejane 08/06/2022', 9, 'FINALIZADO'),
	(1729, '2022-06-07', 'Barcelona', 4018, '1965-02-03', 'Q1 ASM / Barcelona', 4018, 'Vanessa de Lourdes Garcia ', 'Crise depressiva - ansiosa já em psicoterapia, histórico de vários antidepressivos ao longo de sua história, com efeitos colaterais da maioria, atualmente com duloxetina, se adaptou bem, mas com comportamento bem depressivo ainda. 98846-3775', 'Agendado ASM Dra. Rejane 08/06/2022', 9, 'FINALIZADO'),
