	(1731, '2022-06-07', 'CAPS Adulto', 0, '1973-07-31', 'Barcelona', 7498, 'Welligton Rosa', 'Paciente em uso de escitalopram 20 mg, há 12 dias e rivotril sublingual em caso de crise.Sem melhora do quadro, relatando maior frequencia das crises de panico (corpo queima, tira a roupa fica desesperado). Representante Comercial, não ta conseguindo trabalhar ,pede atestado para perícia. Peço avaliação a Dra Rejane.', 'Agendado CAPS Adulto 08/06/2022', 9, 'FINALIZADO'),
	(1732, '2022-06-07', 'CAPS Adulto', 11262, '1988-11-24', 'Barcelona', 8710, 'Priscila Rosário da Silva', 'Veio com encaminhamento da policlínica central para retomar tratamento abandonado. Esteve internada no Hospital Bom Pastor, apresentando após alta muita ansiedade, medos, queda capilar acentuada. Solicito avaliação Dra. Rejane', 'Agendado ASM Dra. Rejane 08/06/2022 e acompanhamento psicológico ASM', 9, 'FINALIZADO'),
	(1733, '2022-06-07', 'CAPS Adulto', 6131, '1962-04-14', 'Barcelona', 4634, 'Vera Lucia Braga Reis', 'Irmã pede para susṕender o Haldol decanoato,pois esta ficando fraca. Continua na clínica ,está boazinha . F20.3 em uso de: Losartana 50 mg 1-0-0 ,Haldol decanoato, Risperidona 1/2-0-1/2, Quetiapina 100 mg 0-0-1, Prometazina 25 mg 0-0-2', 'Agendado CAPS adulto 09/06/2022', 9, 'FINALIZADO'),
	(1734, '2022-06-07', 'CAPS Adulto', 10954, '1991-11-19', 'Barcelona', 8308, 'Gabriel Moreira  Schmidt', 'Pai quer diminuir , a quantidade de ampolas de clopixol para 1 ampola. O paciente tem tomado injetavel no UBS Barcelona. Discutir com a equipe do UBS como o paciente está. Última renovação de receita 06/05/22. F20', 'Visita domiciliar Liliani e Dra. Ludmila CAPS adulto para avaliar medicação', 9, 'FINALIZADO'),
