	(1738, '2022-07-05', 'CAPS Adulto', 9222, '1962-03-04', 'Barcelona', 4384, 'Maria Aparecida da Rocha', 'Já foi avaliada pelo Anderson Psiquiatra e foi sugerido acompanhamento psicológico.Transferir para planilha do Barcelona.Deseja laudo para o INSS. Queixa-se de insônia. Em uso de: Fluoxetina 20mg 2-0-2, Haloperidol 1mg 2-0-2, Depakene 250mg 2-0-2 e Alprazolan 2mg 0-0-2 HD: F33.2 + F48.8 +F60.3 + F10.20', 'Encaminhada para psicoterapia. Lídia, psicóloga, agendou atendimento para dia 19;08 às 08:40. Maira entrará em contato.', 9, 'FINALIZADO'),
	(1739, '2022-07-05', 'Barcelona', 8804, '1983-04-09', 'Q1 ASM / Barcelona', 8804, 'Patricia Aparecida Barbosa', 'Paciente GESTANTE, apresentando perda de peso, falta de apetite, querendo ficar trancada no quarto, sinais de depressão. Já passou no matriciamento mês de junho, porém relata que os medicamentos não estão dando certo, dr Adriana Garcia Vieira Bueno( ginecologista) encaminhou novamente. tel:99824-0823', 'Agendada consulta com Dra Rejane dia 09-07 às 9:00 horas.', 9, 'FINALIZADO'),
