	(1755, '2022-08-02', 'CAPS Adulto', 6830, '1970-12-10', 'Barcelona', 30, 'Aloísio Henrique Roberto', 'Verificar possibilidade do paciente ser atendido pela Dra. Rejane. F33.1+F41.1+F48.8+F61.0+G40.3. Diabetes, hipertensão e problemas cardiacos.  Em uso de: Oxcarbazepina 300 1-0-1, Fenobarbital 100 mg 0-01, Alprazolam 2 mg 0- 0- 1, Clorpromazna 25 mg 1-0-1, Nortriptilina 25 mg 1-0-1. Tel: 988411975, 988384527, 32238775', 'Manutenção UBS e reajuste medicação Nortriptilina 75mg  ao dia e encaminhamento para psicologia ASM', 9, 'FINALIZADO'),
