	(1757, '2022-08-02', 'Barcelona', 2764, '1956-04-02', 'CAPS Adulto ', 5702, 'Maria de Fatima Martins', 'Paciente acima de 65 anos, com história de arritmia, síncope e alterações de humor, principalmente após perda familiar (enc. Dra Mariane cardiologista em 08/09/2021, porém ainda não foi chamada. tel 99901-0303 CID F41.2+ F48.8+F60.4', '', 9, 'FINALIZADO'),
