	(1759, '2022-08-02', 'Barcelona', 8804, '1983-04-09', 'CAPS Adulto ', 0, 'Patricia Aparecida Barbosa', 'Paciente gestante em uso de: Diazepam 10 mg + Amitriptilina 25 mg apresentando perda de peso, falta de apetite, querendo ficar trancada no quarto sinais de depressão. enc por dra Adriana Garcia ( ginecologista NAMI) tel : 99824-0823', 'marcado ASM 04/08 as 10h00', 9, 'FINALIZADO'),
	(1760, '2022-08-02', 'Barcelona', 147, '1998-02-18', 'CAPS Adulto ', 0, 'Luis Gustavo Mendes Rosa ', 'Mãe relata que filho não sai de casa, ainda com muito pouco apetite e desmotivado. Não compareceu também às sessões de psicoterapia.', '0rientacao mae medicacao correta', 9, 'FINALIZADO'),
