	(1763, '2022-08-30', 'Barcelona ', 8847, '1975-02-18', 'CAPS Adulto ', 7915, 'Cristiane Pereira da Silva', 'Paciente com historico de depressão e ansiedade , piora dos sintomas, mesmo em uso das medicaçoes , perdeu mãe há 1 ano , tendo crise financeira. tel 99918-8634', 'Agendado ASM Dra. Rejane 31/08/2022', 9, 'FINALIZADO'),
