	(1765, '2022-08-30', 'Barcelona', 0, '2000-08-10', 'Barcelona-ASM', 0, 'Filipe Rosa Cézar (irmão do Nathan Rosa César)', 'Pai Aldo declara que o filho está muito agressivo em casa. Relata que o filho não usa drogas, mas está com depressão devido a separação dos pais. Pede avaliação psiquiátrica. Islene', 'Agendado ASM Dra. Rejane 01/09/2022', 9, 'FINALIZADO'),
