	(1770, '2022-09-27', 'Barcelona', 7498, '1973-07-31', 'Barcerlona ', 7898, ' Welligton Rosa', ' Paciente com historico de Sind do pânico, tendo sintomas com frequência, mesmo fazendo uso de medicação. Prescritos inicialmente ( Venlafaxina 75 mg e Clonazepam), não esta conseguindo trabalhar. 99820-4179', 'Agendado ASM Dra. Rejane 28/09/22 ', 9, 'FINALIZADO'),
	(1771, '2022-09-27', 'CAPS Adulto ', 11732, '0000-00-00', 'Barcelona', 6423, 'Clovis Ferreira da Silva', 'Paciente com diagnóstico de esquizofrenia, não sai de casa por dor no joelho devido ao sobrepeso. Não passa por consulta há muitos anos, segundo esposa, faz uso incorreto da medicação. Discussão do caso em equipe, com possibilidade de atendimento no ambulatório de saúde mental, nutricionista e visita domiciliar. Dependencia Rivotril. 98877-9855 Helenice esposa', 'Aguardar visita nutricionista e avaliar possibilidade de VD psiquiatra CAPS adulto', 9, 'FINALIZADO'),
	(1772, '2022-09-27', 'Barcelona', 2124, '1952-05-11', 'CAPS adulto', 856, 'Maria Irene Stabeline ', 'Tratamento com Fluoxetina e Amitriptilina, no entato tendo crises de choro, desânimo, fadiga, insônia mesmo usando clonazepam 2 mg), pouco apetite e falta de vontade para realizar suas atividades rotineiras. tel 99267-0000 / 32225875', 'Reajuste medicação ESF e manutenção ESF', 9, 'FINALIZADO'),
