	(1774, '2022-09-27', 'CAPS i', 206, '2008-12-27', 'Barcelona', 8482, 'Marcus Vinicius Maciel', 'Passou em acolhimento no CAPS i, não absorvido. Verificar acompanhamento pelo PSF e necessidade de consulta neurológica para continuidade da medicação e avaliação de novos sintomas. Aluno da FUVAE. Em uso de Toflanil e Depakene', 'Encaminhado para neurologia', 9, 'FINALIZADO'),
	(1775, '2022-09-27', 'Barcelona', 28, '1988-04-30', 'Barcelona', 28, 'Rosiane Aleixo da Silva', 'Já assistida em psicoterapia, faz uso de Sertralina e Clonazepan há mais de um ano, com piora de alguns sintomas, principalmente agressividade, pelo histórico sugerindo um transtorno Bipolar?', 'Agendado ASM Dra. Rejane 29/09/22 ', 9, 'FINALIZADO'),
