	(1777, '2022-09-27', 'CAPS Adulto ', 12291, '1972-04-05', 'Barcelona', 8799, ' Maxlene de Almeida Imagaki ', 'Paciente passou em atendimento no CAPS dia 15/06/2022 com dra Ludmila, emcaminhou para matriciamento para passar com dra Rejane. Estável dos sintomas psicoticos, refere desanimo e ganho de peso com a medicação.Foi feita a troca de medicações disponiveis no Brasil, avaliar sintomas depressivos e sindrome metabolica.  TEL 99762-0837.  Em uso de: Olanzapina, Prisma', 'Agendado ASM Dra. Rejane 28/09/22 ', 9, 'FINALIZADO'),
