	(1782, '2022-09-27', ' Barcelona', 9038, '1975-07-21', 'ASM /CAPS Adulto', 743, 'Andrea Dias Ferreira', 'Crises de ansiedade mais frequentes com muita palpitação, dificuldades para dormir com diazepan e mal estar após amitriptilina,  já encaminhada para clínico para investigação cardíaca, ver a possibilidade de voltar para mirtarzapina 30 mg pois agora conseguiu auxílio Brasil.', 'Reajuste medicação e manutenção UBS', 9, 'FINALIZADO'),
