	(1793, '2022-11-29', 'Barcelona ', 268, '1963-12-07', 'Barcelona ', 268, 'Rosana de Cassia Lino', 'Paciente com histórico de insônia, dores cervicais intensas e crônicas, em uso de alprazolam e trazadona, mantem dificuldade para manutenção do sono, mesmo em uso dos medicamentos e psicoterapia. Humor bastante deprimido e desmotivação. Engordou após início de trazodona, nunca fez uso de fluoxetina e amitripitilina segunda relato. tel: 98872-2145', 'agendada para dia 30/11/22 as 09h00 dra Rejane', 9, 'FINALIZADO'),
	(1794, '2022-11-29', 'Barcelona ', 5087, '0000-00-00', 'Barcelona ', 5087, 'Silvio Rubens Cardoso', 'Paciente em tratamento de depressão , ansiedade refere piora dos sintomas nos ultimos dias bem como sonolencia exessiva , reduzi clonazepam fazia 4mg dia, oriento uso diario de escitalopram (fazia uso irregular). Em uso de carbamazepina/clonazepam neozine, amitriplina,desvenlaxina, escitslopram.Tel99752-1127/99956-9970', 'Manejo clínico anotado em prontuário pela dra Rejane, suspender desvenlafaxina e escitalopran, diminuição do Neozine para 1/2 cp dia e introdução da Bupropiona 150mg /dia.', 9, 'FINALIZADO'),
	(1795, '2022-11-29', 'Barcelona', 825, '1971-04-16', 'Barcelona', 825, 'Neide de Carli Jesuino', 'Paciente com histórico de depressão, já em uso de medicação no entanto, tendo pensamentos suicidas. Tem muita dificuldade em aceitar suas morbilidades e não faz tratamento adequado, sobretudo em relação a aplicação de insulinas (o que é extremamente necessário devido hiperglicemia constante). Ficha refere que o mesmo já fez uso de topiramato que melhorou seu padrão alimentor e ajuda no controle.', 'suspende biperideno e insere topiramato 25mg 1-0-1 para ajudar na questão alimentar. manejo clínico anotado em prontuário pela dra Rejane', 9, 'FINALIZADO'),
