	(2119, '2020-09-08', 'CAPS Adulto', 11526, '1975-04-15', 'CAIC II', 2474, 'Marcelo Lourenço Evaristo', 'Compareceu com a esposa, relataram que na UBS  alegaram que o encaminhamento do paciente venceu há um ano. Esposa disse que não agendaram reavaliação médica do paciente na UBS alegando que esta deveria ser feita somente pelo psiquiatra no CAPS.Se a medicação foi mantida na UBS por um ano, qual o motivo para não manter?  Ou o mesmo estava sem uso de remédios neste período?Se o paciente precisa de reavaliação, porque não passar no médico UBS e em caso de dúvidas,matriciar.  ', 'UBS não participou do matriciamento, caso transferido para próximo matriciamento.', 11, 'FINALIZADO'),
