	(2142, '2021-03-16', 'Jardim Colonial', 5279, '1966-09-29', ' CAPS Adulto/ASM', 9074, 'José Raimundo Lino', 'Paciente com diagnóstico de Transtorno Afetivo Bipolar com agudização do quadro, em episódio maníaco e com sintomas psicóticos. Fazia acompanhamento em Amparo SP. Solicito reavaliação e conduta. ', 'Transferido para o próximo matriciamento', 12, 'FINALIZADO'),
	(2143, '2021-03-16', 'ASM', 0, '1987-02-13', 'ASM', 0, 'Anísia  Rodrigues de Souza', 'Quadro depressivo e estresse pós traumático, após falecimento de companheiro ..Grandes dificuldades para dormir, ouvindo vozes que a induzem planejar sua morte. Grande histórico traumático na infância e adolescência', 'Agendado ASM 17/03  e manutenção Lidia', 12, 'FINALIZADO'),
