	(2146, '2021-04-13', ' ', 3963, '1952-12-06', ' CAPS Adulto/ASM', 10853, 'José Antonio Miranda', 'Já foi acompanhado no CAPS Adulto, apresentando piora da agressividade, mania de perseguicão, esta sendo também acompanhado pelo CREAS. Faz uso de Depakene 250 mg 2x, ja foi avaliado pelo envelhecer, PAD e neurologia . Cadeirante teve membro amputado / diabetico ', 'Agendado ASM 14/04', 12, 'FINALIZADO'),
	(2147, '2021-04-13', 'Jardim Colonial', 3765, '1999-08-26', 'CAPS Adulto/ ASM', 0, 'Beatriz Borges do Nascimento', 'Consultou com Dr Neder 18/02/2021. Em tratamento para Sindrome do Pânico, faz uso de: Frontal 0,5mg, Escitalopram 10mg, Amitriptilina 25mg ( Prescrito pela Dra Jovana), sem melhora. Refere TAE com uma cartela de Frontal. Foi atendida no UPA 17/02/2021 fez lavagem. Encaminhada ao CAPS para acolhimento até a data do matriciamento. Discutir com Lidia e CAPS ', 'Psicoterapia ASM', 12, 'FINALIZADO'),
	(2148, '2021-04-13', 'Jardim Colonial', 3179, '2006-05-19', ' CAPS Adulto/ASM', 0, 'Talita Santos de Oliveira', 'Paciente encaminhada para psicologia devido transtorno depressivo moderado, TAG, e pensamentos de auto extermínio. Em uso de Fluoxetina 20 mg Discutir com Lidia e CAPS  ', 'Psicoterapia ASM', 12, 'FINALIZADO'),
	(2149, '2021-04-13', 'Jardim Colonial', 2006, '1974-11-13', 'CAPS Adulto/ASM', 2226, 'Claudia Helena dos Santos', 'Paciente compareceu em 04/03 com relato de TAE no final de semana. Refere que ingeriu todos os medicamentos prescritos, levada a UPA. Não quer mais fazer uso de medicamentos e não aceita tratamento no CAPS; encaminhada para consulta na UBS e matriciamento . Faz uso de: Diazepam 10 mg  Fluoxetina 20 mg e suspendeu Haldol por conta própria. TBH internada Bom Pastor ', 'Manutenção UBS e psicoterapia ASM', 12, 'FINALIZADO'),
	(2150, '2021-04-13', 'Jardim Colonial', 335, '1965-05-13', 'CAPS Adulto/ASM', 8849, 'Marcia Regina Conde ', 'Paciente apresenta crises de ansiedade.  faz uso de Diazepam 10 mg,  e parou com outros por conta própria, refere aumento ansiedade e elevação niveis pressóricos. TAB.  Ana Julia teve um bebê e esta grávida novamente.  ', 'Reajuste medicação s/n e Psicoterapia  ASM', 12, 'FINALIZADO'),
