	(2153, '2021-04-13', 'Jardim Colonial', 2274, '1961-10-22', ' CAPS Adulto/ASM', 1547, 'Cleusa Aparecida Meneguci', 'Paciente compareceu ao CAPS solicitando receita de Fluoxetina 20mg 1-1-1 e Diazepam 10mg 1-0-1. Diz que na UBS estão dando receita a menos pois perderam o encaminhamento. Expliquei que o último encaminhamento é de Citalopram e Diazepam. Feito novo encaminhamento e orientei a procurar o UBS. S/n fazer os reajustes na mesma.', 'Manutenção UBS', 12, 'FINALIZADO'),
	(2154, '2021-04-13', 'Jardim Colonial', 278, '1959-05-13', ' CAPS Adulto/ASM', 546, 'Odete Olegário Silva', ' Foi encaminhada em uso de: Amitriptilina 25 mg 3-3-3, Diazepam 10mg 2-2-2, Carbamazepina 400 mg 0-0-3 Haldol 1mg 1-1-1 e Rivotril gotas 10gotas/sn. Clinica em dúvida em relação a manutenção da dose da medicação acima.  CID 10 F33.1 F48.8', 'Agendada 14/04', 12, 'FINALIZADO'),
	(2155, '2021-04-13', 'Jardim Colonial', 1447, '1989-10-03', ' CAPS Adulto/ASM', 4181, 'William Bráz', 'Paciente compareceu ao acolhimento solicitando relatório para tentar conseguir LOAS, relata fazer uso de: Carbolitium 300 mg 2x ao dia, Neozine 25 mg 2x ao dia, Bromazepam 3 mg 2x ao dia e Depakene 250 mg 1x ao dia. Esta medicação não foi prescrita no CAPS. Relata fazer uso de Lítio há muitos anos e nunca fez um exame de sangue. Quer receita. Agendei consulta com clínico, Dr Neder, dia 12/04 às 07:15 ( não compareceu nesta e em outras).   Baixa aderencia TTO  F60.3+ F19.2', 'Aguardar comparecimento a UBS', 12, 'FINALIZADO'),
	(2156, '2021-05-11', 'Jardim Colonial', 2846, '1941-12-20', 'CAPS Adulto', 3569, 'Pedro Lourenço', 'Pânico. Em uso de:Imipramina 25 mg (9 cps/dia) total de 225 mg / dia Clonazepam 2 mg ( 3 cps / dia) total de 6mg / dia.F 39 F41. 0 Paciente em uso da medicação acima há muitos anos. Está estável. ', 'Manutenção medicação UBS', 12, 'FINALIZADO'),
	(2157, '2021-05-11', 'CAPS i', 77, '2007-10-31', 'CAIC II /ASM', 510, 'Juan Pablo Cunha Benevenuto', 'Compareceu ao CAPSi com demanda apenas para atendimento psiquiátrico. O adolescente é aluno da FUVAE. Necessário conversar sobre o caso e possibilidades clínicas. Epilepsia, questões comportamentais, agressividade, teve trombose na perna. Em uso de: Marevan 5 mg, Amitripitilina 25 mg  1-1-1 , Rivotril 2mg 1-1-1, Carbamezepina 200 mg 2-2-2  F71.1+F84.9+G40', 'Agendado ASM 13/05 ', 12, 'FINALIZADO'),
