	(2160, '2021-06-08', 'Jardim Colonial', 4834, '1973-01-10', 'CAPS Adulto/ ASM', 0, 'Viviane Silva Paiva Pasqualino ', 'Encaminhada pela psicologa do SESMT Marcela, para consulta psiquiatrica, \nteve um acidente de trabalho, sofreu ataque de um pitbull enquanto fazia a fiscalização como agente de endemias. A paciente relata sintomas de ansiedade e dificuldade para enfrentar as situações do cotidiano a partir desse fato. Possível TEPT. 35 99231 4411', 'Agendado ASM 09/06', 12, 'FINALIZADO'),
