	(2162, '2021-06-08', 'CAPS Adulto ', 8897, '1959-04-21', 'Jardim Colonial', 754, 'Maria José da Cruz Juvenal', 'Fazia acompanhamento no CAPS, foi encaminhada para continuidade do tratamento/ manutenção da medicação em 2018. Queixa ineficácia da medicação, pede para "passar com psiquiatra". Em uso de: Fluoxetina 20 mg 2 0 0, Neozine 25 mg 0 0 1/2, Clonazepam 2 mg 0 0 3. CID 10 - F 33.2 F48.8', 'Agendado ASM 10/06 e encaminhada para Psicoterapia.', 12, 'FINALIZADO'),
