	(2175, '2021-08-31', 'CAPS Adulto', 11312, '1984-09-15', 'Jardim Colonial', 510, 'Tatiana Bueno Costa Dias', 'Encaminhada pelo SESMT ao CAPS para avaliação psiquiátrica. Como trata-se de paciente já encaminhada para tratamento na unidade, verificar possibilidade de avaliação por parte da Dra. Rejane. (F32.2-F48.8) Filho faz TTO no CAPS i , uso de SPA ', 'Agendado ASM  02/09/21 e psicoterapia ', 12, 'FINALIZADO'),
	(2176, '2021-08-31', 'ASM / AS', 510, '2007-10-31', ' CAPS i /Jd. Colonial / ASM', 77, 'Juan Pablo Cunha Benevenuto', 'Retorno Islene: Realizada VD. Mãe refere estar ministrando maior dosagem da medicação. Resistente à terapia. Relata agressividade do filho e resistência aos cuidados de higiene. Afirma não conseguir levá-lo nas consultas. Relação conturbada com o filho. Acionei CREAS e CT.', 'Agendado ASM  02/09/21', 12, 'FINALIZADO'),
	(2177, '2021-10-05', 'CAPS Adulto', 3966, '1949-02-12', 'Jardim Colonial', 1159, 'Antônio Jorge', 'Iirmã pede para aumentar Diazepam para usar quando necessário. Em uso de Diazepam 10 mg 1-0-1. Morou na rua, em abstinência de álcool há 6 anos.', 'Manutenção UBS e Fenergan se necessário.', 12, 'FINALIZADO'),
	(2178, '2021-10-05', 'Colonial', 5279, '1966-09-29', 'ASM', 5279, 'José Raimundo Lino', 'Paciente comparece 16/09/2021 com relato de desmaios recorrentes. Acredita ser devido a medicação. Já foi atendido no ambulatório e orientado a retornar se necessário. Encaminho para avaliação da clínica. Encaminhado pela Dra Aline para reavaliação com Dr Rejane. Em uso de Quetiapina, Carbolitium, Sertralina e Alprazolam. F41.1 (Dra. Aline 23/09)', 'Agendado ASM 06/10/21 Dra. Rejane', 12, 'FINALIZADO'),
	(2179, '2021-10-05', 'UBS Colonial/ ASM', 0, '2011-11-03', 'ASM/CAPSI?', 5754, 'Hyago Correa Robatine', 'Islene: Caso passado pela UBS. Família em situação de violação de direitos (violencia doméstica contra mãe pelo companheiro) Hyago se recusa a ir na escola, sair de casa. Fica o dia todo no jogo do celular e quando a bateria acaba entra em crise: fica agressivo, começa a gritar. Medo da mãe morrer. Medo de ficar sozinho. Muito choroso. Avaliar se o Caps i ou ASM pode atender a criança', 'Acolhimento CAPS i', 12, 'FINALIZADO'),
	(2180, '2021-10-05', 'UBS Colonial/ ASM', 0, '2008-06-03', 'CAPS i', 0, 'Richard Santos Silva', '', 'Acolhimento psicologia ASM', 12, 'FINALIZADO'),
	(2181, '2021-11-16', 'CAPS i', 77, '2007-10-31', 'UBS Colonial', 510, 'Juan Pablo Cunha Benevenuto', '', 'Agendado ASM Dra. Rejane 18/11/21', 12, 'FINALIZADO'),
	(2182, '2021-11-23', 'UBS Colonial', 1447, '1989-10-03', 'ASM', 1447, 'William Bráz', 'Encaminhado pela Dra Aline em 19/11/2021 devido a relato de tentativas de auto extermínio. Já em tratamento com Dra Rajane, solicita retorno. Observação dia 22/11 vem solicitar cópia do prontuário para processo para aposentadoria.', '', 12, 'FINALIZADO'),
	(2183, '2021-12-14', 'Caps II', 11402, '1977-09-06', 'UBS Colonial', 0, 'Eliane Proque Coelho de Miranda Braz', 'Paciente solicita avaliação psiquiátrica. Diz que, desde que foi encaminhada ao PSF, jamais passou por consulta médica e, ultimamente, tem tido dificuldades para renovar as receitas. Relata estar comendo compulsivamente. Além disso, faz uso de remédios de alto custo e não consegue mais arcar com tal medicação, por essa razão, necessita de um relatório médico para que a medicação seja fornecida pelo Estado. Verificar possibilidade de avaliação pela Dra. Rejane e de acolhimento psicológico. ', 'Agendada consulta Dra. Rejane 06/01/22 CAPS Adulto', 12, 'FINALIZADO'),
	(2184, '2021-12-14', 'CAPS ll', 0, '1975-06-13', 'JD COLONIAL ', 1271, 'Ida do carmo Rosa Meliato', 'Paciente solicita avaliaçao psiquiátrica. A paciente relatou ser diagnosticada com TOC e faz tratamento psiquiátrico a 10 anos. Mas devido ao fato de ter perdido seu plano de saúde não tem mais condição de pagar as consultas, portanto solicita atendimento psiquiátrico de forma gratuita. Quanto a atendimento psicológico ja foi solicitado ao psicológo Giovani, o qual disse que a colocou em sua lista. Verificar possibilidade de avaliação pela Dra. Rejane', 'Agendada consulta Dra. Rejane 17/01/22 CAPS Adulto. Acolhimento psicologia ASM.', 12, 'FINALIZADO'),
	(2185, '2021-12-14', 'CAPS II', 12097, '1976-05-13', 'CAIC II ', 0, 'Cristiane das Graças Araujo Galdino ', 'A paciente relatou chorar todos os dias, medo de tudo, diz as vezes ter vontade de sumir e falou que ouve vozes mas que é comum e normal para ela. Disse estar bem, mas deseja retomar o tratamento medicamentoso, pois tomou os remédops prescritos a ela, por um curto período e gostaria de uma reavaliação. Verificar possibilidade de avaliação pela Dr. Rejane.', 'Agendada consulta Dra. Rejane 04/01/22 CAPS Adulto', 12, 'FINALIZADO'),
	(2186, '2021-12-14', 'UBS', 277, '1969-10-05', 'Ambulatório', 0, 'Aparecida Liliane de Lima Tavares', 'Paciente atendida na UBS com quadro depressivo em uso de aripiprazol,alprazolam, selozok e escitalopram, acompanhada pela psicologia estava em acompanhamento com psiquiatrica particular e esta sem condições de manter tratamento e acompanhamento. SIC procurou a triagem no CAPS e encaminhada para UBS para encaminhamento ao ambulatório de psiquiatria.  ', 'Agendada consulta Dra. Rejane 10/01/22 CAPS Adulto. Atendimento psicológico ASM.', 12, 'FINALIZADO'),
	(2187, '2021-12-14', 'UBS/ ONCOLOGIA', 4094, '1976-03-07', 'Ambulatório Psiquiatria ', 0, 'Wagner Silva 92055812/ 984238673', 'Irmã Kelly comparece para solicitar consulta com psiquiatra paciente acompanhado na oncologia devido a CA de garganta com crise recorrente de ansiedade  não consegue comparecer as consultas no oncologia, sic da irmã ficou internado no Bom Pastor por crise conversiva. Em acompanhamento com psicologia na oncologia. ', 'Agendada consulta Dra. Rejane 17/01/22 CAPS Adulto ', 12, 'FINALIZADO'),
