	(2190, '2022-02-08', 'CAPS Adulto', 0, '1951-04-10', 'Jardim Colonial', 557, 'Paulo Divino Batista', 'Crises de ansiedade (desespero, choro, sudorese, taquicardia), agressividade com a esposa , insônia... em uso de: risperidona 2 mg + rohydorm 2 mg receitado por neurologista, com memória parcial do quadro. Queiixa de fraqueza e dor nas pernas. Agendar com clínico para avaliar necessidade de avaliação psiquiátrica.', 'Acompanhamento psicologia encaminhamento para Envelhecer', 12, 'FINALIZADO'),
