	(2198, '2022-02-08', 'CAPS Adulto', 1972, '1957-05-13', 'Jardim Colonial', 430, 'Sebastião Donizeti Rita ', 'Matricio para conhecimento equipe UBS, usuário veio ao acolhimento com queixa de tristeza, desânimo, preocupação com problemas pessoais e sintomas de ansiedade. Médica Sara o atendeu e iniciou fluoxetina 20mg 01 cp/dia e clonazepan 2mg - 02 cp a noite.', 'Importante avaliação clínica, pois usuário queixa de fraqueza, relatando que tem dias que não consegue ir trabalhar. Reside só.', 12, 'FINALIZADO'),
	(2199, '0000-00-00', 'Jardim Colonial', 2646, '1974-11-30', 'CAPS Adulto', 9019, 'Maria Aparecida Silva Almeida', 'Companheira da paciente,liga na SEMUS para dialogar sobre o encaminhamento ambulatorial para o CAIC II. SIC da companheir,a paciente não está sendo assistida na UBS do CAIC II.Informando que o caso da mesma é grave ,pedindo retorno para o CAPS II onde estava sendo assistida.', 'Agendado 09/02/2022', 12, 'FINALIZADO'),
	(2200, '2022-03-15', 'CAPS AD', 688, '1952-08-25', 'Jd Colonial', 4117, 'Eloisa Garcia dos Reis', 'Paciente estável, etilista; em uso de Diazepam 10 mg (0-0-1). Última receita médica no CAPS AD em 11/02/2022. Encaminhada ao UBS para manutenção medicamentosa.', 'Manutenção UBS', 12, 'FINALIZADO'),
	(2201, '2022-03-15', 'CAPS Adulto', 2737, '1976-07-27', 'Jd Colonial', 216, 'Patrícia Luiza Moreira', 'Compareceu ao acolhimento relatando estar passando por problemas familiares. Está com dificuldades de dormir, quer que a medicação seja revista. Solicito manutenção da medicação noUBS. (tel para avisar se marcar consulta 98874-9838) Atendida pelo psicólogo Geovane na UBS mas falta pois não tem com quem deixar o neto recém nascido.', 'Agendado ASM Dra. Rejane 17/03/2022 ', 12, 'FINALIZADO'),
	(2202, '2022-03-15', 'CAPS Adulto', 12255, '1996-05-03', 'Jd Colonial', 1196, 'Thais Maria Vitor Sales', 'paciente não apresenta perfil para atendimento no CAPS neste momento. Necessita de consulta médica. Contato: 992522627', 'Acolhimento psicologia ASM e agendado ASM Dra. Rejane 17/03/2022', 12, 'FINALIZADO'),
	(2203, '2022-03-15', 'CAPS Adulto', 0, '1978-09-19', 'Jd Colonial', 2274, 'Clisélia Moreira', 'Usuária diz estar ansiosa, apresentando feridas no corpo. Chorosa e com dificuldade de conviver com os outros. Preocupações com o trabalho. Em uso de: Gardenal 100 mg 0-0-1 , Oxcarbazepina 300 mg 0-0-1, Diazepam 10 mg, Venlafaxina 75 mg. G40 + F41. Em atendimento com Geovane Psicólogo na UBS: Limitações impostas pela epilepsia.', 'Acolhimento psicologia ASM', 12, 'FINALIZADO'),
	(2204, '2022-03-15', 'CAPS Adulto', 0, '1997-05-21', 'Jd Colonial', 0, 'Ana Caroline de Sousa Silva', 'Depressão, ideação de morte, desânimo. Quadro agravado após perca do emprego. Solicito atendimento Dra. Rejane.', 'Acolhimento psicologia ASM e agendado ASM Dra. Rejane 17/03/2022', 12, 'FINALIZADO'),
	(2205, '2022-04-12', 'CAPS Ad', 2523, '1975-01-11', 'Jd Colonial', 1594, 'Adilson Campos', 'Encaminhado dra Aline, acolhido em PD semi intensivo e psiquiatria. Demanda neurológica. Em uso de: Fenobarbital 100 mg, Diazepam 10 mg e medicacões para hipertensão.', 'Manutenção UBS', 12, 'FINALIZADO'),
	(2206, '2022-04-12', 'CAPS Adulto', 445, '1956-01-19', 'Jd Colonial', 806, 'Sebastiana Flávio', 'Encaminhada ao CAPS, não absorvido. Queixa aspectos depressivo ansiosos, com baixa resposta à medicação', 'Manutenção UBS e psicologia ASM', 12, 'FINALIZADO'),
	(2207, '2022-04-12', 'CAPS Adulto', 0, '1996-12-24', 'Jd Colonial', 0, 'Larissa Biancasteli  Silva', 'Compareceu ao CAPS segundo orientação de psicóloga particular, visando revisão da medicação (Escitalopram). Depressão, ideação de morte. Solicito avaliação Dra. Rejane.', 'Encaminhada para fazer cadastro na UBS', 12, 'FINALIZADO'),
	(2208, '2022-04-12', 'CAPS Ad', 2722, '1988-07-28', 'Jd Colonial', 0, 'Juliano de Jesus', 'Usuário alcoolista recusou tratamento no CAPS Ad. Encaminhado para a rede básica por apresentar dores na coluna.', 'Manutenção UBS', 12, 'FINALIZADO'),
	(2209, '2022-05-10', 'CAPS Adulto', 445, '1956-01-19', 'Jd Colonial', 1064, 'Sebastiana Flávio', 'Insiste que precisa rever medicação, pois não está bem com o uso de: Fluoxetina 20 mg 1-0-0, Bromazepam 6 mg 0-0-1. Fica deitada, não faz limpeza na casa, dor no peito. Poliqueixosa, esquecimentos', 'Agendado ASM Dra. Rejane para 12/05/2022', 12, 'FINALIZADO'),
	(2210, '2022-05-10', 'Jd Colonial', 102, '1989-12-11', 'Jd Colonial', 102, 'Samuel da Silva Graciel', 'Quadro de Retardo Mental Moderado e Depressão. Necessita laudo para INSS e reavalição de medicação. Analfabeto funcional, mãe falecida há aproximadamente 2 meses. Rebaixamento intelectual', 'Islene fará avaliação social, manutenção psicologia UBS, mas abandonou o tratamento faz 02 meses.', 12, 'FINALIZADO'),
	(2211, '2022-05-10', 'CAPS Ad', 2719, '1982-06-25', 'Jardim Colonial', 0, 'Igor Dominguito', 'Em acompanhamento desde outubro/2018; quadro estabilizado. Em uso de: Quetiapina (1-0-1); Fluoxetina 20mg (2-0-0); Clonazepam (0-0-1); Naltrexona 50mg (1-0-0). Encaminhamento à UBS para manutenção medicamentosa.', 'Manutenção UBS', 12, 'FINALIZADO'),
	(2212, '2022-05-10', 'CAPS Adulto', 12255, '1996-05-03', 'Jardim Colonial', 1196, 'Thaís Maria Vitor Sales', 'Quer trocar a medicação. Deprimida, sensação de estar oca por dentro, vontade de morrer. Prescrito nortriptlina 50 e clonazepam 2. Está em psicoterpia com Geovane. Ela quer fazer quinzenal. Evolução lenta, mas aderida.', 'Agendado ASM Dra.Rejane para 11/05/2022. Em atendimento psicológico quinzenal com Geovane no CAIC II', 12, 'FINALIZADO'),
	(2213, '2022-06-07', 'CAPS Adulto', 445, '1956-01-19', 'Jd Colonial', 1064, 'Sebastiana Flávio', 'Paciente comparece na unidade solicitando reavaliação da Dra Rejane afirma não ter condições financeiras para comprar a medicação prescrita no atendimento do dia 12/05/2022 - Prescrição Bupropiona XL Zetron 150mg 1 cp ao dia e rivotril 2 mg 1 cp a noite.(10/05/2022 -Insiste que precisa rever medicação, pois não está bem com o uso de: Fluoxetina 20 mg 1-0-0, Bromazepam 6 mg 0-0-1. Fica deitada, não faz limpeza na casa, dor no peito. Poliqueixosa, esquecimentos)', 'Agendado retorno ASM Dra. Rejane 07/07/2022', 12, 'FINALIZADO'),
	(2214, '2022-06-07', 'CAPS Adulto', 0, '1952-03-28', 'Jd Colonial', 0, 'Carlos Braga da Silva', 'Veio procurar psiquiatra por orientação do hospítal regional, após alta hospitalar. Delirium? Demência?', 'Avaliação clínica CAPS adulto 08/06/2022', 12, 'FINALIZADO'),
	(2215, '2022-06-07', 'Jd Colonial', 2646, '1974-11-30', 'CAPS Adulto', 9019, 'Maria Aparecida Silva Almeida', 'Faltou no seu ultimo agendamento, justificando aqui no Barcelona, consulta com outro especialista receita foi renovada, porém companheira pede reavaliação.', 'Agendado CAPS adulto', 12, 'FINALIZADO'),
