	(2218, '2022-07-05', 'ASM', 510, '2007-10-31', 'ASM', 77, 'Juan Pablo Cunha Benevenuto', 'Mãe vem ao CAPS solicitando receita. Foi atendido pela Dra. Rejane em 17/01/2022  no ambulatório e encaminhado para manutenção do tratamento no ESF. Novamente reencaminhado ao CAPS pelo Dr. Neder. Em contato com Rejane, fará as receitas. Encaminhar a FUVAE ? onde irá manter o tratamento? Cid 10 F71.1                    Retorno A. Social: Reunião de Rede (CREAS; Fuvae; ASM Islene). Caso já articulato com Dra. Rejane. Necessita de preenchimento do formulário para o Codeva e laudo que justifique transporte exclusivo que Mariane deverá levar na Fuvae. Telefone de Mariane: 98818-1821', 'Agendado com Rejane 06/07 às 8 horas. (Islene: Reunião realizada na FUVAE com CREAS. Várias articulações em andamento)', 12, 'FINALIZADO'),
