	(2220, '2022-07-05', 'Jd. Colonial / ASM', 5394, '1967-06-15', 'CAPS Adulto', 0, 'Antonio Belo Sobrinho', 'Paciente com tratamento dra Rejane e psicologia. Quer encaminhamento para psiquiatria. Portador de Transtorno Bipolar. Em uso de: Carbolitium, Akineton, Bromazepam (SOS), Zolpidem (SOS) e Haldol decanoato IM 30/30 dias.', 'Agendada consulta com Dra Rejane, dia 07-07 às 10:00.', 12, 'FINALIZADO'),
