	(2226, '2022-08-30', 'CAPS i', 77, '2007-10-30', 'ASM/Cais', 510, 'Juan Pablo Cunha Benevenuto', 'Mariane relata que está dando óleo de canábis para Juan por conta própria (3 gotas de manhã e 3 a noite). Também está dando a medicação prescrita por Dra. Rejane. Muito resistente às articulações propostas para retorno de Juan às aulas da Fuvae que pede laudo psiquiátrico atestando ápto seu retorno às aulas. Peço Dra. Rejane avaliar questão da medicação e laudo para retorno às aulas. Grata.', 'Agendado ASM Dra. Rejane 01/09/2022', 12, 'FINALIZADO'),
