	(2414, '2022-06-07', 'CAPS Adulto', 822, '1979-04-21', 'Vargem', 0, 'Leandro EStevam Narente', 'Foi encaminhado para manutenção do tratamento no ESF. Em uso de: Nortriptilina 50 mg 1 0 1, Diazepan 10 mg 0 0 2, Prometazina 25 mg 0 0 1, Propanolol 40 mg 1 0 1. Levomepromazina 100 mg  0 0 1/2. Pai pede reavaliação pois o paciente voltou a falar q vai ingerir veneno de rato, diz q as pessoas vão ataca-lo , tem noite q não dorme. Peço reavaliação.', 'Agendado CAPS adulto', 13, 'FINALIZADO'),
	(2415, '2022-06-07', 'Sagrado Coração', 14, '2004-09-28', 'CAPSi', 0, 'Jordão Feliciano', ' Em acompanhamento médico pediatrico em BH devido a cariotipo 46xy no qual foi solicitado acompanhamento para avaliação de hiperfagia e deficiencia intelectual e necessidade de controle de medicamento apresenta criptorquidia a esquerda, micropenis, dismorfismos, macrocrania e baixa estatura ainda sem diagnostico após 12 anos apresentou aumento do apetite e obesidade     ', 'Agendado ASM Dra. Rejane 08/06/2022 - OBS: PACIENTE NÃO PODERÁ COMPARECER À CONSULTA AGENDADA, POIS ESTÁ EM TRATAMENTO EM BELO HORIZONTE', 13, 'FINALIZADO'),
	(2416, '2022-06-07', 'Vargem', 12210, '2005-09-23', 'CAPSi', 0, 'Paulo Gabriel Nogueira', 'Mãe solicita retorno com a dra Rejane após alteração na medicação. Relata agitação.', 'Agendado ASM Dra. Rejane 09/06/2022', 13, 'FINALIZADO'),
	(2417, '2022-06-07', 'Vargem', 1485, '2007-01-11', 'CAPSi', 0, 'Sara das Graças Oliveira', 'Paciente esta em acompanhamento com psicologo Geovane que solicitou avaliaçao conjunta. Transtorno de pânico, questões familiares. Boa adesão à psicoterapia.Mãe muito ansiosa necessitará ser acolhida também.', 'Agendado ASM Dra. Rejane 09/06/2022', 13, 'FINALIZADO'),
	(2418, '2022-06-07', 'CAPSi', 0, '1991-09-03', 'Sagrado Coração', 0, 'Pâmela Aparecida de Carvalho', 'Mãe da paciente do CAPSi, Maria Jullya Carvalho Gonçalves, realizou cadrastro no ESF. Foi encaminhada para psiquiatria. Refere ideação de suicida do companheiro Jesuel.', 'Avaliação ESF', 14, 'FINALIZADO'),
	(2419, '2022-06-07', 'Vargem M.A.02', 12, '1982-02-10', 'CAPS Adulto ', 0, 'Devani da Silva', 'Em visita domiciliar pede retorno com a dra Rejane. Relata não estar conseguindo dormir mesmo com uso de medicação. Em uso de fluoxetina 20mg 3cp ao dia, nortriptilina 25mg 2 cp à noite e diazepam 10mg 1cp à noite. Em acompanhamento com o Psicólogo Giovanni na UBS Jardim Colonial. Obs: evolução psicoterápica lenta.', 'Agendado ASM Dra. Rejane 09/06/2022', 14, 'FINALIZADO'),
	(2420, '2022-06-07', 'Sagrado Coração', 13, '1975-03-21', 'CAPS Adulto ', 8452, 'Giuliana Paula Sana', 'Está sendo atendida pelo Psicólogo Geovane Melo na UBS faz 03 semanas, apresentando melhora na crise inicial.', 'Agendado CAPS adulto', 14, 'FINALIZADO'),
	(2421, '2022-07-05', 'QII ASM ', 0, '1978-06-28', 'Sagrado Coração / QII ASM', 0, 'Gislaine Aparecida Vieira', 'Deseja tomar medicamento para ansiedade. Em psicoterapia quinzenal com Geovane no CAIC II', 'Avaliação com Dra Rejane dia 07-07 às 10:00.', 14, 'FINALIZADO'),
	(2422, '0000-00-00', 'Vargem', 13, '1974-07-29', 'CAPS Adulto ', 4816, 'Vitar Aparecida Becati Fernandes', 'Paciente portadora de TAB apresentando há mais ou menos 1 semana, agitação, agressividade, irritações, inventando fatos não ocorridos, com sono entrecortado. Em uso de: Depakene 250 mg 3cp pela manhã e 3 cp noite, veio a consulta acompanhada da filha que faz o relato do quadro porém a paciene nega, dizendo que esta apenas nervosa.', 'Será encaminhada para reavaliação no CAPS, está entrando em crise.', 13, 'FINALIZADO'),
	(2423, '2022-07-05', 'Sagrado Coração', 14, '2004-09-28', 'CAPSi/Q II ASM', 0, 'Jordão Feliciano', ' Em acompanhamento médico pediatrico em BH devido a cariotipo 46xy no qual foi solicitado acompanhamento para avaliação de hiperfagia e deficiencia intelectual e necessidade de controle de medicamento apresenta criptorquidia a esquerda, micropenis, dismorfismos, macrocrania e baixa estatura ainda sem diagnostico após 12 anos apresentou aumento do apetite e obesidade     ', 'Agendada avaliação psiquiátrica para dia 06-07 às 10:00 horas com Dra Rejane.', 13, 'FINALIZADO'),
	(2424, '2022-08-02', 'Vargem', 1458, '2005-02-17', 'CAPS i', 0, 'Ricardo Rocha Cabral de Andrade', 'Retorno para ajustar medicamento. Em uso de Ritalina 10 mg e Risperidona? Fluoxetina 20 mg.', 'Agendado ASM Dra. Rejane 03/08/2022', 13, 'FINALIZADO'),
	(2425, '2022-08-02', 'Vargem', 1485, '2007-01-11', 'CAPS i', 0, 'Sara das Graças Oliveira', 'Retorno após 2 meses com Dra. Rejane, mãe relata filha estar muito ansiosa com tremores, pânico, perdeu a avó recentemente, esta regredindo, urinando na cama.', 'Agendado ASM Dra. Rejane 03/08/2022 Evoluindo bem em Psicoterapia com Geovane toda segunda 14h', 13, 'FINALIZADO'),
	(2426, '2022-08-02', 'Vargem', 14176, '1981-12-28', 'CAPS Ad / CAPS adulto', 106, 'Keiliany Moreira Cardoso', 'Família pede consulta com Dra Rejane para pedir relatorio INSS e também rever medicações. Família relata ter tido epsódios de agitação e saiu escondido para beber. ', 'Agendado ASM Dra. Rejane 04/08/2022', 13, 'FINALIZADO'),
	(2427, '2022-08-02', 'Vargem', 13, '1984-09-06', 'CAPS Adulto ', 0, 'Fumiko Aparecida Miyake', 'Paciente com histórico de transtorno depressivo há 10 anos, já tendo feito uso de várias medicações, mas tem crises recorrentes de adinamia, choro, ansiedade, vontade de se isolar, dificuldade para trabalhar.', 'Manutenção ESF e acompanhamento psicológico ASM', 13, 'FINALIZADO'),
	(2428, '2022-08-02', 'CAPS Adulto', 0, '1945-11-08', 'Sagrado Coração', 12131, 'Maria Jose Luiz', 'Paciente com possíveis sintomas psicóticos associados a quadro clínico dermatológico, e atos repetitivos associado a quadro ansioso. Solicito avaliação da psiquiatria para possível prescrição, ou reavaliação da medicação. Paciente solicita acompanhamento psicológico. Faz uso das medicações: Quetiapina 25mg 0 0 1/  Sertralina 50mg 1 0 0/ Alprazolam 2mg 0 0 1.', 'Agendado ASM Dra. Rejane 04/08/2022 Agendada com Geovane para acolhimento', 13, 'FINALIZADO'),
	(2429, '2022-08-02', 'Sagrado Coração', 1444, '1986-04-27', 'CAPS Adulto ', 0, 'Aline Rodrigues de Miranda', 'Paciente em acompanhamento medico previo devido ao quadro depressivo,refere sensaçao de tristeza profunda e mania de perseguiçao. uso previo de quetiapina e sertralina ', 'Acolhimento CAPS adulto.', 13, 'FINALIZADO'),
