	(2431, '2022-08-30', 'Vargem', 1499, '2007-10-19', 'CAPS i', 0, 'Maria Eduarda Aparecida Paulino', 'Apresenta crises de ansiedade desde os 10 anos. Há 2 meses, está com perda de motivação, vontade de isolar-se e dormir pra não ter pensamentos ruins. Em uso de Sertralina. Já acompanha com psicólogo', 'Manutenção ESF', 13, 'FINALIZADO'),
	(2432, '2022-08-30', 'Vargem', 12135, '1988-07-20', 'CAPS Adulto ', 0, 'Alexander Rosa', 'Apresenta crises de panico, com sensaçao de dispneia, palpitações, sensaçao de constriçao na garganta, parestesias pelo corpo, em uso de fluoxetina 20mg e Turno 10mg', 'Reajuste medicação e manutenção ESF. Encaminhar psicologia ASM', 13, 'FINALIZADO'),
	(2433, '2022-08-30', 'CAPS Adulto ', 1057, '1964-01-10', 'Vargem', 1057, 'Vanda do Carmo Salgado Sales', 'Paciente tendo dificuldades no relacionamento familiar. Solicito encaminhamento para psicólogo. Estável com medicação. Em uso de: Fluoxetina 2x, Clonazepam 2x, Bipirideno 1x, Haldol decanoato 1 ampola 21/21 dias', 'Encaminhar psicologia ASM e avaliar necessidade de diminuir intervalo de injetável 14/14 dias', 13, 'FINALIZADO'),
	(2434, '2022-08-30', 'Vargem', 1128, '1970-07-28', 'CAPS Adulto ', 12128, 'Isabel Cristina Serafim', 'Paciente procurou ESF querendo receitas controladas, esta em acompanhamento com Dra Rejane e ainda não teve alta. Faz acompanhamento também com Lídia Psicóloga. Oriento aguardar o matriciamento. Diz que o marido esta responsável pelos medicamentos mas não esta dando corretamente para ela. Em uso de: Fluoxetina 20 mg 3-0-0,Nortripitilina 50 mg 0-0-2, Haldol 1 mg 0-0-2, Neozine 25 mg 0-0-1. F33.3', 'Manutenção CAPS adulto e aguardando ECG', 13, 'FINALIZADO'),
	(2435, '2022-08-30', 'Vargem', 1345, '1984-09-06', 'CAPS Adulto ', 0, 'Fumiko Aparecida Miyake', 'Paciente com histórico de transtorno depressivo há 10 anos, já tendo feito uso de várias medicações, mas tem crises recorrentes de adinamia, choro, ansiedade, vontade de se isolar, dificuldade para trabalhar. Em uso de: Duloxetina 30 mg, Bupropiona 150 mg e Clonazepam 0,5', 'Manutenção ESF e acompanhamento psicológico ASM', 13, 'FINALIZADO'),
	(2436, '2022-09-27', 'Sagrado Coraçao', 14, '2007-07-26', 'CAPS i', 0, 'Marcos Vinicius Medes de Morais', 'Refere acompanhamento previo com psiquiatra para investigaçao de TAB aos 5 anos, relata alteraçao de humor previo em uso de Imipramina 10 mg solicita atendimento para reavaliação de diagnostico', 'Encaminhado para psicologia ASM', 14, 'FINALIZADO'),
