	(2526, '2021-03-16', 'Novo Tempo', 178, '1973-11-19', 'Caps Adulto', 2307, 'Maria Claudia de Assis', 'Paciente comparece com a filha.Relata que tentou suicídio pela 2º vez. É muita ansiosa,alterando muito humor. Faz uso de: Rivotril 2mg prescrito 2 cp/dia mais chega a tomar até 4 cp/dia. Pressão oscilando. Faz acompanhamento com Dr Ricardo Frota que prescreveu um remédio para tomar cedo,mais deu sono a mesma parou . Conforme combinado com Enf Rodolfo, já que o médico não se sentiu a vontade para medicar a paciente, a paciente passou por consulta psiquiátrica e foi encaminhada para seguir tratamento médico no ESF em uso de: Fluoxetina 20mg 1-0-1, Halopéridol 1mg 1-0-0 e Diazepam 10mg 0-0-2. CID10 F41.2, F43.2, F48.9 e Z73.3', 'Manutenção medicação ESF e psicoterapia Lidia', 15, 'FINALIZADO'),
