	(2528, '2021-03-16', 'ASM', 191, '1979-02-17', 'CAPS Adulto', 7562, 'Tatiana Cristina de Andrade', 'Tratava no CAPS e com a Dra Vivian há muito tempo, até se aposentou por problemas psicólogicos, porém abandonou o tratamento naquela época, e agora deseja retornar. F42.9+F10.2+ F48.8+ F68.0+F61.0 (diagnósticos CAPS 2002 a 2008). F31.2 (Dra Vivian 2011)', 'Agendada 18/03 Manutenção psicoterapia Lidia', 15, 'FINALIZADO'),
	(2529, '2021-03-16', 'CAPS Adulto', 12132, '1984-01-11', 'Novo Tempo', 0, 'Ana Aparecida do Nascimento', 'Paciente passou por acolhimento e atendimento psiquiátrico no CAPS dia 08/03/2021. Precisa de atendimento psicológico, caso o psicólogo tenha disponibilidade para atendimento, entrar em contato com a paciente por gentileza, telefone: 98896-0691. Já usou Alprozalam e Clonazepam sem melhora. Tristeza, angústia, depressão.  Encaminhada F33.1+F48.9 Haloperidol 1mg 1-0-0, Venlafaxina 75 mg 2-0-0, Pregabalina 75mg 1-0-1, Alprozalam 2 mg 0-0-1', 'Manutenção medicação ESF e psicoterapia Lidia', 15, 'FINALIZADO'),
