	(2553, '2021-10-05', 'CAPS Adulto', 8225, '1985-05-03', 'Novo Tempo', 1789, 'Thiago Mariano de Souza', 'Passou em avaliação no dia 03/09/21, sendo prescrito: Biperideno 2 mg 2-0-1 Haloperidol 5mg(1-0-2) + Diazepam 10mg 1-0-2 Nortriptilina 25mg 3-0-3 Bromazepam 6mg 1-0-2 Clopixol depot. 3 ampolas 21/21 dias. Cid F20.3 + F19.2. Foi encaminhado nesse dia para a unidade. Mãe retornou ao serviço no dia 10/09/21, solicitando reavaliação porque as medicações estão fortes. Não foi possível passar com Dr. Anderson, estava atendendo uma emergência e o serviço iria fechar. Orientei a mãe aguardar o matriciamento para dar retorno. Uso de crack e abuso de analgésicos.', 'Manutenção ESF e reajuste da medicação', 15, 'FINALIZADO'),
	(2554, '2021-10-05', 'CAPS Adulto', 686, '1968-12-17', 'Novo Tempo', 201, 'Fatima Aparecida da Silva', 'Ver possibilidade de encaminhamento. Envolver os agentes de saúde. Levomepromazina 25 mg 0-0-1, Amitripitilina 25 mg 0-0-1, Decanoato de Haloperidol 3 ampolas. F20.3', 'Visita domiciliar ESF', 15, 'FINALIZADO'),
	(2555, '2021-10-05', 'CAPS Adulto', 8406, '1986-05-29', 'Novo Tempo', 201, 'Erick dos Santos', 'Ver possibilidade de encaminhamento. Envolver os agentes de saúde.Haloperidol 5 mg 0-0-11, Clonazepam 2 mg 0-0-1, Levomepromazina 25 mg 0-0-1, Haldol decanoato 2 ampolas 28/28 dias. F20.3', 'Visita domiciliar ESF', 15, 'FINALIZADO'),
	(2556, '2021-10-05', 'CAPS Adulto', 1337, '1966-05-17', 'Novo Tempo', 1200, 'Nilza Jacinta Matias', 'Com o intúito de que a paciente não fique sem antipsicótico, houve alteração da medicação. Fenobarbital 100mg 0-0-1, Clonazepam 2mg 0-0-1, Nortriptilina 25 mg 1-0-0 e Haloperidol 1mg 1-0-1. Usuária de substâncias, deficit cognitivo. F20.3+G40.3+F19.2+F78', 'Manutenção ESF', 15, 'FINALIZADO'),
	(2557, '2021-11-16', 'CAPS Adulto', 11806, '1981-03-21', 'Novo Tempo', 430, 'Micheli Menali de lima Bertoldo ', 'Clinico avaliar medicação F06.8 + F70.1+G40.3 (2019)', 'Agendado ASM 17/11/21 Dra.Rejane', 15, 'FINALIZADO'),
	(2558, '2021-11-16', 'CAPS Ad', 1475, '1995-11-21', 'Novo Tempo', 0, 'Vanessa Aparecida Pires', 'Acolhimento e avaliação psiquiátrica em 08/10/2021; abstinente há 07 meses; Em uso de: Sertalina 50 mg, Clonazepam 2 mg e Carbamazepina 400 mg.  Já esteve emCT Poço Fundo.', 'Manutenção ESF / Mudou-se para Machado', 15, 'FINALIZADO'),
	(2559, '2021-11-16', 'Novo Tempo', 845, '2000-04-30', 'CAPS adulto', 0, 'THAWANY DE CASSIA MARTINS GUIMARAES', 'Crise de Pânico, conflitos no trabalho,auto-mutilação, pensamentos ruins,alterações de humor. Em uso de Escitalopram 20 mg, Desvenlafaxina 50 mg e Clonazepam no caso de crise.', 'Manutenção ESF e reajuste da medicação se necessário', 15, 'FINALIZADO'),
	(2560, '2021-11-16', 'CAPS Adulto', 0, '1988-07-20', 'Novo Tempo', 557, 'Bruno Henrique de Oliveira', 'Sonolência com neosine, estresse, laudo INSS.', 'Agendado ASM Dra. Rejane 17/11/21', 15, 'FINALIZADO'),
	(2561, '2021-12-14', 'Caps Adulto', 8225, '1985-05-03', 'Novo Tempo', 0, 'Thiago Mariano de Souza', 'Paciente foi encaminhado pelo Dr. Anderson em 03/09/2021, porém, tia retornou ao Caps queixando que as medicações estavam fortes e devolveu algumas.Passou novamente em consulta dia 19/11/2021. Trocou o Clopixol pelo Haldol injetável por estar em falta, a medicação. Tia mantém fazendo confusão com as medicações do sobrinho, paciente é tranquilo, pode manter o tratamento na unidade. Avaliar necessidade de avaliação com Dra. Rejane, ajustar as medicações e manter com clínico. Cid F20.3, em uso de: Decanoato de Haloperidol-3 ampolas-21/21 dias + Biperideno 2mg(2-0-0) + Quetiapina 200mg(1-0-2) + Diazepam 10mg(0-0-2) + Nortriptilina 50mg(1-0-1) + Bromazepam 6mg(1-0-1) + Omeprazol 20mg(2-0-0). Segundo a tia, não dá a Quetiapina, o Haldol acha muito, necessita orientação quanto o tratamento. Possibilidade de atendiimento com Dra. Rejane. Dar retorno para Vera 988313902\n', 'Agendado Dra. Rejane 10/01/22 CAPS Adulto ', 15, 'FINALIZADO'),
	(2562, '2021-12-14', 'CAPS adulto', 12189, '1976-09-10', 'Novo Tempo', 735, 'Geovana de Fátima Rodrigues', 'Recente separação, afastada do trabalho pela Oncologia, apresentando medos e outros sintomas depressivos. Última prescrição no CAPS: desvenlafaxina50 (1.0.1), pregabalina 50 (1.0.1), lorazepam 2 (0.0.1) Solicito avaliação Dra. Rejane', 'Agendado Dra. Rejane 04/01/22 CAPS Adulto ', 15, 'FINALIZADO'),
	(2563, '2022-02-08', 'CAPS Adulto', 11806, '1981-03-21', 'Novo Tempo', 430, 'Michele Menali de Lima Bertoldo ', 'Caso colocado em matriciamento, após discussão com o psicólogo Roberto (CRAS), na tentativa de que a paciente seja submetida a uma avaliação psiquiátrica. Paciente não adere a nenhum tratamento.', '', 15, 'FINALIZADO'),
	(2564, '2022-02-08', 'CAPS Adulto', 11501, '1975-12-08', 'Barcelona', 7614, 'Helen Dutra Junqueira', 'Paciente passou em avaliação clínica no Caps, feito reajuste das medicações. Dra. Sara solicitou matriciar para avaliar a necessidade de passar com Dra. Rejane. Em uso de: Escitalopram 20mg(1-0-0) + Rivotril 2mg (0-0-1). Cid F33.2 + F48.8', 'Transferida para o próximo matriciamento', 9, 'FINALIZADO'),
	(2565, '2022-03-15', 'CAPS Adulto', 11501, '1975-12-08', 'Barcelona', 7614, 'Helen Dutra Junqueira', 'Paciente passou em avaliação clínica no CAPS, feito reajuste das medicações. Dra. Sara solicitou matriciar para avaliar a necessidade de passar com Dra. Rejane. Em uso de: Escitalopram 20mg(1-0-0) + Rivotril 2mg (0-0-1). Cid F33.2 + F48.8', 'Agendado ASM Dra. Rejane 17/03/2022', 9, 'FINALIZADO'),
	(2566, '2022-03-15', 'CAPS Adulto', 11806, '1981-03-21', 'Novo Tempo', 430, 'Michele Menali de Lima Bertoldo ', 'Realizada visita domiciliar a pedido do psicólogo Roberto (CRAS). Paciente em uso de Nortriptilina 25mg (1x dia) e Fenobarbital 100mg (1x dia), há um ano. Queixa-se de dores abdominais e edema nas extremidades do corpo. Sem queixas psiquiátricas e/ou psicológicas. Agendada consulta com o clínico da unidade dia 07/03/22. Colher impressão do clínico acerca da paciente.', 'Manutenção ESF', 15, 'FINALIZADO'),
	(2567, '2022-04-12', 'Novo Tempo', 1002, '2006-06-05', 'CAPS i / ASM', 0, 'Giovana Vieira Teodoro', 'TDM, depressão, alucinações auditivas, pensamentos suicidas, ideação suicida, auto-mutilação, vozes de comando. Em uso de: Escitalopram 10 mg e Risperidona 1 mg.', 'Manutenção ESF e psicologia ASM', 15, 'FINALIZADO'),
	(2568, '2022-05-10', 'Novo Tempo', 733, '1970-05-06', 'CAPS Adulto', 9482, 'Carmen Cecília Carloto', 'Paciente traz encaminhamento de contrarreferência do CAPS para manutenção de tratamento. Encaminhamento consta uso de: Fluoxetina 20mg (3-0-3) | Nortriptilina 50mg (0-0-1) | Clonazepam 2mg (0-0-3) | Clorpromazina 100mg (0-0-3) | Omeprazol. Relatou ter interrompido a nortriptilina. HD: F31.8 + F48.9 + F61.0 + F68.0', 'Agendado ASM Dra. Rejane 12/5/22, acolhimento da Psicologia (Geovane)', 15, 'FINALIZADO'),
	(2569, '2022-07-05', 'Novo Tempo', 1002, '2006-06-05', 'CAPS i / ASM', 0, 'Giovana Vieira Teodoro', 'TDM, depressão, alucinações auditivas, pensamentos suicidas, ideação suicida, auto-mutilação, vozes de comando. Fez uso de: Escitalopram 20 mg e Risperidona 1 mg, Quetiapina 25 mg, Desvenlafaxina 50 mg ', 'Não compareceu ao CAPS i. ESF entrará em contato com a família, caso necessário, CAPS i fará busca ativa. ', 15, 'FINALIZADO'),
