	(2794, '2021-03-23', 'CAPS Adulto/CAPS ad', 6114, '1976-04-19', 'Sion', 1005, 'Flávio Augusto Chagas', 'Relátório para passe livre, necessário renovar a cada 3 anos. F20.3 não aderiu tratamento CAPS ad ,dependencia de Artane.Faz uso de: Risperidona 2mg 001+Clonazepam 2mg 111+ Artane 5mg 100.', 'Agendado ASM 24/03 ', 16, 'FINALIZADO'),
