	(2796, '2021-06-15', 'CAPS Ad ', 2071, '1984-03-08', 'Sion', 2708, 'Elba Mara Montuani ', 'TTO irregular 2016/2017 CID 10: F 14.2 Encaminhada 31/03/2021 Retornou 2020/2021. Prescrito:Diazepam 10 mg 1 0 1, Fluoxetina 20 mg 1 0 1 ,Neozine 100 mg 1 0 1,Carbamazepina 200 mg 1 0 1 . Visita domi ciliar Dra Fernanda ,renovado a medicacão.  ', 'Manutenção medicação UBS', 16, 'FINALIZADO'),
	(2797, '2021-06-15', 'Policlínica Central/ CAPS Adulto', 11103, '1964-12-13', 'padre vitor', 0, 'Danilo Marques Branco', 'Psicóloga Danielle atende paciente semanalmente na Policlínica Central, solicita atendimento da Dra. Rejane para possível ajuste da medicação prescrita', 'ESF Padre Vitor', 16, 'FINALIZADO'),
	(2798, '2021-07-13', 'CAPS i', 1396, '2014-12-03', 'Sion', 7537, 'Ana Alice Dias', 'Passou, novamente, em acolhimento no CAPS i. Está em avaliação com neuropediatra e fila de espera para Endocrinologia infantil (obesidade) fora do município. Sem vaga Oasis, melhorou a fala/aprendizagem, aguardando ressonância magnetica com sedação, cariotipo, em fila de espera para fono no territorio.  Necessita de vínculo no territorio para acompanhamento durante avaliaçao diagnóstica.', 'Visita domiciliar Assistente Social Islene (Coordenação diagnostica e clínica) ', 16, 'FINALIZADO'),
	(2799, '2021-07-13', 'CAPS i', 1314, '2001-11-18', 'Sion/CAPS Adulto', 345, 'Gabriela Nobre Martins', 'Passou pelo CAPS i em 2018 e 2019. Encaminhada a UBS para psicoterapia. Avó ligou para o CAPS i buscando orientações para atendimento. Gabriela tem 19 anos atualmente e foi direcionada ao CAPS Adulto devido ao agravamento do quadro relatado pela avó. Prescrito Escitalopram 15 mg (10/2020)', 'Não compareceu ao CAPS Adulto, esteve com psicologo Anderson 2 x e não aderiu. Psicólogo Anderson entrará contato, rediscutir  s/n no próximo matriciamento.', 16, 'FINALIZADO'),
	(2800, '2021-07-13', 'CAPS Ad', 76, '1954-01-29', 'Sion', 0, 'Eduardo Luiz Cândido Ribeiro       paciente faleceu', 'O paciente e o filho compareceram em acolhimento pela última vez em 23/06/2021; paciente com discurso delirante; com agitação e insônia; dificuldade de deambular; elitista crônico, porém abstinente há 04 meses; foi entregue encaminhamento para acompanhamento clínico e neurológico.', 'Obito', 16, 'FINALIZADO'),
	(2801, '2021-07-13', 'Sion', 2346, '1982-05-01', 'CAPS Adulto / ASM', 2346, 'Talissa Fabiane de Lima Sodre ', 'Chorosa, deprimida ... Em uso de: Alprazolam 1mg 1/2 - 0 - 1 1/2 Topiramato 50 mg 0-0-1 Depakote 250 mg 1-0-2  Passou com Dra Rejane em Setembro 2020 necessita de reavaliação. ', 'Agendado ASM 14/07/2021', 16, 'FINALIZADO'),
	(2802, '2021-07-13', 'Sion ', 6312, '1982-12-28', 'CAPS Adulto / ASM', 0, 'Felipe Laurindo da Silva ', 'Está precisando de receita e de encaminhamento para que a UBS possa manter a medicação. Em uso de : Melleril 50 mg e Clonazepam 2 mg  ', 'Agendado ASM 15/07/2021', 16, 'FINALIZADO'),
	(2803, '2021-07-13', 'CAPS Adulto', 0, '1968-06-03', 'Sion', 972, 'Fernando Oliveira Carioca', 'Não absorvido para acompanhamento no CAPS Adulto, agendado com Clínico Geral para 19/07, solicito acompanhamento psicoterapêutico.', 'Avaliação clínica e psicoterapia.', 16, 'FINALIZADO'),
	(2804, '2021-08-10', 'CAPS Adulto ', 3522, '1971-01-31', 'Sion /florescer', 2865, 'Ricardo Oliveira Mendes ', 'Reavaliação da medicação. Em uso de Haldol decanoato 1 ampola IM mês ', 'Agendado ASM 11/08/21 Dra Rejane', 16, 'FINALIZADO'),
	(2805, '2021-08-10', 'Sion/florescer', 7950, '1960-03-09', 'CAPS ad', 0, 'Carlos Henrique Silva', 'Paciente refere uso de bebida alcoolica como fuga, refere estar disposto a parar.', 'Encaminhar CAPS ad', 16, 'FINALIZADO'),
	(2806, '2021-08-10', 'Sion/florescer', 2908, '1974-11-28', 'CAPS Adulto ', 1407, 'Arilda de Paula Antonio', 'paciente perdeu a consulta da dra Regiane no dia 22/07,refere nao te adaptado as medicações.continua com pensamentos negativos("so penso coisas ruins"),fico indisposta,agressiva,nao quer fazer nada,choro facil,sono nao reparador,refere dor em "juntas"sem melhora com tto clinico/Duloxetina?', 'Agendado ASM 11/08/21 Dra Rejane', 16, 'FINALIZADO'),
	(2807, '2021-09-14', 'Sion', 7935, '1985-09-05', 'CAPS Adulto', 0, 'Naiara Santos Cesario', 'Relato de déficit de atenção, perda de memória, estresse, depressão e ansiedade. CID 10 R466 Prescrito exames laboratoriais + Escitalopram 10 mg /dia ', 'Manutenção ESF', 16, 'FINALIZADO'),
	(2808, '2021-09-14', 'CAPS Ad', 562, '1959-04-03', 'Padre Vitor ', 0, 'Joao Batista da Cruz', 'Paciente e esposa compareceram ao serviço solicitando avaliação psiquiatrica por motivos periciais.Tem prontuario no CAPS Ad desde 2012. No momento não apresenta demanda para o CAPS Ad. Encontra-se em acompanhamento neurologico ambulatorial . Apresenta degeneração do sistema nervoso com demencia associada devido uso abusivo  de B.Alcoolica. Faz uso regular de: Diazepam 10mg e Gardenal 100mg.', 'Transferido para o próximo matriciamento Padre  Vitor ', 16, 'FINALIZADO'),
	(2809, '2021-09-14', 'Sion', 53, '1959-12-29', 'CAPS Adulto', 1434, 'Alzira da Silva', 'Acompanhante deseja laudo para atestar condição psiquiátrica. F72', 'Agendado ASM 15/09/21 ', 16, 'FINALIZADO'),
	(2810, '2021-09-14', 'CAPSi', 0, '2016-03-11', 'Sion/ASM', 668, 'Samuel Nogueira Moreira', 'Necessita de consulta com Dra. Rejane, TDAH Em uso de: Ritalina 10 mg e Risperidona 1 mg ', 'VD Assistente Social Islene e agendado ASM 15/09/21 ', 16, 'FINALIZADO'),
	(2811, '2021-09-14', 'CAPS i', 1396, '2014-12-03', 'Sion', 7537, 'Ana Alice Dias', 'Retorno Islene: Fiz Várias tentativas junto à Oasis para atendimento com fonoaudiólogo e precisa aguardar na fila de espera. Estabeleci contato com Fono do quadrante que informa que está atendendo os casos de risco de vida. Existem 23 crianças na frente de Ana com o mesmo problema e precisa aguardar fila de espera. Sobre o endocrino pediatra, fiz contato com a SEMUS (Ellen) para me informar sobre o que foi proposto por Dra. Rejane Fundação Rocha Braga e fui informada que vai avaliar a situação. Informo que fiquei por 7 meses no setor de TFD na SEMUS e na época já existia uma fila de espera de anos atrás para endocrinopediatra sem sucesso. Documentei tudo e deixei na mão do chefe de regulação e na mão do Secretário Dr. Armando essa demanda reprimida para reavaliar as pactuações via TFD.', 'Aguardar pactuação', 16, 'FINALIZADO'),
	(2812, '2021-09-14', 'Sion', 6762, '1992-01-18', 'CAPS Adulto', 0, 'Keila Iolanda dos Santos Chagas', 'Refere ansiedade. Deseja retornar tratamento especializado. CID10 F41.1 Obesidade Em uso de : Venlafaxina 75 mg/dia aumentar s/ necessário', 'Manutenção ESF, Psicoterápia e nutricionista ', 16, 'FINALIZADO'),
	(2813, '2021-10-19', 'Sion', 2105, '1987-02-21', 'CAPS Adulto', 0, 'Nilza de Nazare Vitoriano', 'Esquizofrenia com refratariedade ao medicamento. F20 em uso de  Quetiapina 25 mg e Haldol 1 mg', 'Agendado ASM Dra. Rejane 20/10/21', 16, 'FINALIZADO'),
	(2814, '2021-10-19', 'CAPS Adulto', 0, '1955-03-23', 'Sion', 0, 'Paulo Martins de Oliveira', 'Paciente residindo na casa da irmã para tratamento. Receita psiquiatra (Jesuânia) Em uso de alprazolan 2mg (01cp de 12/12h). Lamitor - 01cp noite. Paciente apresentado agressividade aos familiares.', 'Agendada consulta Dr. Anderson CAPS Adulto 20/10/21', 16, 'FINALIZADO'),
	(2815, '2021-11-23', 'Sion', 7935, '1985-09-05', 'CAPS Adulto', 0, 'Naiara Santos Cesario', 'Paciente demonstra insatisfação com o corpo mesmo apresentando um peso adequado para a sua estatura. Segue com receio em comer por medo de engordar. Relata que passou mal por falta de alimentação adequada, porém não conseguia comer mesmo estando ciente da necessidade. Segue bastante ansiosa e depressiva. Relata baixa ingestão hídrica. Não está mais praticando atividade física. Relata não ter iniciado acompanhamento psicológico até o momento. Escitalopram 10 mg /dia. Refere que não adaptou a medicação; Sem clínico na unidade até data indefinida. Em uso de Escitalopram 10 mg não se adaptou a medicação.', 'Agendado ASM Dra. Rejane 24/11/21', 16, 'FINALIZADO'),
	(2816, '2021-11-23', 'Sion', 910, '1960-07-15', 'CAPS Adulto', 510, 'Maria Helena Ongaro', 'Bromazepam suspenso em 10/03/21 (Dra. Lidiege). Paciente continua fazendo uso. Manter Haldol, Akineton, Bromazepam todos 2 por dia', 'Reajuste medicação e manutenção UBS', 16, 'FINALIZADO'),
	(2817, '2021-11-23', 'CAPS Adulto', 0, '1963-01-12', 'Sion', 2372, 'Gildete Conceição Souza', 'Paciente com sintomas de ansiedade. Relata que o UBS Sion está sem clínico.', 'Agendado ASM Dra. Rejane 24/11/21', 16, 'FINALIZADO'),
	(2818, '2021-12-21', 'CAPS Adulto', 12149, '1960-04-15', 'Sion', 2287, 'Vanice Antônia Pressato', 'Ver se Dra. Rejane pode atendê-la. F20.3 em uso de Clonazepam, viciada em Tramadol (UBS e CAPS II não está fornecendoTramadol), paciente alega que é o unico analgésico que tira a dor.', 'Agendado ASM Dra.Rejane 22/12/21.', 16, 'FINALIZADO'),
	(2819, '2021-12-21', 'Sion', 2105, '1987-02-21', 'CAPS ADULTO', 0, 'Nilza de Nazaré Vitoriano', 'Diagnóstico de esquizofrenia e transtorno do pânico. Relata agitação e insônia com uso de neozine. Dra. Sarah solicita avaliação e conduta. Em uso de Haloperidol 1 mg 2 x, Quetiapina 25 mg 1x e Neosine 25 mg. CID 10 F20.3', 'Agendado ASM Dra. Rejane 23/12/21.', 16, 'FINALIZADO'),
	(2820, '2022-02-15', 'Sion', 628, '1966-03-24', 'CAPS Adulto', 0, 'Gerusa Venâncio Fátima Amâncio', 'Crises de ansiedade recorrentes. Em uso de Clorpromazina , Escitalopram  e Diazepam', ' Manutenção UBS', 16, 'FINALIZADO'),
	(2821, '2022-02-15', 'Sion', 3010, '1988-06-18', 'CAPS Adulto', 1519, 'Camila Aparecida de Lima', 'Paciente com queixa de que foi intoxicada (SIC). Agitada, Ansiosa e com queixas desconexas', 'Busca ativa e manutenção CAPS Adulto', 16, 'FINALIZADO'),
	(2822, '2022-02-15', 'Sion', 910, '1960-07-15', 'CAPS Adulto', 510, 'Maria Helena Ongaro', 'Dr. Júlio solicita avaliaçãoe  conduta (esquizofrenia?). Em uso de  Haldol, Bipirideno, Bromazepam todos 2 por dia. Confusão mental, agitação, tremores.', 'Agendado ASM Dra. Rejane 17/02/2022', 16, 'FINALIZADO'),
	(2823, '2022-03-22', 'Sion', 0, '1962-12-29', 'CAPS Adulto', 11742, 'Maria Aparecida de Souza Cazelato', 'Fraqueza, agitada, ansiedade, não consegue dormir. Em uso de: Duloxetina 60 mg 2-0-0, Bupropiona 150 mg 1-1-0 ,Topiramato 50 mg , Sulpirida 50 mg 1-0-1, Alprazolam 2 mg 0-0-2. F33.2+ F48.8+F61.0', 'Agendado ASM Dra. Rejane 24/03/2022 e acolhimento psicologia', 16, 'FINALIZADO'),
	(2824, '2022-03-22', 'CAPS Adulto', 1083, '1963-04-23', 'Sion', 166, 'Maria José Pinto da Silva', 'Quedas, crises convulsivas, discurso desconexo/delirante, piora após falecimento do irmão em 26/01. Em uso de: Haldol 5 mg 2-0-0, Clorpromazina 100 mg0-0-2, Carbonato de litio 300 mg 0-0-3, Clonazepam 2 mg 0-0-3. Solicito avaliação Dra. Rejane', 'Agendado ASM Dra. Rejane 24/03/2022', 16, 'FINALIZADO'),
	(2825, '2022-03-22', 'CAPS Adulto', 9888, '1962-11-28', 'Sion', 7627, 'Lucilene Martins', 'Paciente portadora de HIV, faz acompanhamento na Policlinica Central, Em uso de: Haldol 1mg - 0 0 1, Bromazepan 3 mg - 1 0 1, a nove anos. Emagrecimento importante (37 kig) e apreseta tremores. Infectologista não quis manter a prescrição  e pediu uma avaliação psiquiatra.', 'Agendado ASM Dra. Rejane 24/03/2022', 16, 'FINALIZADO'),
	(2826, '2022-03-22', 'CAPS Adulto', 7399, '1984-06-15', 'Sion', 3079, '', 'Usuário muito agitado, falando e transpirando excessivamente. Em uso de: Olanzapina 10 mg , Sertralina 100 mg 1-0-0, Depakote 250 mg 2-0-2, Rivotril 2 mg 1-1-1. F20.3. Solicito avalição clínica Dra Rejane.', 'Agendado ASM Dra. Rejane 24/03/2022', 16, 'FINALIZADO'),
	(2827, '2022-03-22', 'CAPS Adulto', 3459, '1995-01-31', 'Sion', 283, 'Stefanie Aparecida de Souza', 'Apresentando sintomas de ansiedade _ precordialgia, dispnéia. Foi prescrito Citalopram o Clomipramina. Passou em consulta no ASM Dra. Rejane 21/03/2022.', 'Manutenção ESF', 16, 'FINALIZADO'),
	(2828, '2022-03-22', 'CAPS Adulto', 0, '1987-04-19', 'Sion', 7958, 'Diego Xavier Leite', 'Dores generalizadas', 'Encaminhado para reumatologia.', 16, 'FINALIZADO'),
	(2829, '2022-03-22', 'Sion', 2222, '1943-01-05', 'CAPS Adulto', 230, 'Alaide dos Santos Nascente', 'Uso irregular de medicação, Gardenal 100 mg 2x ao dia.', 'Agendado ASM  Dra. Rejane 23/03/2022', 16, 'FINALIZADO'),
	(2830, '2022-04-19', 'CAPS Ad', 2722, '1988-07-28', 'Sion', 0, 'Juliano de Jesus', 'Usuário alcoolista recusou tratamento no CAPS Ad. Encaminhado para a rede básica por apresentar dores na coluna.', 'Manutenção ESF', 16, 'FINALIZADO'),
	(2831, '2022-05-17', 'CAPS Ad', 3215, '1973-01-15', 'Sion', 1797, 'Paulo Sérgio Ribeiro', 'Abstinente há cerca de 08 meses; Em uso de: Risperidona 4 mg (1-0-1) e Clorpromazina 25 mg (0-0-1). Encaminhamento ao ESF para manutenção medicamentosa.', 'Manutenção ESF', 16, 'FINALIZADO'),
	(2832, '2022-05-17', 'Sion', 2346, '1955-05-08', 'Sion  ', 2346, 'Evaldo Labre ', 'Passou por cirurgia cardiaca há 6 meses, aumento de pressão , deprimido. Vai passar por outro procedimento cardiaco provavelmente  Solicita consulta Psiquiatra para alterar a medicação em uso de: Fluoxetina 20 mg e Alprazolam 0,50 mg. ', 'Agendado ASM Dra. Rejane 19/05/2022', 16, 'FINALIZADO'),
	(2833, '2022-05-17', 'Sion', 3010, '2007-12-07', 'CAPS i', 130, 'Felipe Lima Maximiniano', 'Mãe queixa agressividade  /irritabilidade / quadro social a discutir', 'Aguardando avaliação CREAS', 16, 'FINALIZADO'),
	(2834, '2022-05-17', 'Sion', 3010, '1988-06-18', 'CAPS adulto', 1519, 'Camila Aparecida de Lima', 'Mãe Felipe Lima Maximiniano HD: F 33.1+ F06.2 + F 70.1. Venlafaxina 75 (2.0.2), Clonazepam (0.0.2)', 'Manutenção CAPS', 16, 'FINALIZADO'),
	(2835, '2022-05-17', 'Sion', 2346, '1999-09-01', 'CAPSi/CAPS Ad', 2768, 'Marcel Henrique Labre de Oliveira ', 'Abstinente SPA , estava morando no Rio e voltou para Varginha, Fez uso de : Fluoxetina 20mg 2x dia / Depakote 250mg 2 x dia / Alprazolam 2 mg 1 à noite. Está ansioso por esta abstinente. Passou com clinico 13/05/2022 que receitou Fluoxetina 20mg 2cp pede avaliação do psiquiatra  ', 'Agendado ASM Dra. Rejane dia 19/05/2022', 16, 'FINALIZADO'),
	(2836, '2022-06-14', ' CAPS i', 1478, '2006-08-24', 'Sion', 7567, 'Lara Ricardo Bau ', 'Paciente em uso de Escitalopram 5mg. Não retornou ao CAPSi. Lara terá retorno com o clínico no ESF para avaliação clínica. Discutir condução do caso.', 'Em uso de escitalopram 5mg. Está agendado avaliacão com a clínica na UBS. Se usuário entrar em crise, encaminhar ao CAPS i.', 16, 'FINALIZADO'),
	(2837, '2022-06-14', 'Sion', 6318, '2005-12-28', 'CAPS i', 0, 'Yasmim Silveira', '16 anos, refere crises de choro constantes com sentimento de tristeza associado e aumento de apetite. Mora com a avó, pais separados. Avó refere que a paciente fica a maior parte do tempo no quarto então conversa muito. Já fez uso de medicação (não sabe relatar o nome) com 14 anos, prescrito por psiquiatra particular.', 'Encaminhar para psicoterapia e associar o uso de fluoxetina 20mg.', 16, 'FINALIZADO'),
	(2838, '2022-06-14', 'Sion', 6441, '1963-05-08', 'CAPS Adulto ', 0, 'Edna Maria de Melo Fernandes', 'Paciente com 58 anos em uso de Duloxetina 60 mg/60cp Clonazepam 2mg/60cp há 3 anos, após descobrir traição do esposo. Deseja acompanhamento psiquiátrico para trocar ou diminuir a medicação.', 'Encaminhar à psicoterapia. Agendado consulta ASM dia 15/06, às 10h.', 16, 'FINALIZADO'),
	(2839, '2022-06-14', 'Sion', 683, '1994-04-20', 'CAPS Adulto ', 12170, 'Maxuel Salgado', 'Deseja acompanhamento psiquiátrico, refere abandono de etilismo, mas se encontra com crises de ansiedade. Em 2019, foi encaminhado ao CAPS Adulto, prescrito Escitalopram 10mg, após fez uso de Nortriptilina 25mg e depois Fluoxetina 20mg.', 'F 20?? Agendado ASM dia 15/06/22, às 10h.', 16, 'FINALIZADO'),
	(2840, '2022-06-14', 'Sion', 1324, '1955-03-20', 'CAPS Adulto ', 0, 'Neusa Maria da Silva Francisco', '67 anos, Em uso de Rivotril 2mg, Desvenla 50 mg, neurologista que medicou, porém ainda está com muito choro, insônia mesmo com medicações. Cuida dos pais, casamento de aparência (SIC).', 'Sugere ajuste e troca de medicacão. Aumentar dose de desvenlafaxina. Trocar/ associar clonazepan por amitriptilina ou bromazepam.', 16, 'FINALIZADO'),
	(2841, '2022-06-14', 'Sion', 2346, '2003-12-04', 'CAPS Adulto', 0, 'Kedman Vitoriano Mendonça', 'Deseja passar com psiquiatra, desde os 14 anos em uso devido ansiedade, depressão, síndrome do pânico. Asin com sintomas principalmente a tarde e a noite, tristeza, sensação de vazio e insonia. Diminuição de apetite, história de estupro pelo irmão do padastro. Frequente ideação suicida, com cortes com gilete em braço, barriga e perna. Fluoxetina 20mg (1-0-1)', 'Encaminhar à psicologia. Agendado ASM dia 15/06/22, às 8:30h.', 16, 'FINALIZADO'),
	(2842, '2022-06-14', 'CAPS i', 0, '1993-04-02', 'ASM / Florescer', 7731, 'Millena Pereira Penha da Silva', 'Millena é mãe do Raphael Augusto da Silva Soares, em acolhimento estendido no CAPSi. Necessário conversar sobre Millena que relata estar em uso de Fluoxetina, através da ESF, porém apresentando crises de ansiedade, sendo atendida na UPA durante suas crises há alguns meses.', 'Procurar ESF para avaliacão clínica e psicoterapia.', 16, 'FINALIZADO'),
	(2843, '2022-06-14', 'Sion', 0, '0000-00-00', '', 0, 'Meire De Oliveira', 'Sentimento constante de tristeza, dificuldade de se relacionar, choro facil, angustia. Associa à morte do pai há 1 ano e do marido. Refere que filha já tentou suicídio e sofre com perda do pai e avô. Deseja passar por consulta psiquiátrica', '', 16, 'FINALIZADO'),
	(2844, '2022-06-14', 'CREAS', 0, '0000-00-00', '', 0, 'Maria Conceição Rodrigues', 'Caso passado pelo CREAS. Atendimento realizado com a sobrinha Elenice Rodrigues. Disse que Maria mora sozinha, solteira e sem filhos. Tem insuficiência renal e problemas cardíacos. Se recusou a fazer cateterismo por medo de complicações na cirurgia. Hoje está na Upa porque uma vizinha encontrou muito fraca e acionou o serviço. Só se alimenta com miojo. Não gosta de gastar o seu dinheiro para guardar no banco. Elenice vai sempre ajudar. Maria tem condições financeira mas não aceita pagar uma pessoa para ficar com ela. CREAS que passou o caso. Mantém a casa sempre trancada, mania de perseguição, agressiva, confusão mental, esquecimentos frequentes, fala sozinha. Na sua casa tem uma pá e um facão embaixo do travesseiro. Ameaçou a equipe do Creas quando realizaram Vd. Fiz visita e a mesma não abriu a porta para mim. Sobrinha quer muito continuar ajudando, mas está difícil. Creas sugeriu avaliação psiquiátrica. ', 'Caps vai contatar Creas para saber mais do caso.', 16, 'FINALIZADO'),
	(2845, '2022-07-12', 'Sion', 3248, '1978-08-19', 'CAPS Ad ', 595, 'Ricardo de Oliveira', 'Há 1 ano realizou tratamento no CAPS Ad, mas recaiu com drogas e álcool, teve convulsões necessitando de internação. Veio em consulta referindo querer voltar com tratamento. Em uso de Quetiapina 25mg (1-0-1), Diazepam 10mg (1-0-1), Fenitoína 100mg (1-1-1) e Tiamina 100mg.', 'Encaminhar para acolhimento CAPS Ad', 16, 'FINALIZADO'),
	(2846, '2022-07-12', 'Sion', 6158, '2002-08-23', 'CAPS Adulto ', 0, 'Livia Maria do Carmo Azevedo', 'Paciente com automutilação em mama, refere problemas familiares em casa, pelo fato que não vai à igreja com os pais. Em uso de fluoxetina 20mg (1-0-0). Relatou pequena melhora dos sintomas.', 'Encaminhada a psicoterapia.', 16, 'FINALIZADO'),
	(2847, '2022-07-12', 'Sion', 7868, '1989-05-21', 'CAPS Adulto ', 12166, 'Janaina Fernandes da Silva ', 'Refere fazer uso de: Depakene 500mg (1-0-1), Quetiapina 200mg (0-0-1), Amitriptilina 25mg (0-0-2), Sertralina 50mg (2-0-0), há 2 meses por psiquiatra de SP. Relata que há 1 ano passou no CAPS. É casada, refere ter filho de 13 anos, inconstância no relacionamento com esposa. Refere diagnóstico de bipolaridade. Queixa-se insônia.', 'Agendado ASM 14/07/2022.', 16, 'FINALIZADO'),
	(2848, '2022-07-12', 'Sion ', 6031, '1990-05-29', 'CAPS Adulto ', 11089, 'Kleber Turola Almeida da Silva', 'Paciente de 32 anos, refere ter envolvido com maconha, e medo constantante dos traficantes, associado a alucinações com vulto branco no quarto. Relata que não cumpriu uma promessa e Deus cobra ele até hoje. Refere que foi avisado da pandemia antes de acontecer. Já ficou internado em Três Pontas. Em uso de Biperideno 3mg/120 cp. CID F20.0', 'Manutencão CAPS Adulto. ', 16, 'FINALIZADO'),
	(2849, '2022-07-12', 'Sion ', 4167, '1962-05-20', 'CAPS Adulto ', 11296, 'Sebastião Aluisio Agostinho', 'Paciente em uso de: Clonazepam 2mg 60 cp e Risperidona 3mg 60 cp. Interrompeu uso de Escitalopram 10 mg.. Já passou no CAPS. Queixa insônia. HD: S.Pânico/ Esquizofrenia/ Depressão (2015) F 25.1', '  Agendado ASM 14/07/2022.', 16, 'FINALIZADO'),
	(2850, '2022-07-12', 'Sion ', 7942, '2004-10-18', 'CAPS Adulto ', 0, 'Priscila Julio Caetano', 'Paciente chorou durante toda a consulta, avó refere que está fora da escola há 2 anos, está sob a guarda do pai, mas avó materna que está cuidando. Sugerido Fluoxetina 20mg', 'Manutencão ESF. Encaminhamento a psicoterapia.', 16, 'FINALIZADO'),
	(2851, '2022-08-09', 'Sion', 2346, '2003-12-04', 'CAPS Adulto', 0, 'Kedman Vitoriano Mendonça', 'Paciente está sem psicologo do alto risco, dormindo durante o dia e ficando acordada a noite. Alteração do humor desde ultima consulta no mês de Julho, triste com a gravidez... Solicita retorno e psicologo.  OBS: Paciente e do Sion, como dra Sara já estava acompanhando vai se manter com a mesma até o final da gestação.', 'Agendado ASM Dra. Rejane 11/08/2022 e acolhimento psicológico ASM', 16, 'FINALIZADO'),
	(2852, '2022-08-09', 'Sion', 1122, '1978-05-24', 'CAPS Adulto ', 0, 'Edney José Borges', 'Diagnóstico de retardo mental CID10 F10, em uso de: Gardenal 100 mg 1-0-2, Carbamazepina 200 mg 2-0-2, Haldol 1 mg 1-0-2. A mãe refere que Haldol está ofertando apenas 2 à noite. Solicito voltar com dosagem correta do Haldol 1 mg e prescrevo Clonazepam 2 mg.', 'Manutenção UBS', 16, 'FINALIZADO'),
	(2853, '2022-08-09', 'Sion', 2086, '1970-02-18', 'CAPS Adulto ', 0, ' Reinaldo Donizete de Souza', 'Portador de déficit cognitivo. Primo cuidador refere que o mesmo está sem medicação e necessita renovar. Precisa de laudo com diagnóstico da patologia para questões jurídicas referente à renda. Renovo Neozine 40 mg/ml 20gts. Paciente é proveniente do bairro Padre Vitor, agora sendo do Sion.', 'Agendado ASM Dra. Rejane 11/08/2022', 16, 'FINALIZADO'),
	(2854, '2022-08-09', 'Sion', 1269, '1959-10-11', 'CAPS Adulto ', 9811, 'Maria Aparecida de Oliveira Paulino', 'Diagnosticada em 2020 pelo CAPS com depressão recorrente (CID 10 F33.3), em uso de: Venlafaxina 150 mg 1-0-1, Sulpirida 50 mg 1-0-1, Lorazepam 1 mg 0-0-1. Deseja consulta psiquiátrica para adequação de medicação, mas relata estar se sentindo bem.', 'Agendado ASM Dra. Rejane 11/08/2022', 16, 'FINALIZADO'),
	(2855, '2022-08-09', 'CAPS i / CAPS adulto', 0, '1974-11-28', 'Sion ', 2908, 'Arilda de Paiva Antonio', 'Caso discutido em reunião de rede intersetorial, visando possibilidade de nova tentativa de agendamento com a Psiquiatria e Psicologia. ', 'Agendado ASM Dra. Rejane 11/08/2022 e psicologia ASM', 16, 'FINALIZADO'),
	(2856, '2022-08-09', 'ASM / QIII AS / CREAS', 0, '0000-00-00', 'ASM / Florescer', 0, 'Maria Conceição Rodrigues', 'Retorno A. Social: Atendimento realizado com a sobrinha Elenice em 23/06 83 anos. Relata que na última internação a tia fugiu do hospital. Agressiva, solteira e sem filhos. Resistente aos cuidados das sobrinhas.Mania de perseguição, guarda um facão em baixo do travesseiro. Vi que após o ocorrido a médica da familia encaminhou para neurologista. Sugiro avaliação psiquiatra, para nova tentativa de melhoria nos cuidados da idosa pelas sobrinhas. ', 'Transferido para o próximo matriciamento', 16, 'FINALIZADO'),
	(2857, '2022-08-09', 'ASM / QIII AS / CREAS', 3010, '2007-12-07', 'CAPS i / ASM', 130, 'Felipe Lima Maximiniano', 'Islene: Filho da Camila Aparecida de Lima. Foi discutido o caso dele na reunião de rede do CRAS e CREAS. Ele está no Serviço de convivência do CRAS (grupo) e apresenta comportamento estranho: desafiador, imaturo, não responde a regras. Já fez uso de haldol. Questões familiares vulneráveis. CRAS Pede avaliação psiquiátrica.', 'Transferido para o próximo matriciamento', 16, 'FINALIZADO'),
	(2858, '2022-09-06', 'ASM / QIII AS / CREAS', 3010, '2007-12-07', 'CAPS i / ASM', 130, 'Felipe Lima Maximiniano', 'Islene: Filho da Camila Aparecida de Lima. Foi discutido o caso dele na reunião de rede do CRAS e CREAS. Ele está no Serviço de convivência do CRAS (grupo) e apresenta comportamento estranho: desafiador, imaturo, não responde a regras. Já fez uso de haldol. Questões familiares vulneráveis. CRAS Pede avaliação psiquiátrica.', 'Aguardando reunião da rede com Conselho Tutelar', 16, 'FINALIZADO'),
	(2859, '2022-09-06', 'CAPS Adulto', 0, '1978-01-31', 'Sion ', 2484, 'Luciana Aparecida B. Chagas ', 'Paciente compareceu ao acolhimento com queixas depressivas, relata estar em uso de sertralina há poucos dias. Encaminhei para atendimento psicólogico e clinico no ESF, para dar contituidade ao tratamento médico iniciado na UPA. Em uso de: Sertralina 50 mg', 'Manutenção UBS e psicologia ASM', 16, 'FINALIZADO'),
	(2860, '2022-09-06', 'CREAS', 0, '1994-08-16', 'Sion / CAPS adulto', 2040, 'Amanda Rodrigues de Souza', 'Creas entrou em contato pedindo atendimento e avaliação psicológica para essa usuária. Motivo: Vítima de abuso e violência doméstica. (Islene)', ' Agendado ASM Dra. Rejane 08/09/2022 e encaminhada para psicologia UNIFENAS ', 16, 'FINALIZADO'),
	(2861, '2022-09-06', 'CAPS Adulto', 2851, '1982-10-15', 'Sion ', 4250, 'Alexandre de Paula Abdo', 'Paciente não está encontrando Tioridazina 50 mg. Pede substituição da medicação. Haldol 5 mg 2 x ,Nortripitilina 25mg 2 x, Bipirideno 3x, Clonazepam 2 mg 3x Tioridazina 450 mg ao dia', 'Reajuste medicação UBS e manutenção', 16, 'FINALIZADO'),
	(2862, '2022-09-06', 'CAPS Adulto', 0, '2000-06-14', 'Sion ', 1800, 'Lauryn Felício de Souza', 'Compareceu ao CAPS com encaminhamento da UPA, HD: TAG. Está em acompanhamento psicológico particular, com indicação de introdução de medicação. Solicito avaliação Dra. Rejane', 'Avaliação clínica UBS', 16, 'FINALIZADO'),
