	(2864, '2022-09-06', 'CAPS Adulto', 734, '1968-02-22', 'Sion', 1365, 'Roberto de Souza', 'Familiar compareceu solicitando mudança dos medicamentos, relata que o paciente não está bem clinicamente e por este motivo o médico da ESFS recusou fornecer receita para os medicamentos do paciente. Solicito ajuste dos medicamentos na ESF ou no ASM. F06.2+ F70.1 em uso de: Tioridazina 100 mg 1-0-2 e Clonazepam 2 mg 0-0-1', 'Reajuste medicação e manutenção UBS', 16, 'FINALIZADO'),
