	(2866, '2022-09-06', 'CAPS Adulto ', 0, '1958-10-23', 'Sion', 0, 'Antonio Clarêncio da Silva', 'CRAS I estabeleceu contato comigo solicitando laudo médico psiquiátrico para nova perícia no INSS, visto que o primeiro pedido foi indeferido. Situação de muita vulnerabilidade social . Farei VD. (Islene)', 'Visita domiciliar assistente social ASM', 16, 'FINALIZADO'),
