	(2869, '2022-10-04', 'CAPS Adulto', 11741, '1966-03-01', '1592', 3067, 'Aglais Cândida Quintino', 'Paciente com HD: F20.30, com o uso de Biperideno 2mg 0-1-0, Fenobarbital 100mg 0-1-0 e Sulpirida 300mg 0-1-0 desde 08/2020. Encaminhada para ESF desde 02/2021. Paciente com seguintes sintomas: perda da fala, de alguns movimentos, e sensação de lerdeza temporária, médico da UPA acredita que seja a medicação. Paciente solicita exames, e possível reavaliação psiquiátrica para revisão da medicação.', '', 16, 'FINALIZADO'),
	(2870, '2022-11-01', 'Sion', 7567, '1979-03-08', 'CAPS Adulto', 9359, 'Eliane Rosa Ricardo Silva', 'Insônia, não come,crises de choro ,parou clorpromazina 25 mg ( 3 cps/dia) para trabalhar. Em uso de: Fluoxetina 20 mg (2 cps/dia ),Diazepam 10 mg (2cps/dia) ou Clonazepam 2 mg ( 1 1/2 ) dia Haldol 1mg..Luto não elaborado.', 'Aguardar retorno ESF para reavaliar a medicacão prescrita.', 16, 'FINALIZADO'),
