	(3024, '2020-09-15', 'CAPSi', 0, '2014-10-03', 'Santana', 2800, 'Adrian Yuri Silva Pereira', 'Adrian tem diagnóstico de autismo, não está em crise, apenas com comportamento agitado, compatível com seu quadro. É paciente do dr Lucas desde os dois anos e quer apenas avaliação para troca de medicação. Com a ausência do neuropediatra, a mãe foi a outro neurologista que mudou a medicação, ela quer uma mudança nessa medicação que, segundo ela, não deu certo. Retornará ao dr Lucas assim que ele tiver retornado. excitalopram e doguibatil 20 gotas a noite', 'Agendado ASM 17/09', 18, 'FINALIZADO'),
	(3025, '2020-09-15', 'CAPS Adulto', 4594, '1977-07-09', 'Santana ', 46, 'Denise Moreira Leite', 'Mãe comparece chorando muito, relata que pr não está bem, está em crise novamente. Não aceita vir ao CAPS, acha que a mãe tem condições de pagar um médico particular. Sugiro tentar medicar no ESF visto que o vínculo da mesma com o ESF é melhor do que com o CAPS. Ressalto que não pode entregar receita ou medicação na mão da paciente pois a mesma joga fora.', 'Agendado ASM 17/09', 18, 'FINALIZADO'),
