	(3074, '2021-09-14', 'Santana ', 3402, '1971-07-27', 'CAPS Adulto', 2248, 'Ione Aparecida Lopes Baroni ', 'Avaliação. F41.2 + F78 + F61.0 Precrito: Haloperidol 1mg 2x , Diazepam 10 mg 1x , Fluoxetina 20 mg 1x Estável sem medicação', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3075, '2021-09-14', 'Santana', 1528, '1997-06-22', 'CAPS Adulto', 12000, 'Maria Clara Nogueira Sampaio', 'Avaliação. F31.8 + F48.9+ F60.3 Em uso de: Nortripitilina 50 mg 1x , Depakene 250 mg 2 0 2, Levomepromazina 100 mg 1x  está sedada e quer fazer concurso', 'Agendado ASM 16/09/21 ', 18, 'FINALIZADO'),
	(3076, '2021-09-14', 'Santana', 753, '1954-12-26', 'CAPS Adulto', 0, 'Roberto Gomes de Lima', 'Avaliação. Bordelaine? Dificil manejo.  Em uso de: Zolpidem 10 mg e Clonazepam 2mg, Fluoxetina 20 mg . ', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3077, '2021-09-14', 'Santana', 721, '2003-02-28', 'CAPS Adulto', 0, 'Marinho Rafael Otavio', 'Avaliação. Mãe faleceu de Covid , fez TTO de TDAH , quer usar Ritalina.  Em uso de: Fluoxetina 20 mg e Clorpromazina 25mg.', 'Manutenção UBS Tentativa terapeutica com Ritalina 10 mg 60 comprimidos ', 18, 'FINALIZADO'),
	(3078, '2021-09-14', 'Santana', 1438, '1963-05-09', 'CAPS Adulto', 2372, 'Alexandrina Batista de Arruda Pedrosa', 'Avaliação. Explossiva, ex marido morando com a filha teve AVC, morando com irmão e cuidando dos netos. ', 'Agendado ASM 16/09/21', 18, 'FINALIZADO'),
	(3079, '2021-09-14', 'Santana', 2088, '1988-06-18', 'CAPS Adulto', 1519, 'Camila Aparecida Lima', 'Retorno Islene: VD realizada em 13/09. Camila é casada com Guilherme e tem uma filha Ester de 7 anos e um bebê Luiz Guilherme Lima data nasc: 31/08/21. Devido ao quadro de depressão (sic) os sogros que estão cuidando do bebê junto com Guilherme. Camila tem um tio que assumiu os cuidados de pai dela (Alaor) que também dá o suporte para ela quando precisa. Camila relata ter sido paciente do Caps Adulto por muito tempo. Fazendo uso de Paroxetina 20 mg e Diazepam 10mg. Observado por mim que os avós  e o pai cuidam bem da criança e tem muito afeto. Afirmam que não deixam o bebê com Camila porque ela está muito fraca. Disseram que ela nunca causou dano para criança. Observei também Camila muito chorosa, triste, prostrada e se sente culpada pelas decisões do passado. Sugiro avaliação psiquiátrica devido ao quadro atual. (Também é um desejo dela). Relata estar com muita hemorragia e dores abdominais.Telefone do sogro Luiz Antonio 98821 1545', 'Agendado ASM 16/09/21 e acompanhamento social.', 18, 'FINALIZADO'),
	(3080, '2021-09-14', 'Santana', 901, '1959-07-27', 'CAPS Adulto e ASM', 4016, 'Lucia Rosa Couto Belineli ', 'Retorno Islene: 1ª vd realizada: encaminhada para consulta na UBS para novo laudo INSS, avaliação para otorrino. Fiz contato com advogado e requerimento INSS foi indeferido. 2ª vd. Lucia disse que deixou o pedido de otorrino na UBS e aguarda. Levou o laudo para o advogado. Disse que precisa de oftalmo. Não usa aparelho auditivo. Encaminhada para Envelhecer ', 'Manutenção UBS e acompanhamento AS', 18, 'FINALIZADO'),
	(3081, '2021-09-14', 'Santana', 48, '1974-09-23', 'CAPS  Ad', 3130, 'Roberto Expedito Benvinda', 'Retorno Islene. Vd e atendimetos realizados. Orientado por 2 x retornar o tramento no CAPS. A irmã disse que ele não está fazendo uso de álcool, mas deprimido. Também ofereci o serviço do ASM para o irmão Tadeu Luiz que reside ao lado', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3082, '2021-09-14', 'CAPS  Ad', 3166, '1966-05-15', 'Santana', 1898, 'Luzia Aparecida Pimenta', 'Retorno Islene: Atendimento ralizado. Afirma estar bem e que o CRAS acompanha. Deseja atendimento somente do CRAS. Teve alta psicoterapia ASM.', 'Manutenção CRAS', 18, 'FINALIZADO'),
	(3083, '2021-09-14', 'Santana', 3118, '2001-08-29', 'CAPS i ', 318, 'Isabela Helena Rodrigues', 'Quadro depressivo sem resposta terapêutica, Usou Litio 300mg e Escitalopram 10mg , teve no CAPSi 2019 e  TAE 2019 com remedios. Tricotolofagia , movimentos esteiotipados , não quer usar medicações , ganho de peso 20 kg em 2020. Prescrito Quetiapina 25 mg e lamotrigina 50 mg ', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3084, '2021-10-19', 'CAPS Adulto ', 8151, '1942-07-08', 'Santana', 109, 'Antônio Vitor Pinto', 'Discutir o caso no matriciamento (Liliani). Em uso de Quetiapina 25 mg e Clonazepam 2 mg.', 'Acompanhamento Psicológico e Assistente Social ASM', 18, 'FINALIZADO'),
	(3085, '2021-10-19', 'Santana ', 224, '1992-12-05', 'CAPS Adulto', 0, 'Elaine Cirilo', 'Idéias de morte, depressão.', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3086, '2021-10-19', 'Santana', 407, '1984-09-09', 'CAPS Adulto', 6302, 'MARLON MARCOS DA SILVA', 'Retorno A.S:Realizado atendimento com Mariela para verificar as condições familiares. Disse que compareceu em consulta com clínico geral para informar que a medicação do irmão Marlon não estava surtindo efeito. Ele estava agressivo sendo que a polícia militar compareceu na casa dela devido ao comportamento do irmão. Ele tinha essas crises na frente das crianças (sobrinha e filho Antônio de 11 anos). Foi trocada medicação e a usuária afirma que feito isso Marlon ficou muito calmo e a convivência familiar melhorou muito. Ele fica em um quarto, mas tem acesso a todos os espaços da casa. A mãe cuida dele. Disse que Marlon sai para ir à missa e não coloca em nenhum momento as crianças em risco. Sobre a mãe de Antônio ela não tem vínculo com o filho e não paga pensão alimentícia. Mariela disse que qualquer alteração no comportamento do irmão que possa causar dano à família ela mesma procura a UBS. Ela vai se casar e continuar morando nessa mesma casa com os pais. A irmã afirma que não há no momento nenhuma situação de risco que envolva as crianças ou outros membros da familia. Em uso de Clozapina 25 mg.', 'Manutenção ESF', 18, 'FINALIZADO'),
	(3087, '2021-10-19', 'Santana', 732, '1974-05-11', 'CAPS Adulto', 1683, 'F20.3 em uso de Carbamazepina 200 mg 2-0-2, Clorpromazina 100 mg 2-0-2, Clonazepam 2 mg 1-0-1,Sulpirida 200 mg 2-0-2', 'F20.3 em uso de Carbamazepina 300 mg 2-0-2, Clorpromazina 100 mg 2-0-2, Clonazepam,Sulpirida 200 mg 2-0-2', 'Agendado ASM Dra. Rejane 21/10/21', 18, 'FINALIZADO'),
	(3088, '2021-11-23', 'CAPS Adulto', 8100, '1957-01-19', 'Santana', 745, 'Maria de Lourdes Tavares Verginio Silva', 'F31.7 reavaliar medicação.', 'Consulta clínico UBS', 18, 'FINALIZADO'),
	(3089, '2021-11-23', 'Santana', 1294, '1981-10-18', 'CAPS Adulto', 0, 'Tatiana Cristina da Silva Costa', 'F31. Prescrito Rispiridona, Carbomazepina e Rivotril (pouca aderência a medicação).Tabagista. Avaliação', 'Agendado ASM Dra. Rejane 25/11/21 e atendimento Assistente Social ASM 25/11/21', 18, 'FINALIZADO'),
	(3090, '2021-11-23', 'CAPS Adulto', 0, '1972-09-22', 'Santana', 2818, 'Lucivani Helena da Silva', 'Crises nervosas, irritabiliadade, auto e hetero agressividade, estressores familiares atuais e pregressos. Em uso de Fluoxetina e Clonazepam, não tem aderência a medicação. Solicito acompanhamento psicológico.', 'Agendado ASM Dra. Rejane 25/11/21', 18, 'FINALIZADO'),
	(3091, '2021-12-21', 'CAPS Adulto', 0, '1990-09-21', 'Santana', 122, 'Jéssica Turola Silva Aguiar', 'Compareceu ao CAPS encaminhada pelo NAMI. Estava em acompanhamento para depressão, fazendo uso de Limbitrol, interrompeu a medicação quando descobriu gestação. Pergunta qual medicação antidepressiva pode fazer uso. Esteve na UBS em 2018.', 'Agendado ASM Dra. Rejane 22/12/21', 18, 'FINALIZADO'),
	(3092, '2021-12-21', 'CAPS Adulto', 0, '1985-04-05', 'Santana', 4050, 'Kim Vítor Pedro Moreira de Andrade Carlos', 'Estava em acompanhamento psiquiátrico e psicológico no interior de São Paulo, recentemente voltou a residir em Varginha, solicita continuidade do atendimento psicológico. Afirmou não fazer uso de medicação.', 'Atendimento psicológico ASM', 18, 'FINALIZADO'),
	(3093, '2021-12-21', 'CAPS Ad', 966, '1951-11-23', 'Santana', 1003, 'Gil Flora de Aguiar', 'Compareceu em acolhimento em 13/12/2021 no CAPS Ad, após encaminhamento do ESF. Foi proposta PD, mas em 16/12/2021, paciente negou que gostaria de realizar tratamento relativo ao uso abusivo de álcool. Tem prontuário no CAPS AD desde 2013, frequentou  o serviço algumas vezes até 2015. Depressivo, problemas familiares. Em uso de Sertralina 50 mg 1-0-1', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3094, '2021-12-21', 'CAPS Adulto', 0, '1941-06-08', 'Santana', 121, 'Maria dos Anjos de Souza', 'Apresentou quadro de desidratação após episódios diarréicos e recusa alimentar. Foi encaminhada pela Upa para tratar depressão. Histórico de depressão há 6 anos. Perda recente do filho mais velho. Medicamentos em uso: Depakene 250mg (1,1,1,). Citalopram (1,0,0), Puran 25mg (1,0,0), Losartana 50mg (1,0,0), AAS (0,1,0), Carvedilol 3,125 mg(1,0,1), Clortalidona 12,5 (1,0,0). Vit. D. Sugiro avaliação psiquiátrica. Histórico de uso de alcool', 'Agendado ASM Dra. Rejane 22/12/21', 18, 'FINALIZADO'),
	(3095, '2022-02-15', 'Santana', 1871, '2003-07-17', 'CAPS i', 0, 'Maria Carla Garcia Oliveira Silva', 'Já fez acompanhamento psicossocial no CAPSi e psicoterapia UNIFENAS (2015). Há um ano teve auto-mutilação, insuficiência de vitamina K, alteração de comportamento,TAE. Em uso de Escitalopram. ', 'Atendimento psicológico ASM e aguardar.', 18, 'FINALIZADO'),
	(3096, '2022-02-15', 'Santana', 1600, '1985-02-25', 'CAPS Adulto', 0, 'Silvania Aparecida Maia Vilela', 'Em uso de Fluoxetina e Alprazolam. Transtorno de ansiedade/pânico.', 'Agendado ASM Dra. Rejane 16/02/2022', 18, 'FINALIZADO'),
	(3097, '2022-02-15', 'Santana', 1294, '1981-10-18', 'CAPS Adulto', 0, 'Tatiana Cristina da Silva Costa', 'Não compareceu a consulta com Dra. Rejane e avaliação com AS em 25/11/21. Chorosa, desempregada. Em uso de Carbamazepina e Rivotril.', 'Agendado ASM Dra. Rejane 16/02/2022', 18, 'FINALIZADO'),
	(3098, '2022-02-15', 'Santana', 1815, '1990-06-06', 'CAPS Adulto', 0, 'Barbara Castro Belasco', 'Fez transplante de fígado, hepatite auto-imune, quer diminuir ou retirar medicação. Foi atendida na rede partircular na época do transplante. TOC, ansiedade, interação social complicada. Em uso de Sertralina 50 mg.', 'Agendado ASM Dra. Rejane 17/02/2022 ', 18, 'FINALIZADO'),
	(3099, '2022-03-22', 'Santana', 883, '1972-12-21', 'CAPS AD ', 744, 'Emerson Rodrigues Chagas', 'Em uso de: Fenobarbital. Esteve em situação de rua, em acompanhamento CAPS Ad, difícil manejo.', 'Manutenção CAPS ad', 18, 'FINALIZADO'),
	(3100, '2022-03-22', 'Santana', 1866, '1996-01-30', 'CAPS Adulto', 10748, 'Elismara de Souza Ferreira', 'Última vinda ao CAPS 05/2021, esteve em permanência dia, histórico de uso de drogas ilícitas e três internações em Três Pontas. Atualmente agitada, agressiva, conflitos familiares. Mãe resistente ao tratamento medicamentoso da paciente. F20.3+F19.1. Feito receita Olanzapina 5 mg.', 'Visita domiciliar CAPS Adulto', 18, 'FINALIZADO'),
	(3101, '2022-03-22', 'Santana', 224, '1992-12-05', 'CAPS Adulto', 0, 'Elaine Cirino', 'Depressão, somatização,TAE. Encaminhada Dr Henrique ', 'Agendado ASM Dra. Rejane 23/03/2022', 18, 'FINALIZADO'),
	(3102, '2022-03-22', 'CAPS Adulto', 7062, '1957-02-19', 'Santana', 1275, 'Maria José Alves', 'Sem resposta à medicação prescrita em janeiro, solicito reavaliação Dra. Rejane.', 'Agendado ASM Dra. Rejane 24/03/2022', 18, 'FINALIZADO'),
	(3103, '2022-03-22', 'CAPS Adulto', 0, '1999-07-01', 'Santana', 0, 'Pedro de Alcântara dos Santos S. Júnior', 'Foi paciente do CAPS i (pront. 294) até 2019, recentemente apresentando crises de ansiedade, indisposição, prostração, preocupado que a depressão retorne tão intensa quanto antes', 'Agendado ASM Dra. Rejane 24/03/2022', 18, 'FINALIZADO'),
	(3104, '2022-03-22', 'Santana', 1727, '1957-12-10', 'CAPS Adulto', 4263, 'Maria Donizeti Rangel Souto', 'Apresentando Tto prévio S. Panico ,com sintomas ,sem Tto no momento. Esteve com Dra. Leticia, prescrito Escitalopram 10 mg. Em uso de: Sulpirida 25 mg e Clonazepam 2 mg 2x por dia.', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3105, '2022-03-22', 'CAPS Adulto', 0, '1978-01-18', 'Santana', 1343, 'Márcio Marcus Adonai Oliveira', 'Usuário estável, sem quiexas. Mãe vê necessidade de avaliação psquiátrica, pois faz tempo que não passa em consulta. Trouxe encaminhamento da UBS. Matricio para discutir o caso. F25. Em uso de: Risperidona 2 mg', 'Manutenção UBS', 18, 'FINALIZADO'),
	(3106, '2022-03-22', 'Santana', 732, '1974-05-11', 'CAPS Adulto', 1683, 'Fabiano Dominguito Domingueti', 'Esquizofrenia, mãe faleceu, alucinações, uso de drogas e alcool, agitado.', 'Observar e manutenção UBS', 18, 'FINALIZADO'),
	(3107, '2022-03-22', 'Santana', 801, '1996-08-19', 'CAPS Adulto', 0, 'Matheus Rodrigues Ferreira Amorim', 'Depressão. Psiquiatra na rede particular.', 'Manutenção UBS e acolhimento psicologia ASM', 18, 'FINALIZADO'),
	(3108, '2022-03-22', 'Santana', 1871, '2003-07-17', 'CAPS i', 0, 'Maria Carla Garcia Oliveira Silva', '"ideação"-CAPSI-Ambiente familiar conflituoso-auto-mutilação/auto-exterminio.', 'Manutenção UBS e acolhimento psicologia ASM', 18, 'FINALIZADO'),
