	(3110, '2022-03-22', 'CAPS Adulto', 11746, '1989-11-22', 'Santana', 261, 'Ana Claudia Batista Carvalho Silva', 'Complicacóes, conflitos, fim de relacionamento, problemas no trabalho. ', 'Avaliação clínico UBS', 18, 'FINALIZADO'),
	(3111, '2022-03-22', 'Santana', 1592, '1975-08-21', 'CAPS Adulto', 10877, 'Alessandra Braga Figueiredo', 'Depressão. ', 'Agendado ASM Dra. Rejane 24/03/2022', 18, 'FINALIZADO'),
	(3112, '2022-04-19', 'CAPS Adulto', 10748, '1996-01-30', 'Santana', 1866, 'Elismara de Souza Ferreira', 'Retorno de visita domiciliar realizada pelo Caps Adulto, conforme combinado em matriciamento anterior. Paciente em casa prostrada, depressiva, higiene precária, não sai de casa, sem uso de medicações. Mãe resistente ao CAPS Adulto.', 'Agendado ASM Dra. Rejane 20/04/2022', 18, 'FINALIZADO'),
	(3113, '2022-04-19', 'CAPS Adulto', 11074, '1981-03-02', 'Santana', 0, 'Andréa Mambeli Vazi', 'Sua filha é acompanhada no CAPS i. Em visita domiciliar junto com a equipe do CAPS i constatamos que a paciente precisa de uma avaliação psiquiátrica. Já foi paciente Dra Rejane (particular), quando foi prescrito Clozapina 25 mg. No momento sem condições financeiras.', '.Agendado ASM Dra. Rejane 20/04/2022.           UBS Canaã 5476', 18, 'FINALIZADO'),
	(3114, '2022-04-19', 'CAPS Adulto', 0, '2002-04-11', 'Santana', 1888, 'Lucas Pressato Ramos', 'Portador de deficiência visual importante. Relata crises de pânico e TOC, mais calado, fica no quarto jogando video game. Nunca passou por avaliação psiquiátrica e não faz uso de medicação. Peço avaliação Dra. Rejane.', '.Agendado ASM Dra. Rejane 20/04/2022.', 18, 'FINALIZADO'),
	(3115, '2022-04-19', 'CAPS Adulto', 4376, '1951-02-01', 'Santana', 0, 'Sandra Conceição Mambeli Vazzi', 'Faz acompanhamento consultório partircular Dra. Rejane. em uso de : Haldol 5 mg 1-1-0, Bipirideno 2 mg 1-1-0, Lorazepan 2 mg 0-0-1, Neozine 10 gotas, Flunarizina. Queixa moleza no corpo, fica mais deitada. Querendo transferir tratamento para UBS, dificuldade financeira no momento. Maior desestrutura no momento, devido a crise da filha Andrea. Dra. Rejane (partircular) forneceu receita para 1 ano.', 'Manutenção UBS Canaã 5476', 18, 'FINALIZADO'),
	(3116, '2022-05-17', 'CAPS Adulto', 11334, '1953-03-26', 'Santana ', 0, 'Adelson Egideo de Faria ', 'Acumulador , busca ativa e apoio assitencia social e dengue', 'Islene fará visita domiciliar. Agendado ASM Dra. Rejane para 19/05/2022', 18, 'FINALIZADO'),
	(3117, '2022-05-17', 'CAPS Adulto', 11057, '1955-08-17', 'Santana', 2946, 'Luiz Antonio Penha', 'Deseja reiniciar tratamento psiquiátrico. Última consulta no CAPS Adulto em 20/04/2018, quando foi prescrito: Rivotril 2mg (0.0.1) e Risperidona 2mg (1/2.0.1/2). Solicita reavaliação psiquiátrica. HD: F10.7. Insuficiência renal crônica, faz hemodiálise', 'Será agendado avaliação clínica', 18, 'FINALIZADO'),
	(3118, '2022-06-14', 'CAPS Adulto', 0, '1979-12-30', 'Santana', 2154, 'Ana Paula Gonçalves Melo', 'Passou em avaliação no CAPS Ad dia 02/06/2022 com Dra. Raphaella ( Clínica).Em uso de Bromazepam 6mg(3-0-3) + Amitriptilina 25mg(1-0-3) + Venlafaxina 75mg(1-0-0), ajustado e feito receita para 2 meses. Indicado psicoterapia e agendado clínico dia 21/07/2022. Alega que tem diagnóstico de Transtorno Bipolar e " Depressão profunda. "', 'Manutencào ESF', 18, 'FINALIZADO'),
	(3119, '2022-06-14', 'CAPS Adulto', 11334, '1953-03-26', 'Santana', 0, 'Adelson Egideo de Faria ', 'Retorno de visita domiciliar Islene: Relata ser aposentado e morar em casa própria com a irmã Adilse Adalise Lopes. Fez cirurgia cardíaca e faz uso de medicamentos. Relata que é paciente da Dra. Rejane psiquiatra particular e toma fluoxetina e clomipramina. Na casa na parte exterior havia muito acúmulo de lixo. Ele passa o dia cuidando desses objetos. O carro da família fica na rua porque não tem espaço na garagem. Não aceita ajuda para limpar e não permitiu que eu acionasse a vigilância sanitária. Orientei sobre ele procurar alguma atividade na Associação dos Aposentados que goste para participar. Adelson disse que vai tirar um pouco dos objetos da casa. Deseja continuar o tratamento psiquiátrico particular. ', 'Manutencào ESF e acompanhamento clínico', 18, 'FINALIZADO'),
	(3120, '2022-06-14', 'CAPSi', 0, '0000-00-00', 'ASM / UBS', 0, 'Thainá Maria da Cruz', 'Mãe da Ana Beatriz Cruz de Souza, criança atendida no CAPSi. Importante conversar sobre tratamentos de Thainá na UBS - clínico e psicólogo - e atuais demandas.', 'Reencaminhada para psicologia. Avaliacão com clínico.', 18, 'FINALIZADO'),
	(3121, '2022-06-14', 'CAPS Adulto', 1685, '1966-06-27', 'Santana', 2626, 'Hilton de Oliveira Tavares', 'Paciente estava internado em uma clínica de reabilitação há 6 meses. Compareceu ao CAPS para retomar o tratamento. Encontra-se estável, será encaminhado para seguir o tratamento no ESF. Em uso de : Clonazepam 2mg 2 cp / noite, Amplictil 100 mg 2cp / noite, Biperideno 2 mg 1cp / dia, Tiamina 300 mg + complexo B 1mg. No dia 08/06/22 foi administrada 1 Ampola de Haldol Decanoato (haldol decanoato de 21 em 21 dias).', 'F 20, F 19. Manutencao UBS. Atualmente está internado na clinica start em Eloi Mendes', 18, 'FINALIZADO'),
	(3122, '2022-06-14', 'Santana ', 1552, '1971-04-19', 'CAPS Adulto', 70, 'Regina dos Santos', ' Médico solicita ajuste de medicacào, paciente apresentando-se chorosa, angustiada.', '', 18, 'FINALIZADO'),
	(3123, '2022-06-14', 'Santana ', 597, '1987-03-30', 'CAPS Adulto', 0, 'Thais Carloto', 'Histórico de Sidrome do Desfiladeiro Toracico, Sindorme Dolorosa Complexa Regional com Distrofia Simpático reflexa cursando com sintomas grave. Sintomas depressivos importantes, com pouca melhora com o uso de antidepressivos, benzodiazepinicos e outros psicotrópicos. tentativa de auto extermínio há 1 semana', 'Encaminhada a psicoterapia pelo clínico da UBS. Orienta-se ajuste de medicações, se necessário, encaminhar ao CAPS.', 18, 'FINALIZADO'),
