	(3291, '2021-10-19', 'CAPS Ad', 562, '1959-04-03', ' Padre Vitor/ Sion', 3040, 'Joao Batista da Cruz', 'Paciente e esposa compareceram ao serviço solicitando avaliação psiquiatrica por motivos periciais.Tem prontuario no CAPS Ad desde 2012. No momento não apresenta demanda para o CAPS Ad. Encontra-se em acompanhamento neurologico ambulatorial . Apresenta degeneração do sistema nervoso com demencia associada devido uso abusivo  de B.Alcoolica.Faz uso regular de Diazepam 10mg e Gardenal 100mg.', 'Agendado ASM Dra. Rejane 20/10/21', 19, 'FINALIZADO'),
	(3292, '2021-10-19', 'CAPS i', 0, '2007-12-10', 'Padre Vitor', 50, 'Giovanna da Silva Oliveira', 'Passou em acolhimento e foi encaminhada a pedido da família para avaliação psicológica no território.', 'ASM psicologia', 19, 'FINALIZADO'),
