	(3297, '2021-10-19', 'Padre Vitor ', 0, '2008-04-11', 'CAPS i', 0, 'Milena Batiston Venceslau', 'Retorno A.S: Vd realizada. Avaliação social e articulação com rede de serviços. Houve um engano da família quanto ao primeiro agendamento feito e foram em outro local. Encaminhei novamente a genitora para levar a filha ao CAPS i. Em uso de Escitalopram 10 mg', 'Aguardar comparecimento no CAPS i', 19, 'FINALIZADO'),
	(3298, '2021-10-19', 'CAPS Adulto', 7457, '1975-04-05', 'Padre Vitor', 13515, 'Marcelo de Paula', 'Ver posibilidade de acompanhamento clínico. F20.3  em uso de Clopixol 3 ampolas e Haldol 3 ampolas de 28/28 dias', 'Avaliaçao clinica domiciliar', 19, 'FINALIZADO'),
	(3299, '2021-10-19', 'Padre Vitor ', 133126, '1987-04-13', 'CAPS Adulto', 0, 'Vania Maria de Souza', 'Em acompanhamento psicológico. Alteração motora, relato de alucinações auditivas. ', 'Agendado ASM Dra. Rejane 21/10/21', 19, 'FINALIZADO'),
	(3300, '2021-11-23', 'CAPS Adulto ', 0, '1990-06-11', 'Padre Vitor ', 0, 'Renata Oliveira Souza', 'Solicito acompanhamentro psicológico da paciente, está passando por momentos delicados em sua vida pessoal. Está em acompanhamento médico com Dra Marcela, no ESF. Foi fornecido atestado médico para que a paciente estabilize de seus sintomas e compareça ao CREAS. Está grávida (1 mês) não está aceitando a gravidez, encaminhada para auto-risco. ', 'Manutenção psicologia ASM', 19, 'FINALIZADO'),
	(3301, '2021-11-23', 'CAPS Adulto ', 2796, '1970-07-19', 'Padre Vitor', 0, 'Maria Elisa Silva Fonseca', 'Paciente compareceu ao acolhimento solicitanto ajuste de medicação. Relata ter tido alergia aos medicamentos: Nortriptilina, Venlafaxina e Escitalopram. Fluoxetina a deixou muito inapetente. Dorme somente fazendo uso de Clonazepam. Solicito ajustes dos medicamentos no ESF pois a paciente não apresenta perfil  para atendimento no CAPS no momento. Grata. (tel. 988245425) Agente de saúde Alessandra.', 'Agendado ASM Dra. Rejane 25/11/21', 19, 'FINALIZADO'),
	(3302, '2021-11-23', 'Padre Vitor ', 0, '1975-04-05', 'CAPS Ad ', 0, 'Marcelo de Paula ', 'Feito vd pelo ESF , mãe não deixou chegar perto do paciente ,e disse que ele não precisa fazer exames ', 'Manutenção CAPS adulto', 19, 'FINALIZADO'),
	(3303, '2021-11-23', 'Padre Vitor ', 13370, '2008-04-11', 'CAPS i', 0, 'Milena Batiston Wenceslaw ', 'ACS relata que paciente não tem dinheiro para ir no CAPS i , que não vai no Anderson no santana pois não gosta de ir em homem e que não esta bem psicologicamente , continua se cortando ', 'Busca ativa CAPS i', 19, 'FINALIZADO'),
	(3304, '2021-11-23', 'Padre Vitor ', 134121, '1997-07-22', 'CAPS Adulto', 10218, 'Leandro Paulo Reis Bertoldo ', 'CRAS fez VD, avó quer saber se consegue internar ele. Não aceita tratamento , teve convulsões , foi na UPA. Uso abusivo de drogas ilícitas.', 'Acolhimento CAPS ad', 19, 'FINALIZADO'),
	(3305, '2021-12-21', 'CAPS i', 0, '2008-04-11', 'Padre Vitor', 13370, 'Milena Batiston Venceslau', 'Retorno do atendimento domiciliar realizado. Comportamento triste, conflitos com a mãe.', 'Atendimento psicológico ESF', 19, 'FINALIZADO'),
