	(3317, '2022-06-14', 'CAPS Adulto', 0, '1956-09-19', 'Padre Vitor', 0, 'Anesio Adão', 'Paciente fica " pronunciando palavras incompreeensiveis o tempo todo e segundo familiares o mesmo tem ficado muito agitado durante à noite. Não está mais em uso de Depakene e Rivotril', 'Passar no acolhimento no Caps.', 19, 'FINALIZADO'),
	(3318, '2022-06-14', 'CAPS Adulto', 9667, '1979-01-14', 'Padre Vitor', 3503, 'Alexandra Valeriano', 'Paciente com sintomas depressivos. Obter retorno da paciente com Dr. Alexandre. Saber se a medicação prescrita por ele está fazendo o efeito desejado, se houve melhora do quadro. Em uso de: Fluoxetina 20mg (2 cp 2x dia) e Clonazepam (2 gts 1x dia). Saber se foi ao acolhimento psicológico (psic. Anderson).', 'Manutenção ESF e acompanhamento psicologico ', 19, 'FINALIZADO'),
