	(3320, '2022-06-14', 'Padre Vitor', 3503, '1979-01-14', 'CAPS Adulto', 9667, 'Alexandra Valeriano', 'Paciente portadora de Transtorno Depressivo/Ansiedade. Estava em uso de: Fluoxetina 40 mg ao dia. Relata que " já idealizou autoexterminio mas não o tempo todo " -sic. Foi encaminhada ao CAPS por está unidade para acolhimento onde foi atendida pela psicologa e mantido tratamento até discussão no matriciamento. Recentemente fiz a troca do Fluoxetina pelo Sertralina 50 mg (tolrest). Faz uso do Rivotril gts a noite.  ', 'Encaminhar a psicologia. Manter sertralina.', 19, 'FINALIZADO'),
	(3321, '2022-07-12', 'Padre Vitor ', 0, '1970-06-18', 'CAPS Adulto ', 0, 'Maria Doroteia Damasceno', 'Quer voltar no psiquiatra ?', 'Agendado ASM 13/07, às 8h. Encaminhar a psicoterapia.', 19, 'FINALIZADO'),
	(3322, '2022-07-12', 'Padre Vitor ', 0, '2000-12-15', 'CAPS Adulto ', 0, 'João Pedro Castro Soares', 'Transtorno de Ansiedade. Está em uso de Sertralina 50 mg mas sem melhora. Relata " ter déficit de atenção"  quando " passou por outros profissionais" - Deseja fazer tratamento. ', 'Agendado ASM 14/07 Orienta-se avaliacào psicológica.', 19, 'FINALIZADO'),
	(3323, '2022-07-12', 'Padre Vitor ', 3028, '1985-02-11', 'CAPS Adulto ', 5546, 'Leandro Caśsio Vilela Sebastião', 'Mãe relata que o mesmo tem ficado "nervoso" constantemente. Está em uso regular de Haldol 05 mg MID + Biperideno 02 mg MID. Deseja trocar a medicação - sic. ', 'Agendado ASM em 13/7/22; às 8h.', 19, 'FINALIZADO'),
	(3324, '2022-07-12', 'CAPS Adulto', 12293, '1956-09-19', 'Padre Vitor', 0, 'Anésio Adão', 'Alteracão de comportamento. Prescrito haldol 2mg à noite. Orienta-se solicitar TC crânio e encaminhar a neuro.', '', 19, 'FINALIZADO'),
	(3325, '2022-08-09', 'CREAS', 0, '2000-08-18', 'ASM', 132107, 'Sarah Serafim Vitor ', 'Islene: Tem 3 filhos que foram abrigados e no momento estão com avó materna; uso abusivo de drogas; tem mais um filho que nasceu este ano que está com avó paterna. CREAS acompanha o caso e disse que fez Vd com a  Liliane do CAPS. CREAS pede avaliação visto que a usuária se encontra muito abalada emocionalmente pelo afastamento dos filhos. 98709-2134. CAPS realizou nova visita domiciliar com o CRAS.', 'Acompanhamento psicológico e social', 19, 'FINALIZADO'),
