	(3331, '2022-12-06', 'Padre vitor', 0, '1969-11-01', 'CAPS', 3162, 'João Luiz da Silva ', 'Paciente, novo na cidade, fazia acompanhamento do Transtorno Mental em Campos Gerais - Atualmente em uso de  Risperidona 2 mg | Clorpromazina, Cloridrato 100 mg  - Estava em uso do Biperideno mas não está em uso - Faz acompanhamento e tratamento também para Hipotireodismo e Hipertensão. Familiares \nrelatam que o mesmo fica " muito agitado" \nSolicito avaliação quanto às medicações atuais. ', '', 19, 'FINALIZADO'),
