	(3512, '2020-06-23', 'Santa Mônica', 1799, '1967-01-11', 'CAPS Adulto ', 1543, 'João Paulo da Silva', 'Está com a PA muito baixa, precisa de reavaliação médica no ESF para rever o uso de Atenolol ', 'Equipe não pode participar da reunião, transferir para o próximo matriciamento.', 0, 'FINALIZADO'),
	(3513, '2021-03-23', 'Santa Mônica', 358, '1934-11-01', 'CAPS Adulto ', 9553, 'Santa Aeni Silverio da Silva', 'Avaliação com psiquiatra.85 anos,cega,marido com Alzheimer/fugindo de casa,nervosa,cutucando os dedos até machucar.HAS,Hipotiroidismo Auto-mutilação, ansiedade. Em uso de: Sertralina 50 mg.Em 2011 esteve no CAPS com lesões nos bracos.', 'Ajuste medicação e manutenção ESF', 0, 'FINALIZADO'),
	(3514, '2021-10-19', 'CAPS Adulto', 10809, '1962-08-16', 'Sta Mônica', 2162, 'Rita Maria Heleno Bueno', 'Em uso de: Desvenlafaxina 100 mg (2.0.0), Sulpam (1.0.1), Ansitec 10 mg (1.0.1), Depakene 250 mg (1.0.1) e Frisium 20 mg (0.0.1). Solicita reavaliação psiquiátrica, pois, faz uso dos mesmos medicamentos há anos e sente que não estão mais fazendo o efeito desejado. Queixa-se de insônia e sintomas depressivos. Há quinze dias teve uma crise depressiva, ficou dias deitada, sem ânimo para as AVD. Relata, ainda, falta de condições financeiras para arcar com o custo da medicação (verificar possibilidade de processo para obtenção junto ao Estado). ', 'Agendado ASM Dra. Rejane 20/10/21', 0, 'FINALIZADO'),
	(3515, '2021-11-23', 'CAPS i', 0, '2006-12-24', 'Santa Mônica', 3184, 'Nicoly Cristina Brasilino', 'Compareceu ao acolhimento demandando psicoterapia. Já foi atendida pelo psicólogo em acolhimento no ESF. Verificar possibilidade de dar continuidade ao tratamento psicológico no ESF.', 'Psicoterapia ASM', 0, 'FINALIZADO'),
	(3516, '2022-02-15', 'Santa Mônica', 46, '1961-03-30', 'CAPS Ad', 3073, 'Benedito Aparecido Damasceno ', 'Uso abusivo de alcóol.Polineuropatia, anemia, hipertensão, baixa adesão a tratamento.', 'Agendado ASM Dra. Rejane 16/02/2022', 0, 'FINALIZADO'),
	(3517, '2022-03-22', 'CAPS Adulto', 0, '1965-09-29', 'Santa Mônica', 0, 'Regina Teófilo', 'Trouxe encaminhamento da endócrino para psiquiatria/ Queixa-se de ansiedade, taquicardia, dispnéia, períodos de insônia, outros de sonolência excessiva, tristeza e fadiga. Já passou no psicólogo da rede pública.', 'Manutenção UBS e reajuste medicação', 0, 'FINALIZADO'),
	(3518, '2022-04-19', 'Santa Mônica ', 2022, '2001-12-10', 'CAPS Adulto', 12133, 'Luiz Fernando Batista De Souza', 'Passou por consulta com Dr. Kalebe e não quer fazer uso da medicação. No dia 05/04/22 esteve na unidade por estar apresentando comportamernto alterado no trabalho. Em uso de: Risperidona 2 mg 0-0-1, Limbitrol 0-0-1. F31.0?, F23.8? Interrompeu a medicação e está fazendo uso de etílicos, crises persecutórias.', 'Agendado ASM Dra.Rejane 20/04/2022.', 0, 'FINALIZADO'),
	(3519, '2022-04-19', 'Santa Mônica ', 46, '1961-03-30', 'CAPS Ad', 3073, 'Benedito Aparecido Damasceno ', ' Teve uma queda em 23/02/2022 , ficou internado , resultado das tomografias com lesões vertebras e crânio, não está em uso de alcool , pouca mobilidade. Necessita passar por consulta com a Dra Rejane novamente. Laudo psiquiatria.', 'Agendado ASM Dra. Rejane 20/04/2022', 0, 'FINALIZADO'),
	(3520, '2022-05-17', 'CAPS Adulto', 0, '1969-06-29', 'Santa Mônica', 0, 'Luiz Mário Correa', 'Queixa-se de depressão, ansiedade, insônia, dores. Queixas a respeito da condição social. Atendimento psicológico (?) Atendimento Dra. Rejane (?)', 'Islene fará avaliação social', 0, 'FINALIZADO'),
	(3521, '2022-06-14', 'CAPS Adulto', 0, '1969-06-29', 'Santa Mônica', 528, 'Luiz Mário Correa', 'Retorno Assistente social. Relata morar de favor na casa da irmã Lucimar Correa e com pai Luiz Correa. O pai é aposentado e segundo informações do filho, o salário é todo comprometido por empréstimos e gastos com mulheres. A irmã tem problemas de saúde e está desempregada. Luiz recebe o Auxilio Brasil no valor de R$400,00. Luiz estudou até o ensino médio, sendo solteiro e sem filhos. Relata que tem dificuldades para dormir, fuma um maço de cigarros por dia, ansioso, preocupado com as situações da vida diária, vontade de se isolar, pensamentos de morte.Desempregado sente que precisa ajudar mais a família, pois somente o auxílio não é suficiente. Declara que mesmo que estivesse tudo organizado em sua vida mesmo assim estaria emocionalmente abalado. Afirma que com dezessete anos tentou suicídio. Igreja ajuda com alimentos. Já trabalhou com limpeza. Fiz o encaminhamento para psiquiatra Dra. Rejane e vou matriciar. Fiz encaminhamento para psicólogo também. Deixei o encaminhamento para o setor de empregos e orientei a procurar o serviço somente quando se sentir preparado para isso.  ', '', 0, 'FINALIZADO'),
	(3522, '0000-00-00', '', 0, '0000-00-00', '', 0, '', '', '', 0, 'FINALIZADO'),
	(3523, '2022-06-14', 'Caps', 6428, '1959-08-28', 'Santa Mônica', 2178, 'Maria de Lourdes Martins', 'Comparece em acolhimento, queixa pesadelos, vendo bichos na parede, insônia. Passa em avaliação com Dra. Rafaela, prescreve: Bromazepam 3 mg(0-0-3), mantém Clomipramina, indica acompanhamento psicológico no ESF, manter consulta com clínico dia 01/06.Cid: F33.2 + F48.8. Manter ESF.', 'Encaminhar a psicologia.', 0, 'FINALIZADO'),
	(3524, '2022-07-12', 'CAPS Adulto ', 4858, '1963-10-21', 'Santa Mônica', 2190, 'Joana Darc Batista Augusto', 'Paciente faz uso de Paroxetina 20 mg 1 0 1 há muitos anos, surda e tem defict intelectual, afirma que as pessoas estão falando dela.. .Atritos familiares principalmente com a filha, encaminhada para psicologa, sugerido orientação para filha, discutir medicação.', 'Agendado ASM 13/07/22, às 9:30h. Encaminhar à psicologia.', 0, 'FINALIZADO'),
	(3525, '2022-07-12', 'CAPS Ad', 3368, '1934-06-20', 'Santa Mônica', 0, 'Robert Batista Goncalves Tiago', 'Encaminhada Dr. Kaleb. Agendado psiquiatria. CAPS Ad, relata que não está bebendo. Apresentando crise de ansiedade, medo de sair de casa. Foi encaminhado a psicoterapia. Prescrito Diazepam 10mg.', 'Manutenção CAPS Ad', 0, 'FINALIZADO'),
