	(3527, '2022-08-09', 'CAPS Adulto', 10809, '1962-08-16', 'Damasco', 2162, 'Rita Maria Heleno Bueno', 'Queixa de sintomas depresivos e automutilação. Procurou o CAPS buscando atendimento com Dra. Rejane, solicita manutenção e reajuste da medicação, e deseja acompanhamento psicológico.', 'Acolhimento psicologia ASM', 0, 'FINALIZADO'),
	(3528, '2022-08-09', 'CAPS Adulto', 0, '1985-10-23', 'Damasco', 2582, 'Luciane Aparecida dos Santos', 'Consultou partircular com Dra. Rejane a qual prescreveu: Risperidona 1 mg 1-0-1, Quetiapina 50 mg 0-0-1, Escitalopram 15 mg. Apresentou boa melhora quanto aos delírios, porém não está dormindo, corpo travado e muita ansiedade.', 'Manutenção ESF', 0, 'FINALIZADO'),
	(3529, '2022-09-06', 'CAPS Adulto ', 12294, '1962-06-06', 'Santa Mônica', 1341, 'Elenice Maria Silva', 'Em uso de Fluoxetina 20 mg 2-0-0 e Bromazepam 6 mg 0-0-1 desde 11/07/22. Queixa que os medicamentos não fazem efeito, pois não está dormindo, continua ansiosa, não consegue alimentar direito. Solicito avaliação da Dra Rejane, visto que a paciente teria retorno com Dr Anderson hoje e o mesmo exonerou.  ', 'Transferido para o próximo matriciamento', 0, 'FINALIZADO'),
