	(3655, '2020-02-18', 'CAPS Adulto', 11703, '1956-07-25', 'Florescer', 6638, 'Maria Apda Fatima Silva', 'Não adapta Clonazepam. CID F41.2, F48.8', 'Manutenção de medicação ESF ', 17, 'FINALIZADO'),
	(3656, '2020-02-18', 'CAPS Adulto', 7334, '1963-04-23', 'Florescer', 166, 'Maria Jose Pinto da Silva\n', 'Haldol 5mg 2cp, Clonazepan 2 mg 3cp / Clorpromazina 100mg 2cp, Litio 300mg 3cp / dia.', 'Manutenção de medicação ESF. Pedido de exame de Litio', 17, 'FINALIZADO'),
	(3657, '2021-03-23', 'CAPS Adulto', 11394, '1976-01-04', 'Florescer', 4606, 'Daniela Gonçalves da Silva', 'Pensamento suicida, "descabelando", chorosa, medo do trabalho, ansiedade, desespero, pesadelo a noite. Em uso de: Venlafaxina 150 mg 2x dia , Sulpirida 50 mg 2 x dia , Estazolam 2 mg 1 x noite . Não esta sentindo bem com Estazolam F43.2+F48.9+Z56.6', 'Readequacão e manutenção medicação ESF. Encaminhar para psicoterapia se necessário', 17, 'FINALIZADO'),
	(3658, '2021-03-23', 'CAPS Adulto ', 0, '1990-06-08', 'Florescer', 7523, 'Francisca Josias de Freitas', 'Paciente compareceu ao CAPS acompanhada pelas irmãs com encaminhamento da médica Lidiene Terra S. Gomes. Paciente fazia tratamento no Ceará, encontra-se estável e trouxe toda a documentação a respeito das medicações que  faz uso. Paciente deve ser acompanhada pelo ESF visto que encontra-se estável. Como não foi fornecido receita para a paciente, mesmo mediante relatório trazido do Ceará. Dr Anderson fez a receita e encaminhou. G40+F72 em uso de: Risperidona 3 mg 1-0-1, Depakene 500 mg 1-1-1, Carbamazepina  200 mg 1-1-1, Fenorbabital 100mg 1-1-1, Diazepam 5 mg 0-0-1', 'Manutenção medicação ESF.', 17, 'FINALIZADO'),
	(3659, '2021-04-20', 'CAPS Adulto ', 3210, '1993-04-01', 'Florescer', 7900, 'Stefanie V. Ribeiro dos Santos', 'Lúcida, orientada, separação dos pais,conflito familiar,rejeição paterna,irmão a sequestra devido ao dinheiro que recebe.  Em uso de: Fenobarbital 100 mg e Bromazepam 3 mg. G40?F79?', 'Encaminhar para psicoterapia ASM', 17, 'FINALIZADO'),
	(3660, '2021-04-20', 'CAPS Adulto ', 5675, '1973-12-19', 'Florescer', 7900, 'Rosilene Pereira Ribeiro dos Santos', 'Separação,conflito familiar. Em uso de Alprazolam 2 mg. F48.9', 'Encaminhar para psicoterapia ASM', 17, 'FINALIZADO'),
	(3661, '2021-04-20', 'CAPS Adulto ', 0, '1989-02-09', 'Florescer', 4613, 'Monique Helen da Silva', 'Em uso de: Clonazepan 2 mg (0-0-1) Escitalopram 20 mg (1-0-0) refere medo de tudo, medo de sair de casa e passar mal, não dorme bem, fadiga intensa, refere palpitações e muita ansiedade, pensa em suicidio e ao mesmo tempo tem medo de morrer. F41.0', 'Agendado ASM 22/04  e encaminhar para psicoterapia.', 17, 'FINALIZADO'),
	(3662, '2021-04-20', 'CAPS Adulto ', 6544, '1970-02-12', 'Florescer', 722, 'Tania Maria da Silva', 'Urticaria com Bup suspendeu o uso, antes fazia uso de topiramato 25/50 mg e Escitalopram 10 mg  2 0 0', 'Agendado ASM 22/04  e encaminhar para psicoterapia.', 17, 'FINALIZADO'),
	(3663, '2021-06-15', 'CAPS Adulto ', 2504, '1969-09-24', 'Florescer', 3490, 'Maria Apda Oliveira', 'Troca de medicação para remédios do SUS, sem condições de compra-los. Faz uso de: Venlafaxina 75 mg 2 0 2 , Clonazepam 2 mg 1 0 1 , Depakene 250 mg 1 0 1, Quetiapina 100 mg 1 0 1. CID 10 : F 34.0, F 48.9, F 68.0, Z 59.7.', 'Agendado ASM 17/05 e encaminhar para psicoterapia.Reavaliacão ASM 16/06.', 17, 'FINALIZADO'),
	(3664, '2021-07-13', 'Florescer ', 3184, '1954-02-15', 'CAPS Adulto', 7156, 'Maria Aparecida Becati', 'Depressão há 20 anos ( TTO Dra Vivian), angustia, tristeza, tudo esta ruim, insônia, perdeu irmão há 4 anos, com piora dos sintomas.Em uso de: Duloxetina 60 mg 1-0-0 Alprazolam 2 mg 0-0-1 Escitalopram 10 mg 2-0-0', 'Agendado ASM 15/07/2021 e encaminhar para psicoterapia.', 17, 'FINALIZADO'),
	(3665, '2021-07-13', 'Florescer ', 1984, '1983-10-03', 'CAPS Adulto', 3460, 'Simone Freitas Resende', 'Agitação, grita o dia todo,"sobe nas coisas", episódios de queda. CID10: F 06.2 + F 72.1 Em uso de: Haldol 5 mg 1-1-1, Clomipramina 25 mg 1-1-1, Levomepromazina 100 mg 0-0-3, Clonazepam 2mg 1-1-1', 'Agendado ASM 14/07/2021', 17, 'FINALIZADO'),
	(3666, '2021-07-13', 'Florescer ', 4277, '1994-11-17', 'CAPS Adulto', 12023, 'Taynara D Carli Meneguci', 'Está em psicoteraia com Anderson, Relata alteração do humor, foi criada pela avó, mãe era DQ, refere que perdeu a guarda dos filhos, passou no CAPS no ano passado, foi medicada (não sabe o nome dos medicamentos) parou por conta própria.', 'Tentativa de manutenção psicoterapia (Vínculo)', 17, 'FINALIZADO'),
	(3667, '2021-07-13', 'Florescer ', 1610, '1974-04-20', 'CAPS Adulto', 9922, 'Maria Aparecida Silva ', 'Refere estar dispersa, sensação de vazio na cabeça, não consegue concentrar, refere piora após termino do fluxo menstrual há 3 meses. F 29 + F 41 + F 79 + F 25  + F 10 + F 06.2 + F 70.1 + F 44  .Em uso de: Venlafaxina 75 mg 1-0-1, Risperidona 2 mg 0-0-1, Depakene 250 mg 1-0-1, Diazepam 10 mg 1-0-0,Clonazepam 2 mg 0-0-1, Carbamazepina 200 mg 1-0-1', 'Agendado ASM 15/07/2021', 17, 'FINALIZADO'),
	(3668, '2021-07-13', 'Florescer ', 4277, '1982-02-22', 'CAPS Adulto', 8070, 'Everson D Carli', 'Marido Taynara D Carli, usuário de drogas.', 'ESF fará tentativa de encaminha-lo ao CAPS Ad', 17, 'FINALIZADO'),
	(3669, '2021-08-10', 'Florescer ', 4277, '1994-11-17', 'CAPS Adulto', 12023, 'Taynara D Carli Meneguci', 'islene:19/07/21Realizei atendimento e usuária relata que reside com a sogra e companheiro. Ela disse que parou de tomar o medicamento devido a problemas familiares (abrigamento das crianças ). Esposo não deseja tratamento de saúde para o vício. Está indo nas consultas no psf com psicólogo. Casal desempregado. Sem BF. Auxílio Emergencial de R$365,00. Orientada a comparecer ao CRAS que já acompanha a família. Sem BF. 19/07/21Também falei na Casa Lar sobre o caso e fui orientada que não há possibilidade no momento de retorno das crianças. Trabalha-se com a possibilidade de carta precatória para outro municipio com a finalidade que uma tia paterna assuma os  2 filhos de Taynara. Já tem uma bebê que está com uma outra tia. Instabilidade emocional sem apoio do pai. Sem plano de trabalho direcionado para os genitores.', 'Manutenção psicoterapia ASM', 17, 'FINALIZADO'),
	(3670, '2021-08-10', 'Sion', 972, '1968-06-03', 'CAPS Adulto', 0, 'Fernando Oliveira Carioca', 'Forte ansiedade, pensamentos negativos de conteúdo trágico, morte, desesperança, inquietação física, medo. Fazia acompanhamento em consultório particular e deseja iniciar pelo SUS. Em uso de: Quetiapina 100 mg (0-0-1) e Alprazolam 2 mg (0-0-1)', 'Psicoterapia e manutenção medicação ESF', 17, 'FINALIZADO'),
	(3671, '2021-08-10', 'CAPS i', 1396, '2014-12-03', 'Sion', 7537, 'Ana Alice Dias', 'Islene: Retorno do caso: Rita de Cassia Silva que informou que a filha faz tratamento de saúde com Dr. Lucas neuropediatra. Exames de ressonância em Alfenas já realizou; exame Cariótipo faz no laboratório em Varginha. Dr. Lucas pediu devido ao atraso mental Tem problemas com obesidade e realiza tratamento na policlínica central. Deixou no setor de TFD pedido de endocrinopediatrico e informei que não há previsão no momento. Não é aluna da Fuvae porque não fechou o diagnóstico. Matriculada na escola José Augusto de Paiva. Caps (i) Dra. Ester encaminhou para Oásis, mas devido pandemia ainda não chamou.  O pai não paga pensão alimentícia e foi embora. Caso está na justiça. Sem BF; Rita trabalha como doméstica meio período e tem renda de meio salário mínimo. Mora em casa alugada valor de R$700,00. Orientada a ir no Cras para avaliação e encaminhamentos para benefícios.  ', 'Aguardar', 17, 'FINALIZADO'),
	(3672, '2021-09-14', 'Florescer ', 611, '1962-12-29', 'CAPS Adulto', 11742, 'Maria Aparecida de Souza Cazelato', ' Encaminhada em agosto 2020 para da manutenção da medicação. CID F 48.9 + F 61.0 + F 31.8 Em uso de: Duloxetina 60 mg   2- 0- 2 , Bupropiona 150 mg  1- 0 -1, Sulpirida 50 mg  1- 0 -1 , Depakene 250 mg  1- 0 -1 , Topiramato 50 mg  1 - 0 -1 , Alprazolam 2 mg  0 -0 -2, Famotidina 20 mg - 1 0 1.  Refere não estar sentindo bem com estas medicações, irritada, nervosa, sono não reparador, perde a paciencia por qualquer motivo e sem vontade de trabalhar.', 'Agendado ASM 15/09/21 ', 17, 'FINALIZADO'),
	(3673, '2021-09-14', 'Florescer ', 7238, '1975-05-25', 'CAPS Adulto/ ASM', 0, 'Sidnei do Vale', 'Refere estar ansioso, nervoso, autoagressões, marcas de mordidas pelas mãos. Prescrito: Fluoxetina 20 mg Tegretol 200 mg', 'Manutenção ESF e Psicoterapia ASM', 17, 'FINALIZADO'),
	(3674, '2021-09-14', 'Florescer ', 1771, '1983-05-16', 'CAPS Adulto', 0, 'Aline Damaris de Oliveira', 'Paciente refere que foi ao CAPS conversou com Alexandra que orientou a vir na Unidade para o matriciamento, refere estar ansiosa, depressiva, choro facil, falta de ar , taquicardia e enxaqueca. Em uso de: Desvenlafaxina 50 mg T. Ansiedade ', 'Manutenção e reajuste medicação ESF Desvenlafaxina 100 mg + Topiramato 25/50 mg ', 17, 'FINALIZADO'),
	(3675, '2021-09-14', 'Florescer ', 1991, '1964-05-01', 'CAPS Adulto', 0, 'Angela Maria Costa', 'Refere mal estar, insonia após vacina covid, tomou Lorazepan a mais, pegou receita 12/08 e já quer mais receita. Recuso em dar receita. Dependência / abuso de benzodiazepinicos.', 'Agendado ASM 15/09/21 ', 17, 'FINALIZADO'),
	(3676, '2021-09-14', 'Florescer ', 4277, '1958-12-08', 'CAPS Adulto', 0, 'Aparecida Gregorio de Carli', 'Paciente refere que deseja morrer, sumir, não consegue ficar sozinha. Não dorme, acorda querendo matar alguém, refere que comprou Clonazepam comprimido sendo que prescrição esta gotas, comprou sem receita, recusou falar como conseguiu comprar, uso de medicação irreguar. Faz uso de Diazepam por conta própria. ', 'Manutenção e reajuste medicação ESF ( Nortriptilina 25 / 50mg ) e Psicoterapia ASM', 17, 'FINALIZADO'),
	(3677, '2021-09-14', 'Florescer ', 1901, '1962-07-02', 'CAPS Adulto', 8249, 'Carlos Roberto Ramos', 'Paciente solicita receita de medicamento, não apresenta prescrição anterior, relata que dra Rejane mudou os medicamentos e não sabe dizer quais. Haldol 1 mg dia ', 'Manutenção ESF', 17, 'FINALIZADO'),
	(3678, '2021-10-19', 'CAPS i', 1396, '2014-12-03', 'Sion', 7537, 'Ana Alice Dias', 'Retorno A.S: CAPS i entrou em contato para informar que Ana Alice tem um novo laudo do neuropediatra e que ela precisa de um exame via Tfd. Entrei em contato com a mãe da criança que relatou que ainda não deixou o pedido do exame de investigação da síndrome na Semus devido ao trabalho. Disse que a documentação da criança está correta na junta reguladora para avaliação da Fuvae. Informa que foi orientada pela junta que Ana deve continuar o tratamento via CAPS i enquanto não é avaliada pela Fuvae. Informa que o pedido de exame está preenchido no formulário de Tfd. Fono em lista de espera. Está matriculada na escola José Augusto de Paiva. Orientada a procurar o setor de tratamento fora do domicílio para requerer o exame molecular genético.', 'Aguardando exames e avaliação da FUVAE.', 16, 'FINALIZADO'),
	(3679, '2021-10-19', 'CAPS Adulto', 9320, '1980-05-10', 'Sion', 0, 'Cecilia Paulino', 'Necessita de relatório para LOAS. Ver se Dra Rejane pode atende-la em consulta para elaborar relatório.', 'Agendado ASM Dra. Rejane 20/10/21', 16, 'FINALIZADO'),
	(3680, '2021-10-19', 'CAPS Adulto', 0, '1964-05-01', 'Sion', 1991, 'Angela Maria Costa', 'Refere cravos pelo corpo,insonia.Remarcar dra Rejane faz uso lorazepan a mais', 'Agendado ASM Dra. Rejane 20/10/21', 16, 'FINALIZADO'),
	(3681, '2021-11-23', 'CAPS Adulto', 8249, '1962-07-02', 'Florescer', 1901, 'Carlos Roberto Ramos', 'Ver possibilidade de agendar com Dra. Rejane para fazer atestado de interdição.', 'Agendado ASM Dra. Rejane 24/11/21', 17, 'FINALIZADO'),
	(3682, '2021-11-23', 'CAPS i', 0, '2005-04-06', 'Florescer', 7819, 'Patrick Solli Lourençoni', 'Conversar sobre o adolescente que estava em tratamento no UBS e compareceu em acolhimento no CAPS i dia 16/11/21.', 'Agendado cl[inico ESF 25/11/21', 17, 'FINALIZADO'),
	(3683, '2021-11-23', 'Florescer', 0, '1929-05-01', 'CAPS Adulto', 0, 'Clotildes Henrique Peloso Silva', 'Quadro depressivo. Choro fácil. Medo de morrer. Medo de ser enterrada viva (chorou no consultório).', 'Acolhimento psicologia e ajuste medicação ASM', 17, 'FINALIZADO'),
	(3684, '2021-12-21', 'CAPS Adulto', 0, '1989-02-09', 'Florescer', 4613, 'Monique Helen da Silva', 'Compareceu ao CAPS relatando que está deprimida, ansiosa chorosa. Relata que a medicação não está fazendo efeito, segundo a paciente, faz uso correto dos medicamentos. Solicito reavaliação da medicação. No momento não apresernta perfil para atendimento no CAPS. Paciente irá aguardar ligação para saber o dia da consulta. 987017821 em uso Fluoxetina 20 mg 2-0-0, Bromazepam 6 mg 0-0-1 e Nortripitilina 50 mg 0-0-1', 'Manutenção ESF e reavaliação em 30 dias.', 17, 'FINALIZADO'),
	(3685, '2021-12-21', 'CAPS Adulto', 2301, '1967-08-23', 'Florescer', 3710, 'Alice Felix', 'Quer relatório para troca de curador. Pedir para Dra. Rejane atendê-la.', 'Agendado ASM Dra. Rejane 22/12/21.', 17, 'FINALIZADO'),
	(3686, '2021-12-21', 'CAPS Adulto', 11199, '1970-08-19', 'Florescer', 776, 'Adriana de F.Gonçalves', 'Paciente restritra,deficiencia visual e intelectual,no momento muito agitada; faz usode:Clorpromazina 100mg 1x dia;Depakene 250mg (2x ao dia) Nortriptilina de 50mg 1x dia e Diazepan 10mg (1x /dia)', 'Cuidados paleativos.', 17, 'FINALIZADO'),
	(3687, '2021-12-21', 'CAPS Adulto', 11703, '1956-07-25', 'Florescer', 6638, 'Maria Aparecida de fatima Silva', 'Faz uso de:Nortriptilina 25mg (interrompeu por conta própria);Clonazepan 2mg (1x dia), nao faz uso dos medicamentos corretamente, é poliqueixosa. Ja foi avaliada pelo dr Anderson no CAPS em 2020; cid F33.1 / F48.8', 'Agendado ASM Dra. Rejane 23/12/21 e depois manutenção ESF.', 17, 'FINALIZADO'),
	(3688, '2022-02-15', 'Florescer', 0, '1955-03-23', 'CAPS Adulto', 12207, 'Paulo Martins de Oliveira ', 'Agitação, inquietação, insônia. Em uso de Donarem, Aristab e Bromazepam.', 'Agendado ASM Dra. Rejane 17/02/22', 17, 'FINALIZADO'),
	(3689, '2022-02-15', 'Florescer', 0, '1969-02-20', 'CAPS Adulto/CAPS AD', 1399, 'Marcelo De Souza Dias', 'Etilista crônico, usuario de SPA, neuropatia alcoolica e dificuldade de deambular. ', 'Acolhimento CAPS AD', 17, 'FINALIZADO'),
	(3690, '2022-02-15', 'Florescer', 6171, '1947-11-29', 'CAPS Adulto', 0, 'Teresinha Do Rosario Severino', 'Agitação, alucinações, insonia, desorienta no espaço e tempo, fala desorganizada, comportamento compulsivo e desorganizado. Em uso de Haldol 1 mg.', 'Avaliação clínica ESF e caso necessite avaliação psiquiátrica ASM.', 17, 'FINALIZADO'),
	(3691, '2022-02-15', 'Florescer', 0, '1956-07-25', 'CAPS Adulto', 11703, 'Maria Aparecida Fatima Silva', 'Consultou com Dra Rejane no dia 23/12/2021. Não sabe dizer os medicamentos que foram acrescentados no dia da consulta, perdeu a receita. Em uso de Clonazepam.', 'Manutenção ESF e encaminhar para grupo de tabagismo.', 17, 'FINALIZADO'),
	(3692, '2022-02-15', 'Sion', 0, '1970-10-26', 'CAPS Adulto', 4905, 'Luciane de Andrade Braz', 'Depressão, ansiedade. Em uso de Fenobarbital 1x, Venlafaxina 2x.', 'Agendado ASM Dra. Rejane 16/02/2022', 16, 'FINALIZADO'),
	(3693, '2022-03-22', 'Florescer ', 4277, '1994-11-17', 'CAPS Adulto', 12023, 'Taynara D Carli Meneguci', '', 'Agendado ASM Dra. Rejane 24/03/2022', 17, 'FINALIZADO'),
	(3694, '2022-04-19', 'Florescer', 6171, '1947-11-29', 'CAPS Adulto', 0, 'Terezinha do Rosario Severino', 'Agitação/confusão mental, delirios. Em uso de Haldol 1 mg sem melhora.', 'Agendado ASM Dra.Rejane 20/04/2022', 17, 'FINALIZADO'),
	(3695, '2022-04-19', 'CAPS Ad', 1749, '1974-02-03', 'Florescer', 547, 'Ronaldo Augusto Cesário', 'Paciente sem uso de SPA\'s há aproximadamente 07 meses; em uso das medicações: Diazepam 10 mg(0-0-1); Gardenal 100 mg  (0-0-1), 01 ampola Haldol a cada 21 dias; Hidantal 100 mg(1-1-1). Encaminhado ao PSF para manutenção medicamentosa.', 'Manutenção ESF', 17, 'FINALIZADO'),
	(3696, '2022-04-19', 'Florescer', 7991, '2006-12-08', 'Florescer/ ASM', 7991, 'Melyna de Oliveira Pedro', 'Se corta, não aceita o corpo,dorme o dia todo, sobrecarga, desanimada.', 'Acolhimento psicologia ASM', 17, 'FINALIZADO'),
	(3697, '2022-04-19', 'CAPS Adulto', 0, '1958-10-23', 'Florescer', 0, 'Antônio Clarêncio da Silva', 'Passou em primeira entrevista no CAPS solicitando laudo para tentar benefício do INSS. Caso não absorvido. Avaliação Dra. Rejane (?). Consultou com Dr. Julio 03/03', 'Agendado ASM Dra. Rejane 20/04/2022', 17, 'FINALIZADO'),
	(3698, '2022-04-19', 'Florescer', 6638, '1956-07-25', 'CAPS Adulto', 11703, 'Maria Aparecida Fatima Silva', 'Apresentando alucinações, sem TTO adequado. Em uso irregular de Nortriptilina 50 mg e Clonazepam.', 'Agendado ASM Dra. Rejane 20/04/2022', 17, 'FINALIZADO'),
	(3699, '2022-04-19', 'Florescer', 172, '1987-05-29', 'CAPS Adulto', 4813, 'Edy Lamar Dos Santos', 'Perdeu a guarda dos filhos, ansiosa e libido exagerado. Em uso de: Fluoxetina 20 mg e Haldol 1 mg.  F06.2+F70.1', 'Avaliação Dr. Anderson CAPS Adulto 20/04/2022', 17, 'FINALIZADO'),
	(3700, '2022-05-17', 'CAPS Ad', 3215, '1973-01-15', 'Sion', 0, 'Paulo Sérgio Ribeiro', 'Abstinente há cerca de 08 meses; estável. Em uso de: Risperidona 2 mg (1-0-1) e Clorpromazina 25 mg (0-0-1) interrompeu. Encaminhamento ao ESF para manutenção medicamentosa.', 'Acompanhamento ESF', 16, 'FINALIZADO'),
	(3701, '2022-05-17', 'Florescer', 352, '1996-11-04', 'CAPS adulto', 11318, 'Gleison Mesquita de Carvalho', 'Depressão e Ansiedade. Solicita laudo para INSS. F20.3 + F19.2. Biperideno 2mg (1.0.0.), Clonazepam interrompido, Tioridazina 100 (0.01), Haldol decanoato (4 amp 28/28 dias)', 'Islene fará avaliação social e previdenciaria ', 17, 'FINALIZADO'),
	(3702, '2022-05-17', 'Florescer', 2908, '1974-11-28', 'CAPS Adulto ', 1407, 'Arilda de Paiva Antônio', 'Ha 5 meses sem medicação, não tem bom relacionamento com filho, refere "dor insuportavel e nao sabe dizer onde", não tem vontade de viver, não quer fazer nada /choro facil. Fluoxetina e Pregabalina desde 10/5', 'Agendada Dra Rejane 19/05/2022', 17, 'FINALIZADO'),
	(3703, '2022-05-17', 'Florescer', 7605, '2007-08-22', 'CAPSi', 0, 'Paola Vitória Rodrigues', 'Alteração comportamento súbito, está bem, sorrindo, e do nada se fecha, não quer ir para escola, tentativa de auto exterminio há 1 semana, refere que se cortou em agosto 2021, pais separados (mora com o pai), refere não ter problemas com a mãe, se cuida, alimenta bem, não apresenta mudanças no sono e não apresenta manias.', 'Acolhimento CAPS i', 17, 'FINALIZADO'),
	(3704, '2022-05-17', 'CAPS Adulto', 5146, '1952-02-02', 'Florescer', 453, 'Maria Antonieta dos Santos', 'Apresentando delírios. Sofrendo violência doméstica. Quadro demencial?? Solicita consulta com Rejane psiquiatra. ', 'Islene fará avaliação social, agendada ASM Dra Rejane 19/05/2022', 17, 'FINALIZADO'),
	(3705, '2022-05-17', 'Florescer', 1200, '1968-07-11', 'CAPS Ad', 0, 'Paulo Bernardino', 'Laudo para Transplante de Figado. Cirrose com hipertensão portal, hérnia, encaminhamento da Gastro para transplante', 'Encaminhamento ao CAPS ad', 17, 'FINALIZADO'),
	(3706, '2022-05-17', 'Florescer', 7627, '1962-11-28', 'CAPS adulto', 9888, 'Lucilene Martins', 'Paciente nova no bairro Sion, já  foi solicitado prontuário. Faz uso Biperideno 2 mg (1.0.1) Haldol 1mg (0.0.1) Bromazepam 3 mg (1.0.1) HIV+, acompanhamento Policlínica Central. Caso Bromazepam em falta, prescrever Clonazepam 2 mg (1.0.1)', 'Manutenção ESF', 17, 'FINALIZADO');
INSERT INTO `matriciamento` (`id`, `data`, `unidaderequisitante`, `protuariorequisitante`, `datanascimento`, `requisitado`, `prontuariorequisitado`, `nomepaciente`, `obs`, `planoterapeutico`, `local`, `status`) VALUES
	(3707, '2022-06-14', 'Florescer', 7627, '1962-11-28', 'CAPS Adulto', 9888, 'Lucilene Martins', 'Retorno Islene: Visita domiciliar ; reside com dois filhos sendo que um deles não trabalha com a justificativa de cuidar da mãe. Declara que sofreu uma queda e sente muitas dores nas penas e apresenta dificuldades para andar. Afirma que toma a medicação corretamente.10/06/22 Contato estabelecido com a filha Kênia Camila que relata que a mãe faz uso abusivo de álcool (pinga). Quando fica nervosa toma os medicamento controlados em grande quantidade. Disse que o irmão Sanderson é usuário de drogas e fica fora de casa o dia todo. Ele vende alimentos e o gás de cozinha para comprar drogas. 10/06/22 Estabeleci contato com o CRAS e falei com a psicóloga Suzana. Ela disse que atendeu a família e no mês de fevereiro encaminhou Sanderson para o CAPS Ad e ele não aceitou. Ele era morador de rua. Disse que a assistente social Lívia da Central fez visita domiciliar e orientou Lucilene a procurar apoio médico devido aos fortes tremores pelo corpo (abstinência do álcool? devido ao uso indevido dos remédios? ). Liguei no CAPS Ad e Lucilene e Sanderson não tem prontuário lá.', '', 17, 'FINALIZADO'),
	(3708, '2022-06-14', 'Florescer', 352, '1996-11-04', 'CAPS Adulto ', 11318, 'Gleison Mesquita de Carvalho', 'Retorno Islene: Atendimento realizado com a mãe. Na casa moram Cleuzomara, Gleison e seu irmão Vanildo que trabalha com carteira assinada. A usuária é diarista, mas esta sem trabalho. Orientei sobre os critérios do Loas, que devido ao irmão solteiro morar na casa e trabalhar com carteira assinada, a renda per capta ultrapassa.Orientei que ele perdeu a qualidade de segurado sendo necessário pagar algumas parcelas para o Inss e depois entrar com requerimento de auxílio doença novamente. Encaminhei para o Cadunico para fins de tarifas sociais e demais benefícios; encaminhei Cleuzomara para o setor de empregos; encaminhei para pagamento de carnê do Inss facultativo simplificado 11% e depois procurar a enfermeira da policlínica do Sion para matriciar e passar com psiquiatra emitir o laudo e entrar com pedido de auxílio doença. ', 'Transferido para o próximo matriciamento.', 17, 'FINALIZADO'),
	(3709, '2022-06-14', 'Florescer', 6638, '1956-07-25', 'CAPS Adulto', 11703, 'Maria Aparecida Fatima Silva', ' Dra. Rejane no Santana. Faz uso de  medicação e relatmédica. Pedi para me passar o telefone da filha Meiriellem e a usuária disse que não precisa incomodar os filhos porque eles são muito ocupados. Meiriellem trabalha o dia todo em um hotel. Disse que o CRAS acompanha.Relata que tem uma advogada que entrou com pedido de Loas para ela e aguarda os desdobramentos. Seu filho Jhone recebe o Loas por deficiência. Vou matriciar o caso e dar retorno. Vou falar com a enfermeira sobre consulta para Maria que declara estar com tosse e sobre a inserção no programa de antitabagismo. Pedi para Maria levar o telefone da filha para eu entrar em contato. ', 'Está com consulta agendada para o dia 15/06/2022.', 17, 'FINALIZADO'),
	(3710, '2022-06-14', 'CAPS Adulto', 5146, '1952-02-02', 'Florescer', 453, 'Maria Antonieta dos Santos', 'Retorno Islene: Atendimento realizado com a irmã Suzana. Relata que  Francine (filha de Maria) mora com Maria e uma neta. Nega que exista violência doméstica e que a irmã reage com agressividade quando é contrariada. Sem qualidade de segurada para auxílio doença. Renda per capta acima para Loas. Orientada a juntar comprovante das despesas mais laudo médico para entrar com pedido de BPC que será negado pela renda familiar. Posteriormente orientada a entrar na justiça federal. ', '', 17, 'FINALIZADO'),
	(3711, '2022-06-14', 'CAPS Adulto', 2444, '1991-07-13', 'Florescer', 2617, 'Jéssica Aparecida Rocha', 'Sem consulta desde agosto de 2021, apenas renovando receita. Queixa pouca eficácia da medicação, frequentes oscilações de humor, medo de ficar sem o remédio. Solicito avaliação Dra. Rejane. Aguardando também ser chamada para acompanhamento psicológico, já deixou nome há bastante tempo (sic)', 'Em uso de Sertralina 100mg (0-0-1). Agendar psicologia. Anderson psicólogo irá agendar. Ajuste da medicacão sertralina para 150mg. F 41.2 e F 48.8, F 33.1.', 17, 'FINALIZADO'),
	(3712, '2022-06-14', 'Florescer', 4277, '1958-12-08', 'CAPS Adulto', 0, 'Aparecida Gregorio de Carli', 'Ansiedade/nervosismo/roendo unhas/preocupação excessiva e pensamento negativo', 'Sertralina 50mg e Clonazepam 2mg.  Aguardar reavalicão clínica. Manutencão ESF.', 17, 'FINALIZADO'),
	(3713, '2022-06-14', 'Florescer', 7909, '1965-11-04', 'CAPS Adulto', 0, 'Eunice Rosangela Ribeiro', 'laudo para INSS', 'Avaliacão clínica na ESF.', 17, 'FINALIZADO'),
	(3714, '2022-06-14', 'Florescer', 5714, '1988-09-30', 'CAPS Adulto', 0, 'Aline de Oliveira Silva', 'Tricotilomania ha 18 anos(crises esporadica,)no momento esta em crise.Obs :esta amamentando', 'Sertralina 50mg. Orienta-se ajuste da medicacão - sertralina 100mg.', 17, 'FINALIZADO'),
	(3715, '2022-06-14', 'Florescer', 221, '1970-02-12', 'CAPS Adulto', 6544, 'Tania Maria da Silva', 'Tristeza,choro facil,sensação de vazio,nao esta adaptando com escitalopram', 'Agendado ASM 15/06/2022, ás 09:30hs. Reencaminhar ao psicólogo', 17, 'FINALIZADO'),
	(3716, '2022-06-14', 'Florescer', 3107, '2007-08-22', 'CAPS i', 0, 'Matheus Eugenio', 'Portador de paralisia cerebral, crises convulsivas controlada com oxcarbazepina 300mg (1 cp ao dia).Apresenta libido exacerbado', 'Orienta-se medicacao para diminuir a libido exacerbado. Sugerido fluoxetina 20mg.', 17, 'FINALIZADO'),
	(3717, '2022-06-14', 'Florescer', 1621, '2005-11-02', 'CAPS i', 0, 'Sarah Luiza Pressato Silva', '    Rendimento escolar caiu,crise de ansiedade,mae teve que ir busca la na escola varias vezes,em uso de escitalopram e piorou os sintomas,ja esta em tto com psicologo e ativ. fisica,mas ainda tem crises,PROPAC.', 'Em uso de escitalopram 10mg. Orienta-se troca de medicacão, sugere-se paroxetina.', 17, 'FINALIZADO'),
	(3718, '2022-06-14', 'Florescer', 172, '1987-05-29', 'CAPS Adulto', 4813, 'Edilamar Helena dos Santos', 'Não quer tomar depakene,esta causando cefaleia ha uma semana não toma,solicita Clonazepam para dormir.', 'Biperideno, clonazepam, depakene e 02 ampolas de haldol decanoato.  Encaminhar ao Caps. Caps vai fazer busca ativa.', 17, 'FINALIZADO'),
	(3719, '2022-06-14', 'Florescer', 2222, '1943-01-05', 'CAPS Adulto ', 230, 'Alaide dos Santos Nascente', 'Retorno Islene: Visita domiciliar realizada. Tem renda de 2 salários (pensão por morte e aposentadoria); sem empréstimos; paga um vizinho para limpar a casa que estava bastante organizada; sem filhos; aparentemente bem orientada e consciente. Declara que a dona do imóvel não pediu para sair, mas se caso pedisse iria alugar outra casa para morar. Em uso de fenobarbital 100mg - 02cp. Enfermeira relata incidente com uma vela. Pedi para verificar se foi somente um evento isolado. Dra. Rejane avaliar?', 'Manutencão ESF', 17, 'FINALIZADO'),
	(3720, '2022-06-14', 'Florescer', 776, '1970-08-19', 'CAPS Adulto ', 11199, 'Adriana de Fátima Gonçalves', 'Nao dorme,agitada, faz uso diazepan 10mg 2x dia,depakene 250mg,2x dia,nortriptilina 50 mg 1x dia,clorpromazina 100mg  1x. Deficiência visual, intelectual. Paciente oncológica.                 ', 'Ajuste de medicacão. Orienta-se dobrar depakene, clorpromazina e nortriptilina.', 17, 'FINALIZADO'),
	(3721, '2022-06-14', 'CREAS', 0, '0000-00-00', '', 0, 'Maria Conceição Rodrigues', 'Caso passado pelo CREAS. Atendimento realizado com a sobrinha Elenice Rodrigues. Disse que Maria mora sozinha, solteira e sem filhos. Tem insuficiência renal e problemas cardíacos. Se recusou a fazer cateterismo por medo de complicações na cirurgia. Hoje está na Upa porque uma vizinha encontrou muito fraca e acionou o serviço. Só se alimenta com miojo. Não gosta de gastar o seu dinheiro para guardar no banco. Elenice vai sempre ajudar. Maria tem condições financeira mas não aceita pagar uma pessoa para ficar com ela. CREAS que passou o caso. Mantém a casa sempre trancada, mania de perseguição, agressiva, confusão mental, esquecimentos frequentes, fala sozinha. Na sua casa tem uma pá e um facão embaixo do travesseiro. Ameaçou a equipe do Creas quando realizaram Vd. Fiz visita e a mesma não abriu a porta para mim. Sobrinha quer muito continuar ajudando, mas está difícil. Creas sugeriu avaliação psiquiátrica. ', 'Caps vai contatar Creas para saber mais do caso.', 17, 'FINALIZADO'),
	(3722, '2022-07-12', ' Florescer', 6638, '1956-07-25', 'CAPS Adulto ', 11703, 'Maria  Aparecida de Fatima Silva', 'Remarcar consulta dra Rejane, não foi no dia 15/06 SIC não consegue comprar medicações.', 'Usuária passou em consulta no ASM em 15/06. Encaminhada para manutencão ESF.', 17, 'FINALIZADO'),
	(3723, '2022-07-12', 'ASM / QIII AS / CREAS', 0, '0000-00-00', 'Florescer', 0, 'Maria Conceição Rodrigues', 'Retorno A. Social: Atendimento realizado com a sobrinha Elenice em 23/06. Relata que na última internação a tia fugiu do hospital. Agressiva, solteirae sem filhos. Resistente aos cuidados das sobrinhas.Mania de perseguição, guada um facão em baixo do travesseiro. Vi que após o ocorrido a médica da familia encaminhou para neurologista. Sugiro avaliação psiquiatra, para nova tentativa de melhoria nos cuidados da idosa pelas sobrinhas. ', 'Trasferida para próximo matriciamento ', 17, 'FINALIZADO'),
	(3724, '2022-07-12', 'ASM / QIII AS / CREAS', 3010, '2007-12-07', 'CAPS i / Florescer', 130, 'Felipe Lima Maximiniano', 'Islene: Filho da Camila Aparecida de Lima. Foi discutido o caso dele na reunião de rede do CRAS e CREAS. Ele está no Serviço de convivência do CRAS (grupo) e apresenta comportamento estranho: desafiador, imaturo, não responde a regras. Já fez uso de haldol. Questões familiares vulneráveis. Pede avaliação psiquiátrica.', 'Transferida para o próximo matriciamento', 17, 'FINALIZADO'),
	(3725, '2022-07-12', 'Florescer', 7944, '1979-11-01', 'ASM / Florescer', 7944, 'Ana Paula Medeiros', 'Insonia, ansiedade, falta de apetite/ esquecimento/ desorientação', 'Transferida para o próximo matriciamento', 17, 'FINALIZADO'),
	(3726, '2022-07-12', 'Florescer', 3414, '1989-04-04', 'ASM / Florescer', 3414, 'Bruna Aguiar Costa ', 'Insonia/ ansiedade/ desanimo/ não te vontade fazer nada/ tgo/ tgp alterado', 'Transferida para o próximo matriciamento', 17, 'FINALIZADO'),
	(3727, '2022-07-12', 'Florescer', 3184, '2007-04-19', 'ASM / Florescer', 3184, 'Alvaro Humberto Becati', 'Crises de ansiedade, choroso.', 'Transferida para o próximo matriciamento', 17, 'FINALIZADO'),
	(3728, '2022-07-12', 'Florescer', 2664, '1977-11-23', 'ASM / Florescer', 2664, 'Gilsimara M. Do S. Cruz', 'TAG/ Escitalopram 10mg', 'Transferida para o próximo matriciamento', 17, 'FINALIZADO'),
