	(3733, '2022-08-09', 'Florescer', 6312, '1987-11-25', 'CAPS Adulto ', 0, 'Ana Claudia Santos Silva', 'Choro fácil, insonia e ansiedade', 'Manutenção ESF', 17, 'FINALIZADO'),
