	(3735, '2022-08-09', 'Florescer', 3, '1920-01-21', 'CAPS Adulto ', 0, 'Gustavo Vieira Silva', 'Paciente refere ansiedade, mora em republica ,relacionamento conturbado, refere diminuição de libido ,sic esta paranoico com a situação, tambem refere seus pensamentos acelerados e não esta tendo controle sobre eles. Deseja passar no Psicologo', 'Acolhimento psicologia ASM', 17, 'FINALIZADO'),
	(3736, '2022-08-09', 'Florescer', 11, '1901-08-07', 'CAPS Adulto ', 0, 'Ivone Leite Santos Silva', 'Paciente em consulta com tremores, hipotensão, bradicardia /refere tratar depressão (em uso de: paroxetina 20 mg 2 x) preocupada nos ultimos dias com ultimas crise. Histórico de TAE', 'Agendado ASM Dra. Rejane 11/08/2022', 17, 'FINALIZADO'),
