	(3740, '2022-09-06', 'Florescer', 722, '1970-02-12', 'CAPS Adulto', 6544, 'Tania Maria da Silva', 'Paciente relata não adaptar com Desvenlafaxina 50 mg,refere estar chorosa e palpitação, deseja voltar com o escitalopram', 'Reajuste medicação ESF e manutenção', 17, 'FINALIZADO'),
	(3741, '2022-09-06', ' Florescer', 1754, '2007-06-26', 'ASM Q3', 1754, 'Geovana Oliveira', 'Paciente 15 anos refere falecimento do Pai ha 1 ano (ca Laringe) percebeu que seu humor alterou depois disso, com choro frequente e nervosismo / deseja encaminhamento para o psicologo', 'Psicologia ASM', 17, 'FINALIZADO'),
	(3742, '2022-09-06', ' Florescer', 8038, '1971-11-18', 'ASM Q3', 8038, 'Alessandra da Silva', 'Faz uso de Paroxetina 40 mg ha 4 anos sem melhora pra a ansiedade, ja fez uso de: Clonazepam 0.5 mg, Alprazolam 0.5mg e Zolpiden sem melhora, refere pensamentos suicida.', 'Reajuste medicação ESF e manutenção', 17, 'FINALIZADO'),
	(3743, '2022-09-06', 'ASM / QIII AS / CREAS', 2248, '1939-03-22', 'ASM Florescer / CAPS adulto', 2248, 'Maria Conceição Rodrigues', 'Retorno A. Social: Atendimento realizado com a sobrinha Elenice em 23/06 83 anos. Relata que na última internação a tia fugiu do hospital. Agressiva, solteira e sem filhos. Resistente aos cuidados das sobrinhas.Mania de perseguição, guarda um facão em baixo do travesseiro. Vi que após o ocorrido a médica da familia encaminhou para neurologista. Sugiro avaliação psiquiatra, para nova tentativa de melhoria nos cuidados da idosa pelas sobrinhas. Creatinina aumentada.', 'Encaminhada para neuro,nefro e ENVELHECER. Visita domiciliar clínico ESF', 17, 'FINALIZADO'),
