	(3938, '2020-09-15', 'CAPSi', 0, '2004-01-16', ' Damasco', 0, 'Suellen Domingues Costa', 'Paciente está em fila de espera do psicólogo Anderson. Está chorosa, relatando angústia e ansiedade há mais de um ano. Pai (Robson de Abreu Costa) está em tratamento no CAPS Adulto há um mês. ', 'Atendimento psicológico com Denilza ou Luciene', 0, 'FINALIZADO'),
