	(3940, '2020-09-15', 'DAMASCO', 1671, '1963-05-09', 'CAPS Adulto ', 2372, 'Alexandrina Batista Arruda Pedrosa', 'Paciente, era usuaria do CAPS- Faz acompanhamento nesta unidade. Relata uso regular dos medicamentos ASMA não se  sente bem com o  " clorpromazina". Relata " muita ansiedade e tristeza. Deseja fazer acompanhamento com psicologo . Relata ideação de Auto exterminio há 07 dias. ', 'Agendado ASM 16/09 Santana para rever medicação e agendar atendimento psicológico on line. Psicóloga Luciene 3690 2246 e psicóloga Denilza 3223 6248', 0, 'FINALIZADO'),
