	(3945, '2021-03-23', 'Damasco', 1144, '2004-12-25', 'CAPS i', 0, 'Lara Ribeiro Caselato Nascimento', 'Paciente foi avaliada pela Dra Rejane em 2020. Devido ao afastamento da mesma pela eleição , paciente interrompeu TTO,  tendo piora do quadro depressivo.Mãe relata estado depressivo recorrente com ideacão suicida. Iniciado Sertralina 25mg MID há 1 semana.', ' Ajuste da medicacão,           manutencão ESF e aguardando psicoterapia ASM.', 0, 'FINALIZADO'),
	(3946, '2021-04-20', 'CAPS Adulto ', 0, '1982-06-29', 'Damasco', 496, 'Eleonora Priscila da Silva Belo', 'Compareceu ao acolhimento, não apresenta perfil para atendimento no CAPS no momento. Pensamento de AE. Sugiro que seja medicada, se necessário no ESF. Solicito acompanhamento psicológico e consulta com ginecologista. (caso agende consulta no ESF, entrar em contato com a paciente para avisar) 988659103', 'Encaminhar para psicoterapia ASM.', 0, 'FINALIZADO'),
