	(3948, '2021-06-15', 'Damasco', 1958, '1983-09-03', 'CAPS Adulto ', 396, 'Jonatas Maximiano', 'Confusão com a medicação, vai lá  cada hora com uma quantidade de ampolas para ser aplicada.', 'Reencaminhado para medicação no CAPS Adulto.', 0, 'FINALIZADO'),
	(3949, '2021-08-10', 'Damasco', 66, '1970-05-25', 'CAPS Adulto / CAPS Ad', 6232, ' Roseli Juventino', 'Apresentando ideação de AE. Filho diagnosticado com Transtorno Bipolar do Humor. Relata dificuldade de relacionamento com ele. Em uso de: Rivotril 2 mg, Fluoxetina 20 mg e Amitriptilina 25 mg. Na ultima consulta foi trocado Rivotril 2mg por Diazepam 10 mg. Relata melhor aceitação deste e otimizado dosagem de Fluoxetina 20 mg. Nega uso de etilícos. F33+F41+F10', 'Manutenção ESF e psicoterapia ASM', 0, 'FINALIZADO'),
	(3950, '2021-08-10', 'Damasco', 179, '1980-09-06', 'CAPS Adulto ', 11948, 'Paulo Sergio Augusto', 'TBH?  recusa tratamento, ideação AE, está violento, fazendo ameaças, perseguindo ex esposa. Uso irregular da medicação, oscilações do humor.   F33.1+F41.1+ F48.9', 'Encaminhar para acolhimento no CAPS Adulto. S/n orientação da Assitente Social ex esposa Samira, em TTO com psicologo Daniel ASM ', 0, 'FINALIZADO'),
	(3951, '2021-09-14', 'Damasco', 0, '0000-00-00', 'CAPS Adulto ', 0, 'Lila Maria da Silva', 'Crises de pânico, ansiedade, choro, inquieta. Em uso de: Sertralina 50 mg + Rivotril 0.25mg S/n , usava Escitalopram 10 mg , atendente de loja. ', 'Psicoterapia ASM, manutenção ESF, ajuste da medicação e afastamento do trabalho 10 dias.', 0, 'FINALIZADO'),
	(3952, '2021-10-19', 'CAPS Adulto ', 10063, '1964-01-19', 'Damasco', 2079, 'Elma Cândida de Souza Almeida ', 'Paciente compareceu ao CAPS relatando estar passando por dificuldades financeiras, solicitou  a medicação seja revista, e se possível, alterada para uma medicação que ela pegue na rede pública. Em uso de Clorpromazina 25 mg 1-0-2, Diazepam 10 mg 0-0-2, Mirtazapina 15 mg 0-0-1, Nortripitilina 50 mg 1-0-1. F33.2+ F48.8+ F60.3', 'Reajuste medicação e manutenção ESF', 0, 'FINALIZADO'),
	(3953, '2021-11-23', 'CAPS i', 0, '2006-09-13', 'Damasco', 146, 'Maria Fernanda Pederiva de Brito', 'Adolescente compareceu ao CAPS i em ago/21 após 2 crises de ansiedade, onde havia sendo atendida na UPA. Apresentou boa evolução clínica e atualmente apresenta demanda apenas para psicoterapia.', 'Acolhimento psicologia ASM', 0, 'FINALIZADO'),
	(3954, '2021-11-23', 'CAPS i', 0, '2004-05-08', 'Damasco', 44018, 'Paula Vitória Souza Carvalho', 'Endereço: Rua José Barra 88 Centenário. Atendimento realizado; Marcilene muito fragilizada; filho Pietro agitado, deseja avaliação no CAPSi. Filha Paula ansiosa deseja retomar o acompanhamento psicológico. Sugiro avaliação de Marcilene pelo ASM.', 'Acolhimento psicologia ASM', 0, 'FINALIZADO'),
	(3955, '2021-12-21', 'CAPS Adulto', 3172, '1998-11-30', 'Damasco', 11486, 'Estefania Borges Olate', 'Familiares relatam que paciente cessou uso dos medicamentos controlados por conta própria. Não está aceitando mais o tratamento', 'Agendado ASM Dra. Rejane 22/12/21', 0, 'FINALIZADO'),
	(3956, '2022-02-15', 'CAPS Adulto', 0, '1976-07-07', 'Damasco', 429, 'Heliton Climaco da Silva', 'Queixa de que esta muito ancioso, comendo muito. Se incomodando que a vizinhança está falando dele. " Percebo nos ollhos e no jeito das pessoas que estão falando de mim". Em uso de zolpiden 10mg - 01 cp a noite, clonazepan 0,5mg 1/4 cp pela manhã.', 'Agendado ASM Dra. Rejane 16/02/22', 0, 'FINALIZADO'),
	(3957, '2022-03-22', 'CAPS Adulto', 0, '1958-03-02', 'Centenário', 130, 'Sebastiana de Fatima Brigida', 'Deprimida devido falecimento da filha, fez cirurgia CA de pulmão,  embolia em tratamento. Em uso de:Escitalopram 20 mg  e Rivotril 2 mg', 'Manutenção ESF', 0, 'FINALIZADO'),
	(3958, '2022-04-19', 'CAPS Adulto', 2370, '1970-09-10', 'Damasco', 2077, 'Claudia Maria Cordeiro Figueiredo', 'Encaminhada pelo Dr. Márcio para avaliação psiquiátrica. Em uso de:Setratlina 50mg (1cp 12/12h). Medicação não está fazendo o efeito desejado, paciente relata piora dos sintomas depressivos. Depressão recorrente. Vivencia conflitos familiares. Solicito avaliação Dra. Rejane e psicoterapia com o psicólogo Daniel. F33.1+F48.8. Ja usou: Fluoxetina, Rivotril, Imipramina, Escitalopram e Nortripitilina.', 'Reajuste medicação e manutenção ESF. Manter psicoterapia ASM.', 0, 'FINALIZADO'),
