	(3961, '2022-05-17', 'SEMUS ', 0, '2008-11-24', 'Damasco', 104, 'Lidia Coelho Jesus da Costa ', 'Mãe Rosimeire 99741-2883 / 3214-3538 comparece a Secretária de saúde com encaminhamento de BH para atendimento com Psiquiatra, teve um AVC em 2014, no ano de 2021 ja havia sido encaminhada para a psiquiatria devido a um quadro de agressividade. Não absorvida pelo CAPS i . Solicita atendimento no ASM  ', 'Dra. Larissa fará avaliação clínica e se necessário direcionar à Dra. Rejane e acompanhamento psicológico ', 0, 'FINALIZADO'),
	(3962, '2022-05-17', 'CAPS Adulto', 2370, '1970-09-10', 'Damasco', 2077, 'Cláudia Maria Cordeiro Figueiredo', 'Entrou em contato, em 10/05/22, relatando que ainda não tinha sido procurada pelo ESF para agendamento da consulta e que havia perdido sua vaga na psicoterapia. O CAPS entrou em contato com a unidade e solicitou o agendamento, conforme matriciamento. Verificar se a paciente já foi atendida.', 'Dra. Larissa fará agendamento de consulta', 0, 'FINALIZADO'),
