	(4303, '2021-03-30', 'Canaã', 654, '2007-04-12', 'CAPS i', 1350, 'Maria Eduarda Felix Silva', 'Paciente com quadro de ansiedade, choro, compulsão por comida. HP de tratamento no CAPS i e uso previo de Sertralina  e Ritalina (Dr Lucas). Na epoca de tratamento no CAPS i o pai fazia uso de alcool e  drogas.  Diagnóstico de depressão leve relacionada a questão do pai. Recebeu alta prescrito Sertralina 50mg pela Dra Ester. Atualmente não esta usando medicação. ', 'Encaminhamento para psicologa.', 22, 'FINALIZADO'),
	(4304, '2021-03-30', 'CAPS Adulto', 3023, '1967-07-28', 'Canaã', 1552, 'Flávio Santos Faria', 'Não comparece ao CAPS há anos, foi solicitada visita domiciliar. Liliani informou que o paciente não sai de casa, acha que as pessoas falam dele, faz uso de Fenergan para dormir, tem medo de medicação faixa preta, o irmão fez tratamento no CAPS, suicidou. Solicitamos atendimento no ASM. CID 10 F20.0 F41.0 F41.2 F40.1 F40.9 em 2005 (Dra Vivian.) Apresenta movimentos involuntários.', 'Agendado ASM 31/03', 22, 'FINALIZADO'),
	(4305, '2021-03-30', 'Canaã', 5360, '1968-08-01', 'CAPS Adulto  ', 9166, 'Claudia Alckimin Jordão', ' Perda ponderal de 20 kg em 4-5 meses (perda do pai) . Refere irritabilidade e transtorno de ansiedade. CID F48.8 F61.0 Dr Anderson. Apresenta Defictil F79. Não compareceu a consultas no CAPS em 2010. Luto Escitalopram 10 mg ', 'Manutenção UBS', 22, 'FINALIZADO'),
	(4306, '2021-03-30', 'Canaã', 665, '1963-04-06', 'CAPS Adulto', 0, 'Maria Edna Paulino de Lima', 'Cefaleia há 1 ano e insonia. Já fez uso de: Alprazolam, Amitriptilina, Sertralina, Clonazepam, Diazepam e Zolpidem. Relata que ultimamente Bromazepam está dando cefaleia. Já teve episódio de sincope e foi enc. para cardio e neuro. Transtorno Depressivo. Em 2010 foi encaminhada para atendimento psicologico na policlinica no Canãa. Sugestão de ajuste na medicação.  Donaren 50 mg ou Mirtazapina 15 mg', 'Manutenção UBS e Psicoterapia ASM', 22, 'FINALIZADO'),
	(4307, '2021-03-30', 'Canaã', 365, '1963-08-28', 'CAPS Adulto', 0, 'Joel Gonçalo de Brito', 'Ansiedade com episódio de insônia. Faz uso de: Sertralina 50 mg, Biperideno 2 mg, Diazepam 10 mg, Haldol 1 mg ( 2 cps) . Transtorno de Ansiedade. É diabético. Foi suspensa a insulina em 2020. Foi encaminhado para o CAPS/psiquiatria em 08/03/2021 . Reajuste na medicação. Sertralina 100 mg Amitriptilina 25 mg  ou Nortriptilina 25mg ', 'Manutenção UBS Psicoterapia ASM', 22, 'FINALIZADO'),
