	(4377, '2022-02-22', 'Canaã', 885, '2007-09-17', 'CAPS i', 0, 'Isabelle Dias Marques', 'Quadro depressivo e HP: TAE (há 30 dias,uso abusivo de antialérgico). Desânimo, tristeza, automutilação, conflitos familiares. Em uso de Escitalopram 10 mg depois 20 mg.', 'Manutenção UBS e acompanhamento psicológico ASM', 22, 'FINALIZADO'),
	(4378, '2022-02-22', 'CAPS Adulto', 10338, '1972-01-06', 'ASM/UBS Canaã', 6069, 'Maria Letícia Alves Vilela', 'Histórico de depressão. Queixa-se de insônia e angústia. Em uso regular de: sertralina 50mg (1,0,1). Tabagismo, DPOC, hipertensão, conflitos no trabalho. Em uso de Glifage, Losartana, Ciprofibrato, Sertralina. Em acompanhamento psicologia SESMT. F33.1+ F48.8', 'Agendado ASM Dra. Rejane 23/02/2022.', 22, 'FINALIZADO'),
	(4379, '2022-02-23', 'CAPS Adulto', 2856, '1993-10-09', 'PSF IMACULADA', 2856, 'Luana Aparecida Borges', 'Paciente de 28 anos com histórico de síndrome ansiosa depressiva, sofrendo de ansiedade.', '', 22, 'FINALIZADO'),
	(4380, '2022-03-29', 'CAPS Adulto', 3878, '1957-02-23', 'Canaã', 4874, 'Maria do Carmo Dias Ribeiro', 'Depressão, prostração, isolamento. Dores abdominais, acha que está com "doença ruim". Baixa resposta às medicações. F33.2+F60.7. Solicito avaliação Dra. Rejane', 'Agendado ASM Dra. Rejane 30/03/2022', 22, 'FINALIZADO'),
	(4381, '2022-03-29', 'CAPS Adulto', 8045, '1961-05-05', 'Canaã', 642, 'Roberto Paulo Alves', 'Paciente encaminhado pela Dra. Cyntia para reavaliação psiquiátrica. Em uso de haloperidol 1 mg (0.0.1), bromazepam 6 (0.0.1) e amitriptilina 25 (0.0.1). Medicação não está fazendo o efeito desejado. Paciente relata extremo desânimo, que impede a realização das tarefas do dia-a-dia, angústia, tristeza, insônia. Encaminhei para psicoterapia na CLEPSI, orientei a prática de atividade física (caminhada e/ou SEMEL).F41.2+F48.8+F68.0+Z59.7+F61.0 Solicito reavaliação da Dra. Rejane.', 'Agendado ASM Dra. Rejane 30/03/2022', 22, 'FINALIZADO'),
	(4382, '2022-03-29', 'Canaã', 5169, '2005-03-07', 'Capsi', 0, 'Juliana Mendonça Bequima Vilhena', 'Em uso de Escitalopram  30 mg e Rivotril sublingual quando necessário. Psicoterapia na rede privada. Discutir medicação', 'Reajuste medicação e manutenção UBS.', 22, 'FINALIZADO'),
	(4383, '2022-03-29', 'Canaã', 885, '2007-09-17', 'CAPS Adulto', 0, 'Isabelle Dias Marques', 'Desânimo,auto mutilações. Em uso de Escitalopram 20 mg há + ou - 2 meses.Teve melhora. Discutir caso com psicologia', 'Manutenção UBS e psicologia ASM', 22, 'FINALIZADO'),
	(4384, '2022-03-29', 'CAPS Adulto', 0, '1975-12-26', 'Canaã', 1000, 'Marcos Antônio Mizael', 'Queixando insônia e muito nervosismo. Uso de Alprazolan 1mg -01cp/noite.', 'Cadastrar paciente na UBS e Dra. Rejane fará receita.', 22, 'FINALIZADO'),
	(4385, '2022-03-29', 'Canaã', 1343, '1979-05-19', 'CAPS Adulto', 0, 'Regiane da Silva Braulio', 'Quadro depressivo após sequela motora de covid em janeiro/22. Uso de andador.  Deseja avaliação psiquiátrica. Inicou uso de Paroxetina 20 mg há cerca de 5 semanas sem melhora. Esta em uso, tambem, de alprazolam 2 mg (1/2+0+1). Está fazendo fisioterapia. Em tratamento com Dr. Italo. Avaliar agendamento com dra. Rejane', 'Agendado ASM Dra. Rejane 30/03/2022 e lista psicologia ASM.', 22, 'FINALIZADO'),
	(4386, '2022-03-29', 'Canaã', 580, '1958-09-25', 'CAPS Adulto', 0, 'Jose Maria Silva', 'Discutir inicio de medicação. Paciente com perda de peso com avaliação clinica normal. Quadro de ansiedade. Portador de Parkinson e hipertensão, em uso de Prolopa.', 'Reajuste medicação e manutenção UBS.', 22, 'FINALIZADO'),
	(4387, '2022-03-29', 'Canaã', 2363, '1998-10-22', 'CAPS Adulto', 0, 'Lara Priscila D Martin Costa', 'Enc. pela psicóloga da faculdade, dificuldade concentração, suspeita autismo.', 'Agendado ASM Dra Rejane 30/03/2022 e psicologia ASM', 22, 'FINALIZADO'),
	(4388, '2022-04-26', 'CAPS Ad', 3287, '1969-01-08', 'Canaã', 0, 'Donizeti Vitor Candido', 'Encaminhado pelo psiquiatra. Encontra-se abstinente há um ano. História de traumatismo craniano. Fez ressonância e necessita de acompanhamento com neurologista. Diazepam 10 mg à noite, Clorpromazina 25 à noite; Tiamina 300 mg 1 ao dia; Fenitoina 100 mg à noite. ', ' Encaminhado para neurologia e manutenção UBS', 22, 'FINALIZADO'),
	(4389, '2022-04-26', 'Canaã', 0, '2002-06-17', 'CAPS Adulto', 0, 'Pedro Augusto Pires Lacerda', 'Psiquiatra PSF discutir caso com Dr. Fernando. Em uso de: Zolpidem 10 mg 0-0-1, Amitriptilina 25 mg 0-0-2 TAG. TDAH?', 'Manutenção UBS e se necessário teste terapêutico TDAH', 22, 'FINALIZADO'),
	(4390, '2022-04-26', 'Canaã', 509, '1967-10-26', 'CAPS Adulto', 10613, 'Edelmina Estevan', 'Discutir medicação. Avaliar consulta com Dra. Rejane. Ansiosa, hiperflagia, já fez bariátrica, insonia, compulsão alimentar.', 'Encaminhar para psicologia ASM ', 22, 'FINALIZADO'),
	(4391, '2022-04-26', 'Canaã', 4874, '1957-02-23', 'CAPS Adulto', 3878, 'Maria do Carmo Dias Ribeiro', 'Relata desejo de autoextermínio. Crise de choro, solidão, neurose não especificada, poliqueixosa, antecedente de suícidio na família (irmão), medo de doenças, somatização. Em uso de: Amitriptilina, Sertralina 50 mg, Bromazepam 6 mg F33+F48.8', 'Agendado ASM Dra. Rejane 27/04/2022 e psicologia ASM', 22, 'FINALIZADO'),
	(4392, '2022-04-26', 'CAPS Adulto', 11074, '1981-03-02', 'Canaã', 5476, 'Andréa Mambeli Vazi', 'Sua filha é acompanhada no CAPS i. Em visita domiciliar junto com a equipe do CAPS i constatamos que a paciente precisa de uma avaliação psiquiátrica. Já foi paciente Dra Rejane (particular), quando foi prescrito Clozapina 25 mg. No momento sem condições financeiras. ', 'Agendado ASM Dra. Rejane 20/04/2022 e psicologia ASM.', 22, 'FINALIZADO'),
	(4393, '2022-04-26', 'CAPS Adulto', 4376, '1951-02-01', 'Canaã', 5476, 'Sandra Conceição Mambeli Vazzi', 'Faz acompanhamento consultório partircular Dra. Rejane. em uso de : Haldol 5 mg 1-1-1, Bipirideno 2 mg 1-1-1, Lorazepan 2 mg 0-0-1, Neozine 10 gotas, . Queixa moleza no corpo, fica mais deitada. Querendo transferir tratamento para UBS, dificuldade financeira no momento. Maior desestrutura no momento, devido a crise da filha Andrea. Dra. Rejane (partircular) forneceu receita para 1 ano.', 'Manutenção UBS ', 22, 'FINALIZADO'),
	(4394, '2022-04-26', 'Canaã', 5998, '1990-06-19', 'CAPS Adulto', 0, 'Claudio Gomes da Silva', 'Deseja retorno com Dra. Rejane F32.9? F70.9? Depressão, isolamento, dificuldade de entendimento, esquecimento. F32.2', 'Agendado ASM Dra. Rejane 28/04/2022', 22, 'FINALIZADO'),
	(4395, '2022-05-24', 'Canaã', 2363, '1998-10-22', 'ASM', 2363, 'Lara Priscila D Martin Costa', 'Retornou para Alfenas. Relatório da psicologia e psiquiatria. Continuará tratamento piquiatra em Varginha. Marcar para junho?', 'Acompanhamento em Alfenas.', 22, 'FINALIZADO'),
	(4396, '2022-05-24', 'CAPS Ad', 2974, '1979-08-20', 'Canaã', 0, 'Alison Mario Machado', 'Abstinente há 3 meses, trabalhando. Em uso de Diazepam. Manutenção medicamentosa no ESF ', 'Manutenção UBS.', 22, 'FINALIZADO'),
	(4397, '2022-05-24', 'Canaã', 4153, '1969-01-08', 'CAPS Adulto / ASM', 6586, 'Elenice Gonçalves', 'Delírios de perseguição. Não está medicada atualmente. F48.8 (a esclarecer). Já usou Fluoxetina.', 'Agendado ASM Dra. Rejane 25/05/2022. Acompanhamento psicologia ASM.', 22, 'FINALIZADO'),
	(4398, '2022-05-24', 'ASM', 0, '2015-08-27', 'Canãa / CAPS i', 5932, 'Heitor Jacometti ', 'Encaminhado ao posto para atendimento psicologico, tem TOC+TDAH+Transtorno de Ansiedade, apresenta tiques motores e vocais. Fez uso de Aristab 2,5 mg suspenso para observar aumento do TOC + Zoloft 50 mg (mantido). F92? (Dra.Ester), F91.3 ?(Dr. Lucas). Mãe tem  diagnóstico de TBH e pai está com  CA.', 'Discutir o caso com Isabel, para definir onde continuar o acompanhamento psicológico.', 22, 'FINALIZADO'),
	(4399, '2022-05-24', 'CAPS Adulto', 10338, '1972-01-06', 'Canãa', 6069, 'Maria Letícia Alves Vilela', 'Liga solicitando que seja matriciada novamente, pois não compareceu à consulta em fevereiro por motivos de saúde. Informa que a psicóloga tem insistido para que seja avaliada pela psiquiatria. Em uso de: Fluoxetina 20 mg 2-0-2, Haldol 1 mg 1-0-1 e Diazepam 10 mg 0-0-2. F33.2+F48.9, DPOC. Passou com Dr. Anderson em 27/04/2022 e foi encaminhada.', 'Manutenção UBS.', 22, 'FINALIZADO'),
	(4400, '2022-05-24', 'CAPS Adulto', 11074, '1981-03-02', 'Canãa', 5476, 'Andrea Mambeli Vazi', 'Não está bem xingando muito, pai pede q a medicação seja injetável. Pedir a Dra Rejane para atende -la. ', 'Agendado ASM Dra. Rejane 25/05/2022 e reencaminhada psicologia ASM.', 22, 'FINALIZADO'),
