	(4482, '2021-10-26', 'CAPS Adulto', 2547, '1986-11-01', 'Fatima I ', 0, 'Léa Ananias ', 'Está estável, não tem vindo para a permanência dia desde o início da pandemia. Será encaminhada após a próxima consulta, que ocorrerá dia 05/11/2021. Em uso de  Omeprazol 20 mg 2-0-0, Carbamazepina 200 mg 3-0-3, Fenobarbital 100 mg 0-0-3, Clorpromazina 100 mg 0-0-3, Nortripitilina 50 mg 1-0-1, Clonazepam 2 mg 0-0-1, Haldol depo 2 ampolas de 28 em 28 dias. F06.8 + F71.1+ G40.3', 'Será encaminhada após a próxima consulta, que ocorrerá dia 05/11/2021.', 23, 'FINALIZADO'),
	(4483, '2021-12-28', 'Caps Adulto', 10175, '1981-06-05', 'Fátima 1', 0, 'Alessandra Martins', 'Perdeu a consulta de retorno com psiquiatra no Caps. Paciente sempre vem ao Caps com as mesmas quiexas, porém não dá sequência ao tratamento. Deseja tentar benefício ao INSS. Informa uso regular de fluoxetina (1,0,0), clonazepan (20gts à noite).', '', 23, 'FINALIZADO'),
	(4484, '2022-02-22', 'Caps Adulto/ CAPS i', 11744, '2000-12-13', 'ASM', 0, 'Pablo Anderson Pazzini Marques', 'Usuário sem acompanhamento na rede. Último atendimento no Caps Set/2019. Necessitando de consulta psiquiátrica para retomar o tratamento. Queixando insônia. Histórico de dependência química. Fez uso (2019): Divalproato 250 mg 1-0-1, Quetiapina 100 mg 0-0-1', 'Agendar com clínico', 23, 'FINALIZADO'),
	(4485, '2022-02-22', 'CAPS Adulto ', 0, '1993-03-09', 'Fátima I', 0, 'Ana Paula de Souza', 'Fazendo uso de Fluoxetina  20 mg e Clonazepam 2 mg. Matricio o caso para médico ESF e psiquiatra ajustarem um tratamento medicamentoso. Paciente foi encaminhada para psicologia, aguardando atendimento. ', 'Acompanhamento psicológico e manutenção ESF.', 23, 'FINALIZADO'),
	(4486, '2022-03-29', 'CAPS Adulto ', 11106, '1995-07-27', 'Fátima I', 0, 'Davi de Almeida Neres', 'Em uso de risperidona 3mg (0.0.2), nortriptilina 75 mg (1.0.1) e depakene 250mg (2.0.2). Paciente relata que, por duas vezes, teve uma sensação de desmaio. Passou por consulta no CAPS Adulto, feito reajuste na medicação. F20.30', 'Manutenção CAPS Adulto ', 23, 'FINALIZADO'),
	(4487, '2022-03-29', 'CAPS Ad', 3313, '1977-12-12', 'Fátima I', 0, 'Inaldo Fernando Coelho', 'Paciente teve traumatismo craniano em 07/02; confusão mental;. não está fazendo uso de substâncias psicoativas; passou em consulta psiquiátrica em 18/03; foi medicado com Neozine 100 mg, Diazepam 10 mg e Risperidona 2 mg. Encaminhado ao Neuro e ao PSF.', 'Manutenção ESF', 23, 'FINALIZADO'),
	(4488, '2022-03-29', 'Fátima I', 493274, '1977-08-27', 'CAPS Adulto ', 9491, 'Adriene de Oliveira Rosa', 'Paciente em uso de Alprazolam, Rivotril, Atenolol e Tilex. Apresenta sintomas depressivos e insônia. Obstrução intestinal. Faz acompanhamento com Dr Italo.', 'Psicologia ASM  e avaliação clínico ESF se necessário', 23, 'FINALIZADO'),
	(4489, '2022-04-26', 'Fátima I', 403, '1986-01-02', 'CAPS Adulto ', 10729, 'Christiane de Brito Pinto Pereira', 'F31+F29+F25? Em uso de: Haldol 5 mg 1-0-0, Biperideno 2 mg 1-0-0  , Imipramina 25 mg 0-0-2', 'Aguardar retorno ao CAPS Adulto ou ESF.', 23, 'FINALIZADO'),
	(4490, '2022-05-24', 'CAPS Adulto ', 10175, '1981-06-05', 'ASM/Fátima I', 405, 'Alessandra Martins', 'Procura o acolhimento, relatando as mesmas queixas, pensamentos AE, vontade de roubar, delírios, uso de alcool. F41.2+F48.9+ F06.8+F71.1. Em uso de : Fluoxetina e Clonazepam . Caso foi discutido em fevereiro??', 'Agendado ASM Dra. Rejane 26/05/2022.', 23, 'FINALIZADO'),
	(4491, '2022-06-21', 'Fátima I', 493274, '1977-08-27', 'CAPS Adulto ', 9491, 'Adriene de Oliveira Rosa', 'Paciente em uso de: Alprazolam, Rivotril, Atenolol, Tilex e Carbamazepina. Apresenta sintomas depressivos e insônia. Relata história de tentatvas de suicídio. Já passou pelo CAPS.Passou por cirurgia de obstrução intestinal. Fez acompanhamento com Dr Italo. Médico ESF encaminhou novamente para neurologista devido a esquecimentos. Aguarda em fila de espera.', 'Agendado ASM Dra. Rejane 22/06/2022', 23, 'FINALIZADO'),
	(4492, '2022-06-21', 'CAPS Adulto ', 0, '1970-12-25', 'Fatima I / ASM ', 0, 'Fátima Maria Ribeiro', 'Relata ansiedade e síndrome do pânico. Apresentando muita tristeza e choro fácil. Está em psicoterapia semanal, em uso de escitalopram há 2 meses, sem melhora. Solicito avaliação dra Rejane. Suspeita CA pâncreas, filho especial. Resistente a propostas da psicóloga. Irmão suicidou em dez/2020. Filha foi atropelada. Quadro depressivo preocupante', 'Agendado ASM Dra. Rejane dia 23/02/2022', 23, 'FINALIZADO'),
	(4493, '2022-07-19', 'CAPS Ad', 3373, '1978-09-28', 'Fatima I / ASM ', 0, 'Valdecir Sant\'ana Marcolino', 'Encaminhado dra Patricia, agendado psiquiatra e PD 2x na semana. Resistente a frequentar CAPS ad', 'Aguardar retorno ao CAPS Ad ', 23, 'FINALIZADO'),
