	(4496, '2022-08-16', 'Fátima I', 404363, '1970-12-25', 'CAPS Adulto ', 0, 'Fátima Maria Ribeiro', 'Já foi atendida anteriormente pela Dra. Rejane. Mantém sintomas de depressão, angústia e crises de ansiedade. Em uso de Escitalopram 20 mg e Rivotril sublingual. Já usou vários antidepressivos.', 'Manutenção e reajuste medicação ESF e psicologia ASM Aumento do ESC para 30 mg', 23, 'FINALIZADO'),
