	(4592, '2021-11-30', 'CAPS Adulto', 4303, '1978-03-12', 'Fátima II', 4077, 'Adriana das Graças do Carmo', 'A paciente foi avaliada pela Dra. Rejane em 11/03/21 no ASM, que lhe prescreveu depakene 250mg (1.0.1), clonazepam 2mg (0.0.1), tioridazina 50mg (0.0.1/2). Não compareceu ao retorno, à época, por questões de trabalho. Ao renovar a prescrição no PSF, relata que a clínica, Dra. Patrícia, manteve apenas o clonazepam, sendo que a paciente havia  suspendido as demais medicações. A paciente queixa-se de sintomas de ansiedade e solicita reavaliação psiquiátrica. Paciente compareceu em 16/julho/2021 na unidade, informando não ter se adaptado ao tratamento instituído pela dra. Rejane e à época informou ter parado os medicamentos 06 meses antes, por conta própria, alegando tontura e referindo não comunicar a profissional nem comparecer em retorno. Queixou-se apenas de dificuldade para dormir, recebendo prescrição de clonazepam 2 mg. Calma durante consulta, foi orientada comunicar alterações, solicitado retorno para reavaliação e pedido matriciamento CAPS II. Não compareceu em retorno nem nas consultas agendadas em agosto, setembro e novembro. F31', 'Agendado ASM Dra. Rejane 01/12/21', 24, 'FINALIZADO'),
	(4593, '2021-12-28', 'Fátima II', 0, '1962-10-07', 'CAPS II', 0, 'Giuvânia de Fátima Azevedo', 'Paciente compareceu pedindo ajuda pois Dra Patrícia não quer fornecer receita dos medicamentos, mesmo diante de relatório fornecido pela médica que a acompanhava (particular).  Dr Anderason manteve a receita da paciente para 30 dias e a encaminhou para seguir seu acompanhamento médico no PSF.', 'Interrompeu acompanhamento psicológico com Verônica. Manter medicação  (ESF)', 24, 'FINALIZADO'),
