	(4953, '2021-11-30', 'Caps Adulto', 11816, '2001-09-03', 'Pró-Saúde', 2528, 'Júlia Moscardini Ferreira', 'Paciente encaminhada para tratamento no PSF. Última avaliação psiquiátrica no Caps em 01/06/2020. Após esta data, abandonou o tratamento. Retornou, agora, queixando-se de sintomas depressivos, porém, encontra-se estável. Não está fazendo uso de medicação. Avaliação com o clínico agendada para 30/11/21. Na oportunidade, solicito acolhimento psicológico.', 'Manutenção ESF e atendimento psicológico.', 26, 'FINALIZADO'),
