	(5091, '2020-11-17', 'Imaculada', 6855, '1954-03-30', 'CAPS Adulto', 11395, 'Vera Lúcia Mendes', 'Foi feita visita domiciliar da Assistente Social do CAPS em conjunto com Assistentes Sociais do CREAS e NASF, paciente com discurso coerente, porém negava que morava na sua própria residência. Paciente se comprometeu a comparecer ao ESF e não compareceu, nunca passou por avaliação psiquiátrica no CAPS. Familiares entram em contato com o CAPS quando a situação está muito crítica. Acumuladora, insônia, não faz tratamento, não encaminha documentação para BPC', 'ESF entrará em contato com Assistente Social Edézia para dar prosseguimento ao caso.', 28, 'FINALIZADO'),
