	(5094, '2021-03-30', 'CAPS Adulto', 2988, '1982-09-26', 'Imaculada ', 2197, 'Tatiana Justino Oliveira', 'Em uso de: Omeprazol 20 mg (1-0-0 ) + Biperideno 2 mg (2-0-0 ) + Clorpromazina 100 mg (4-0-4) +Clonazepam 2 mg(0-0-4) +Diazepam 10 mg(0-0-4) + Levomepromazina 100mg(0-0-6) + Prometazina 25 mg(0-0-3) + Haldol dec. 4 amp IM. 14/14 dias + Clopixol depot. 2 ampola IM 14/14 dias. F20.3 Encaminhada para manutenção da prescrição no ESF. Dr. Anderson sugere Dra. Rejane fazer o primeiro atendimento, para posteriormente manter com o Clínico.', 'Manutenção medicação ESF / Agendado ASM 01/04', 28, 'FINALIZADO'),
	(5095, '2021-04-27', 'CAPS i ', 517, '2004-12-13', 'Imaculada ', 6542, 'Alexandra Vitoria Chagas', 'Encaminhada para psicoterapia (2019). Episódio de desmaio pós dor aguda (encaminhada para neurologia). Psicoterapia rede privada por Bruna. Atendida pela Dra Ester não preenche no momento criterios para TAB,TAG e transtorno de personalidade devido idade F60.3? Em uso de Escitalopram 10 mg e Quetiapina 25 mg ', 'Agendado ASM 29/04 ', 28, 'FINALIZADO'),
	(5096, '2021-04-27', 'CAPS ad', 0, '1987-04-02', 'Imaculada ', 325, 'Talibia Mara dos Santos', 'Passou por acolhimento, encaminhada para avaliação clinica e regularização do cartão SUS, não absorvida. Relata 9 anos sem uso de substâncias. Edema tireóide.', 'Encaminhada para endocrinologista, pedido US tireóide.', 28, 'FINALIZADO'),
	(5097, '2021-04-27', 'CAPS Adulto', 2988, '1982-09-26', 'Imaculada ', 2197, 'Tatiana Justino Oliveira', 'Não compareceu para consulta agendada. Tem sido levada a unidade para a medicação injetavel regularmente.', 'Manutenção medicação ESF', 28, 'FINALIZADO'),
	(5098, '2021-05-25', 'CAPS Ad', 2840, '1951-09-18', 'Imaculada ', 1045, 'Carlos Renato Viana', 'Paciente está abstinente desde Dez/2020 (álcool). Última consulta em 19/05; em uso de Oxcarbazepina 300 mg 1-0-1, Diazepam 10 mg 0-0-1 e Clorpromazina 25 mg 0-0-1.', 'Manutenção medicação ESF', 28, 'FINALIZADO'),
	(5099, '2021-06-22', 'Imaculada ', 8001, '1991-03-15', 'CAPS Adulto/ASM', 0, 'Elisandra Alves  dos Santos Rodrigues', 'Hospitalização HRSM por crises epilépticas, permaneceu intubada por +/- 10 dias, veio de Lavras. Em uso de: Lamotrigina 100 mg 1-0-1, Fenobarbital 100mg 1-0-1  Hidantal 100 mg 1-0-1 Fluoxetina 20 mg 1-0-0. Consulta agendada com neurologista dia 30/06/21. TAE 11/19', 'Agendado ASM 23/06/21 ', 28, 'FINALIZADO'),
	(5100, '2021-06-22', 'Imaculada', 2815, '2001-09-26', 'CAPS Adulto/ASM', 2815, 'Isadora Pereira Bíscaro', 'Atendimento psiquiátrico. Mãe faleceu de covid em Maio, paciente assumiu as tarefas domésticas da casa. Já havia quadro depressivo anteriormente ao luto. Família está desestruturada.', 'Agendado ASM 23/06/21 Psicoterapia ASM ', 28, 'FINALIZADO'),
	(5101, '2021-06-22', 'Imaculada', 10, '2008-03-23', 'CAPS i / ASM', 10, 'Maria Júlia Lopes da Silva', 'Atendimento psiquiátrico. Suspeita de quadro depressivo, poliqueixosa questões familiares, ideações suicidas. Tia  avó tem a guarda da paciente.', 'Agendado ASM 23/06/21 Psicoterapia ASM ', 28, 'FINALIZADO'),
	(5102, '2021-06-22', 'Imaculada', 588, '1962-06-01', 'CAPS Adulto', 2523, 'Geruza Emilia Souza Luiz', ' Em atendimento no CAPS Adulto, relatou depressão pós parto. CIDs no próntuario F44 F33 F48 F39 F10 F12 F14 F15 F50.9 Teve polineuropatia, bulimia, anorexia e tricotilomania. Era atendida na reabilitação antes da pandemia, solicita acompanhamento psicológico mas não comparece aos atendimentos. Não quer assumir compromisso com horários. Quer aumento de 25% no beneficio, ver se tem direito.', 'Visita domiciliar Assistente Social', 28, 'FINALIZADO'),
	(5103, '2021-06-22', 'CAPS i', 0, '2003-03-27', 'Imaculada ', 8005, 'Djanira dos Santos Juvêncio Laureano', 'Encaminhada para o ambulatório, paciente completou 18 anos, estava em psicoterapia na rede particular e parou com tratamento, necessita de acompanhamento psiquiátrico. Em uso de: Escitalopram 20 mg 0-0-1, Quetiapina 25 mg 0-0-1 Já usou Mirtazapina 30 mg', 'Agendado ASM 24/06/ 21', 28, 'FINALIZADO'),
	(5104, '2021-07-20', 'Imaculada', 477, '1976-04-14', 'CAPS Adulto/ASM', 10321, 'Fábio Eduardo Luiz', 'Encaminhado pelo Dr. Yordy com histórico de epilepsia e psicose afetiva há +/- 3 meses, apresentando mudança de comportamento (agressivo) e insônia. Denúncia de agressão pelos familiares devido a não realizar tarefas domésticas. Em uso de: Haldol 5 mg , Acido Valpróico 250 mg, Bipirideno 2mg, Clonazepam 2mg. F06.2+F71', 'Agendado ASM 21/07/21. Acompanhamento Assistente Social.', 28, 'FINALIZADO'),
	(5105, '2021-07-20', 'CAPS Adulto', 12108, '2000-08-01', 'Imaculada ', 6975, 'Valteir Rezende Ferreira', 'Apresenta queixas de TOC. Em uso de sertralina 50 mg há 15 dias. Encaminhado para o clínico. ', 'Agendado ASM  21/07/21 OBS: estava em São Gonçalo Sapucaí e não pode comparecer a consulta agendada. ', 28, 'FINALIZADO'),
	(5106, '2021-07-20', 'CAPS Adulto', 588, '1982-06-01', 'Imaculada ', 2523, 'Geruza Emilia Souza Luiz', 'Retorno: Realizado Vd em 24/06/21. Relatou que irmã morreu de Covid. Vínculos rompidos com as 2 filhas. Aposentada, acompanhada pelo CRAS Urupes. Sobre o tratamento ablação do estômago continuará o tratamento no município (enfermeiro já providenciou consulta com gastro) sobre a polineuropatia foi preenchido TFD para continuidade do tratamento no Sarah. Farei nova Vd para pegar mais laudos para agendar no sistema. Solicita relatório de avaliação médica para acréscimo de 25 % no beneficio. ', 'Manutenção ESF, gastroenterologia, acompanhamento Assistente Social e TFD (Sarah)', 28, 'FINALIZADO'),
	(5107, '2021-08-17', 'CAPS Adulto', 8048, '1978-05-19', 'Imaculada ', 1051, 'Sônia Maria de Matos', 'Mãe da paciente solicita reavaliação psiquiátrica, haja vista que a filha está muito agitada, nervosa e não dorme bem. Agendada consulta com Dra. Nayane, para dia 04/08. Verificar necessidade de avaliação com Dra. Rejane. ', 'Agendado ASM 18/08/21 ', 28, 'FINALIZADO'),
	(5108, '2021-08-17', 'CAPS Adulto', 11163, '1957-03-14', 'Imaculada', 5328, 'Sebastião Matias de Carvalho', 'Irmã do paciente relata que o mesmo está com sintomas de depressão grave. Higiene precária. Em uso de Nortriptilina 50mg (0.0.1), prescrito pelo Dr. Bruno ESF, que solicita uma avaliação psiquiátrica. Verificar possibilidade de avaliação pela Dra. Rejane.', 'Atendimento Assistente Social Islene e avaliação Dra Rejane s/n', 28, 'FINALIZADO'),
	(5109, '2021-08-17', 'CAPS Adulto', 1572, '1962-01-01', 'Imaculada', 2409, 'Miria de Oliveira', 'Comparece relatando que precisa renovar a receita do Haldol decanoato 1 ampola IM 21 em 21 dias. Relata estar passando bem; sem queixas.', 'Agendado 19/08/21 e manutenção ESF', 28, 'FINALIZADO'),
	(5110, '2021-08-17', 'CAPS Adulto', 10044, '1965-11-07', 'Imaculada', 1685, ' Maria do Carmo Teodoro Marcelino ', 'Encaminhada pelo Dr Ricardo Casarotti da Santa Casa de BH em triagem para cirurgia de Epilepsia refratária. Solicita avaliação e acompanhamento. Com Transtorno de Humor e uso crônico de Clonazepam, resistente a sua retirada. Em acompanhamento com Dr Marcelo Frota neurologista devido quadro de Epilepsia refratária. Em uso de: Lamotrigina:100 mg 1-1-1 Depakote 500 mg  1-1-1  Clobazam 20 mg 0-0-2  Clonazepam 2 mg  0-0-1  Levetiracetam 750 mg 1-0-1. ', 'Agendado ASM 19/08/21', 28, 'FINALIZADO'),
	(5111, '2021-09-21', 'CAPS Ad', 3209, '1985-06-09', 'Imaculada', 17, 'Paulo César dos Santos Carvalho', 'Compareceu em acolhimento em 25/08/2021; relatou estar abstinente há 06 meses; saiu de CT em agosto/2021; sem fissura; sem sintomas depressivos; Em uso de Fluoxetina 20 mg, Amitriptilina 25 mg, Carbamazepina 200 mg; Diazepam 10 mg. Encaminhado para ESF para continuidade de tratamento medicamentoso; sem demanda para o CAPS Ad neste momento. ', 'Manutenção ESF', 28, 'FINALIZADO'),
	(5112, '2021-09-21', 'CAPS i', 1487, '2006-05-11', ' Imaculada', 0, 'Isadora Oliveira Martins', 'Conversar sobre a adolescente e família, e aliar condutas clínicas. TAE, dor de estômago.', 'Avaliação clínica ESF', 28, 'FINALIZADO'),
