	(5114, '2021-09-21', 'CAPS Adulto', 1163, '1957-03-14', 'Imaculada', 5328, 'Sebastião Matias de Carvalho', ' Retorno Islene: Entrei em contato com Marta para informar que articulei com CRAS Urupês sobre o pedido da senha do Meu Inss. Passei a senha para seu controle e orientei que qualquer dúvida pode entrar em contato com CRAS. Também orientei que há maior probabilidade do irmão conseguir o Loas no próximo ano em que completará 65 anos de idade. Marta deseja que o irmão passe em consuta com Dra, Rejane para fechar o diagnóstico do irmão. F33.2 uso irregular de Nortripitilina 50 mg ', 'Reajuste e manutenção ESF', 28, 'FINALIZADO'),
