	(5128, '2022-02-22', 'CAPS Adulto', 8035, '1978-12-22', 't', 500, 'Adriana Arantes Simões', 'Paciente de 43 anos, histórico de depressão, largou o tratamento há anos (Paroxetina). Voltou com sintomas de ansiedade, choro fácil.Último registro no CAPS em 2005. Tel: 3212- 6124/ 9960-6367', 'Aguardar comparecimento ao Serviço.', 28, 'FINALIZADO'),
	(5129, '2022-02-22', 'CAPS Adulto', 0, '1998-09-08', 'Imaculada', 0, 'Matheus Luca Carrota Gabriel', 'Paciente vem a pedido da Psicóloga que o acompanha, queixa alterações de humor frequentes, depressão, sente um vazio muito grande. Já usou drogas no passado. Não faz uso de medicação.', 'Agendado ASM Dra. Rejane 24/02/2022. ', 28, 'FINALIZADO'),
	(5130, '2022-02-22', 'Pró-Saúde', 2856, '1963-02-18', 'CAPS Adulto', 10050, 'Maria Aparecida Pereira Mendes Borges', 'Paciente com diversas medicações, queixa alucinações e perda de memória. Em tratamento no Envelhecer. Em uso de Duloxetina 60 mg e Quetiapina 25 mg.', 'Agendado ASM Dra. Rejane 24/02/2022. ', 28, 'FINALIZADO'),
	(5131, '2022-03-29', 'CAPS Adulto', 0, '1980-08-27', 'ESF/ ASM', 9069, 'Jéssica Chagas Oliveira Martins', 'Jéssica, que é mãe da adolescente Isadora Oliveira Martins (D.N.: 11/05/06, paciente está bem) acompanhada pelo CAPSi e rede intersetorial, estava sendo atendida pela Dra. Rejane (ASM). Segundo informações da família, Jéssica não está em tratamento medicamentoso regular e está em crise/surto desde dia 17/03/2022 pelo menos, tendo sido atendida pelo SAMU e PM dia 20/03, mantendo-se resistente a qualquer atendimento. Necessário conversar sobre Jéssica e possibilidades de intervenções. ', 'Agendado ASM Dra. Rejane 31/03/2022.', 28, 'FINALIZADO'),
	(5132, '2022-04-26', 'CAPS i', 1487, '2006-05-11', 'Imaculada/ ASM', 9069, 'Isadora Oliveira Martins', 'Conversar sobre a adolescente que foi encaminhada para atendimento clínico e psicológico.', 'Manutenção ESF e psicologia ASM', 28, 'FINALIZADO'),
	(5133, '2022-05-24', 'CAPS Adulto', 11427, '1990-05-02', 'Imaculada', 1862, 'Mariana Aparecida Fonseca', 'Paciente relata sintomas de pânico, bem como depressivos. Já é paciente da Dra. Rejane no ASM. Diz que a medicação não tem feito o efeito desejado. Solicito reavaliação psiquiátrica pela Dra. Rejane e atendimento psicológico (encaminhamento para psicoterapia já entregue à paciente no acolhimento).', 'Agendado ASM Dra. Rejane 26/05/2022', 28, 'FINALIZADO'),
	(5134, '2022-05-24', 'CAPS Adulto', 0, '1940-05-07', 'Imaculada', 2556, 'Tarcisa de Santana Neves', 'Queixa-se de alterações visuais e choro. Sentindo tristeza por depender dos cuidados dos filhos,que sic, não tem paciência. Psicose afetiva. Cega, diabetes.', 'Visita domiciliar clínico (Fátima) e VD assistente social ASM.', 28, 'FINALIZADO'),
	(5135, '2022-05-24', 'CAPS Adulto', 10981, '1972-02-16', 'Imaculada', 5782, 'Neusa Aparecida Ribeiro Pereira', 'Crises nervosas, pensamentos de morte, TAE em fevereiro. Membros inferiores amputados (diabetes, trombose,tabagismo, alcolismo). Em acompanhamento no CREAS (Nefagi). Em uso de Amitripitilina 25 mg 1 ao dia, Fluoxetina 20 mg 1 ao dia, Diazepam 0-0-1. Companheiro é usuário de drogas ilícitas.', 'VD assistente social ASM, caso seja necessário encaminhar para consulta psiquiatria.', 28, 'FINALIZADO'),
	(5136, '2022-05-24', 'CAPS Adulto', 0, '1975-09-18', 'Imaculada', 3767, 'Andreia Ferreira da Silva', 'Muito desanimada , chorosa , sem objetivo de viver , dores no corpo, exames clinicos alterados. Ja em uso de Venlafaxina 150 mg 1 0 0, Bromazepan 6 mg 0 0 1. Obesidade, não sai de casa.', 'Agendado ASM Dra. Rejane 25/05/2022.', 28, 'FINALIZADO'),
	(5137, '2022-06-21', 'CAPS Adulto', 1572, '1962-01-01', 'Imaculada/ASM', 2409, 'Miria de Oliveira', 'Família relata quadro de agitação, insonia, além de polidipsia, e perda de peso. Quadro desencadeado após internação há 3 sem/ para biópsia de endométrio (ca de endo). Diabetes descompensada (HI) e HAS (PA 160X90). Encaminhada a UPA. Solicito avaliação do ESF p/ seguimento e ajuste de medicação p/ DM e HAS.', 'Agendar consulta clínico geral', 28, 'FINALIZADO'),
	(5138, '2022-06-21', 'CAPS Adulto', 0, '1960-09-20', 'Imaculada/ASM', 127, 'Ronilda Pressato', 'Veio ao CAPS relatando que medicação que usa (Meleril 25) há 15 anos está em falta nas farmácias. Dispenso 60 cp via CAPS. Matricio o caso para discussão, pois pcte está preocupada com a falta no comércio.', 'Agendado ASM Dra. Rejane dia 22/06/2022', 28, 'FINALIZADO'),
	(5139, '2022-07-19', 'CAPS Adulto', 10981, '1972-02-16', 'Imaculada', 5782, 'Neusa Aparecida Ribeiro Pereira', 'Cadeirante, apresentando conflitos familiares, envolvendo CRAS e CREAS. No passado já fez uso Haldol decanoato. Não quis vir ao CAPS. Peço atendimento Dra Rejane. Já foi oferecido programa Porta a Porta', 'Agendado ASM Dra. Rejane 20/07/2022', 28, 'FINALIZADO'),
	(5140, '2022-07-19', 'Imaculada ', 9063, '1996-08-21', 'CAPS Adulto ', 0, 'Hyago Medeiros Franco Canalonga Pereira', 'Tratamento prévio com Ritalina, por 6 meses, há 4 anos, prescrito por Dr. Italo (neurologista). Refere sintomas de impulsividade, desatenção e hiperatividade há mais de 6 meses. Sertralina 50mg 1.0.0. Encaminho p/ psicólogo. Peço avaliação Dra Rejane, para retorno do tratamento.', 'Agendado ASM Dra. Rejane 21/07/2022', 28, 'FINALIZADO'),
	(5141, '2022-07-19', 'Imaculada ', 9249, '1951-06-27', 'CAPS Ad', 0, 'José Maria Tavares', 'Etilista crônico (destilado diariamente). Com discurso de A/E. Mora sozinho, sem contato com familiares. Vizinha (Rosângela) presta cuidados. Encaminhado ao psicólogo que entra em contato com CREAS/CRAS (Cientes). Encaminho ao CAPS Ad, porém paciente não compareceu. Solicito busca ativa CAPS Ad.', 'Busca ativa CAPS ad', 28, 'FINALIZADO'),
	(5142, '2022-07-19', 'Imaculada ', 9059, '2007-03-10', 'CAPS i', 0, 'Davi Paiva Rodrigues', 'Em acolhimento estendido no CAPS i, usando Escitalopram 10mg 1.0.0, porém sintomas persistem. Foi encaminhado pela escola com suspeita de TDAH. Orientado a mudar o tratamento pelo psicólogo. Solicito avaliação Dra Rejane.', 'Fará audiometria e avaliação do processamento auditivo. Aguardar exames. Manterá CAPS i, aguardar psicologia no ESF', 28, 'FINALIZADO'),
	(5143, '2022-07-19', 'CAPS Adulto', 10050, '1963-02-18', 'Imaculada', 2856, 'Maria Aparecida Pereira Mendes Borges', 'Solicitada avaliação da psiquiatria pela médica geriatra.', 'Agendado ASM Dra. Rejane 21/07/2022', 28, 'FINALIZADO'),
	(5144, '2022-07-19', 'CAPS i', 0, '2007-03-02', 'Imaculada', 0, 'Rillary Kelly Veloso Cancian', 'Encaminhada para atendimento psiquiátrico pela UPA. No entanto, comparece em acolhimento 20 dias após encaminhamento, sem estar em crise, porém na expectativa da consulta psiquiátrica.', 'Fará cadastro no ESF, avaliação do clinico,  caso necessário, retornar caso em discusão de matriciamento ', 28, 'FINALIZADO'),
	(5145, '2022-08-16', 'Imaculada', 4082, '1957-06-07', 'ASM', 10719, 'Maria de Lourdes de Deus', 'Histórico de atendimento há mais de ano pela Dra. Rejane. Em tratamento p/ t. depressivo (Escitalopram 20mg 1.0.0 / Alprazolam 2mg 1.0.1/ Clonazepam 2mg 0.1.0) e também IAM prévio. Com crises recorrentes, veio com carta da Cardiologista solicitando prioridade para atendimento psiquiátrico (com ideação suicida). ', 'Agendado ASM Dra. Rejane 17/08/2022', 28, 'FINALIZADO'),
	(5146, '2022-08-16', 'Imaculada ', 684, '2013-04-10', 'ASM', 684, 'Yasmim Victoria Fernandes Narciso ', 'Necessita de atendimento psiquiatrico, devido aos fatos vividos esta tendo alterações ( aluna escola CAIC) ', 'Agendado atendimento psicologia ASM', 28, 'FINALIZADO'),
