	(5148, '2022-09-13', 'CAPS i ', 0, '2019-06-29', 'Imaculada', 2175, 'Samuel Souza Bueno', 'Suspeita de autismo', 'Encaminhamento para avaliação FUVAE.', 28, 'FINALIZADO'),
	(5149, '2022-09-13', 'CAPS Adulto ', 4750, '1972-03-23', 'Imaculada', 5899, 'Carlos Rodrigo da Cunha', 'Paciente do Dr. Italo, já tratou no CAPS no passado. Cid 10: F33.2 + F41.2. Vem com encaminhamento para retomar o tratamento, queixa de estar ouvindo vozes de comando. Atualmente em uso de medicamentos anticonvulsivos. Discutir o caso para elaborar um PTI.', 'Agendado ASM Dra. Rejane 15/09/2022', 28, 'FINALIZADO'),
	(5150, '2022-09-13', 'Imaculada', 5883, '1980-06-26', 'CAPS Adulto / ASM', 0, 'Maria de Fátima Batista Rodrigues Braz', 'Em acompanhamento com psicóloga, orientada agendar psiquiatra. Sobrinha questiona comportamento da tia, que vem apresentando alucinações, discurso desconexo, "perseguição".. Nega uso de medicamentos no momento.', 'Agendado ASM Dra. Rejane 14/09/2022', 28, 'FINALIZADO'),
