	(5269, '2021-03-30', 'CAPS Adulto', 10925, '1980-01-31', 'CAIC I', 1065, 'Cristina Bernardes Teixeira', 'Matriciar para troca de informações. Paciente relata que o clínico acrescentou (Fluoxetina de 20 mg 2-0-0) a medicação prescrita: Clomipramina 25 mg (0.0.3) + Alprazolam1 mg (0.0.2), há + ou - 15 dias.Relata que a falta de ar melhorou um pouco. Queixa esquecimentos, não se lembra das coisas que fez. Verifica várias vêzes se fechou a porta,se tomou remédio. Queixa medo de tudo, ficando mais em casa,desanimada até para tomar banho. Pede relatório. Relata que na UBS não dão relatório (INSS não aceita relatório de clínico). Feito relatório de serviço Quer consultar com Dra Rejane.', 'Agendado ASM dia 31/03', 30, 'FINALIZADO'),
