	(5276, '2021-06-22', 'CAIC I', 5336, '1960-01-17', 'CAPS Adulto', 12164, 'Lázaro Feliciano', 'Não sai de casa, quadro de pelagra, atraso intelectual? Irmãs estiveram no CAPS relatando que paciente bebia muito, chegou em casa com roupas diferentes, a partir desse evento (2016)  não sai mais de casa e não bebe mais. Foi prescrito Haldol 25 de gotas e agendada reavaliação 30/06 Dr Anderson. Esposa e filha tem prontuário no CAPS Adulto com hipoteses diagnósticas F20 F71 F70', 'Aguardar consulta 30/06 e reajustado Haldol para 50 gotas dia ', 30, 'FINALIZADO'),
